INSERT INTO `abilities_dex` (`no`, `id`, `name`, `desc`, `short_desc`, `rating`) VALUES
(91, 'adaptability', 'Adaptability', 'This Pokemon''s attacks that receive STAB (Same Type Attack Bonus) are increased from 50% to 100%.', 'This Pokemon''s same-type attack bonus (STAB) is increased from 1.5x to 2x.', 4),
(185, 'aerilate', 'Aerilate', 'Turns all of this Pokemon''s Normal-typed attacks into Flying-type and deal 1.3x damage. Does not affect Hidden Power.', 'This Pokemon''s Normal moves become Flying-type and do 1.3x damage.', 3),
(106, 'aftermath', 'Aftermath', 'If a contact move knocks out this Pokemon, the opponent receives damage equal to one-fourth of its max HP.', 'If this Pokemon is KOed with a contact move, that move''s user loses 1/4 its max HP.', 3),
(76, 'airlock', 'Air Lock', 'While this Pokemon is active, all weather conditions and their effects are disabled.', 'While this Pokemon is active, all weather conditions and their effects are disabled.', 3),
(148, 'analytic', 'Analytic', 'If the user moves last, the power of that move is increased by 30%.', 'This Pokemon''s attacks do 1.3x damage if it is the last to move in a turn.', 1),
(83, 'angerpoint', 'Anger Point', 'If this Pokemon, or its Substitute, is struck by a Critical Hit, its Attack is boosted to six stages.', 'If this Pokemon (not a Substitute) is hit by a critical hit, its Attack is boosted by 12.', 2),
(107, 'anticipation', 'Anticipation', 'A warning is displayed if an opposing Pokemon has the moves Fissure, Guillotine, Horn Drill, Sheer Cold, or any attacking move from a type that is considered super effective against this Pokemon (including Counter, Mirror Coat, and Metal Burst). Hidden Power, Judgment, Natural Gift and Weather Ball are considered Normal-type moves. Flying Press is considered a Fighting-type move.', 'On switch-in, this Pokemon shudders if any foe has a super effective or OHKO move.', 1),
(71, 'arenatrap', 'Arena Trap', 'When this Pokemon enters the field, its opponents cannot switch or flee the battle unless they are part Flying-type, have the Levitate ability, are holding Shed Shell, or they use the moves Baton Pass or U-Turn. Flying-type and Levitate Pokemon cannot escape if they are holding Iron Ball or Gravity is in effect. Levitate Pokemon also cannot escape if their ability is disabled through other means, such as Skill Swap or Gastro Acid.', 'Prevents foes from switching out normally unless they have immunity to Ground.', 5),
(165, 'aromaveil', 'Aroma Veil', 'Protects this Pokemon and its allies from Attract, Disable, Encore, Heal Block, Taunt, and Torment.', 'Protects from Attract, Disable, Encore, Heal Block, Taunt, and Torment.', 3),
(188, 'aurabreak', 'Aura Break', 'Reverses the effect of Dark Aura and Fairy Aura.', 'Reverses the effect of Aura abilities.', 2),
(123, 'baddreams', 'Bad Dreams', 'If asleep, each of this Pokemon''s opponents receives damage equal to one-eighth of its max HP.', 'Causes sleeping adjacent foes to lose 1/8 of their max HP at the end of each turn.', 2),
(4, 'battlearmor', 'Battle Armor', 'Critical Hits cannot strike this Pokemon.', 'This Pokemon cannot be struck by a critical hit.', 1),
(145, 'bigpecks', 'Big Pecks', 'Prevents the Pokemon''s Defense stat from being reduced.', 'Prevents other Pokemon from lowering this Pokemon''s Defense.', 1),
(66, 'blaze', 'Blaze', 'When its health reaches one-third or less of its max HP, this Pokemon''s Fire-type attacks receive a 50% boost in power.', 'When this Pokemon has 1/3 or less of its max HP, its Fire attacks do 1.5x damage.', 2),
(171, 'bulletproof', 'Bulletproof', 'This Pokemon is protected from some Ball and Bomb moves.', 'This Pokemon is protected from ball and bomb moves.', 3),
(167, 'cheekpouch', 'Cheek Pouch', 'Restores HP when this Pokemon consumes a berry.', 'Restores HP when this Pokemon consumes a berry.', 2),
(34, 'chlorophyll', 'Chlorophyll', 'If this Pokemon is active while Sunny Day is in effect, its speed is temporarily doubled.', 'If Sunny Day is active, this Pokemon''s Speed is doubled.', 2),
(29, 'clearbody', 'Clear Body', 'Opponents cannot reduce this Pokemon''s stats; they can, however, modify stat changes with Power Swap, Guard Swap and Heart Swap and inflict stat boosts with Swagger and Flatter. This ability does not prevent self-inflicted stat reductions.', 'Prevents other Pokemon from lowering this Pokemon''s stat stages.', 2),
(13, 'cloudnine', 'Cloud Nine', 'While this Pokemon is active, all weather conditions and their effects are disabled.', 'While this Pokemon is active, all weather conditions and their effects are disabled.', 3),
(16, 'colorchange', 'Color Change', 'This Pokemon''s type changes according to the type of the last move that hit this Pokemon.', 'This Pokemon''s type changes to match the type of the last move that hit it.', 2),
(172, 'competitive', 'Competitive', 'Raises the user''s Special Attack stat by two stages when a stat is lowered, including the Special Attack stat. This does not include self-induced stat drops like those from Close Combat.', 'This Pokemon''s SpAtk is boosted by 2 for each of its stats that is lowered by a foe.', 2),
(14, 'compoundeyes', 'Compound Eyes', 'The accuracy of this Pokemon''s moves receives a 30% increase; for example, a 75% accurate move becomes 97.5% accurate.', 'This Pokemon''s moves have their accuracy boosted to 1.3x.', 4),
(126, 'contrary', 'Contrary', 'Stat changes are inverted.', 'If this Pokemon has a stat boosted it is lowered instead, and vice versa.', 4),
(130, 'cursedbody', 'Cursed Body', '30% chance of disabling one of the opponent''s moves when attacked. This works even if the attacker is behind a Substitute, but will not activate if the Pokemon with Cursed Body is behind a Substitute.', 'If this Pokemon is hit by an attack, there is a 30% chance that move gets Disabled.', 2),
(56, 'cutecharm', 'Cute Charm', 'If an opponent of the opposite gender directly attacks this Pokemon, there is a 30% chance that the opponent will become Attracted to this Pokemon.', '30% chance of infatuating Pokemon of the opposite gender if they make contact.', 1),
(6, 'damp', 'Damp', 'While this Pokemon is active, no Pokemon on the field can use Selfdestruct or Explosion.', 'While this Pokemon is active, Selfdestruct, Explosion, and Aftermath do not work.', 1),
(186, 'darkaura', 'Dark Aura', 'Increases the power of all Dark-type moves in battle to 1.33x.', 'Increases the power of all Dark-type moves in battle to 1.33x.', 3),
(129, 'defeatist', 'Defeatist', 'Attack and Special Attack are halved when HP is less than half.', 'When this Pokemon has 1/2 or less of its max HP, its Attack and Sp. Atk are halved.', -1),
(128, 'defiant', 'Defiant', 'Raises the user''s Attack stat by two stages when a stat is lowered, including the Attack stat. This does not include self-induced stat drops like those from Close Combat.', 'This Pokemon''s Attack is boosted by 2 for each of its stats that is lowered by a foe.', 2),
(88, 'download', 'Download', 'If this Pokemon switches into an opponent with equal Defenses or higher Defense than Special Defense, this Pokemon''s Special Attack receives a 50% boost. If this Pokemon switches into an opponent with higher Special Defense than Defense, this Pokemon''s Attack receive a 50% boost.', 'On switch-in, Attack or Sp. Atk is boosted by 1 based on the foes'' weaker Defense.', 4),
(2, 'drizzle', 'Drizzle', 'When this Pokemon enters the battlefield, the weather becomes Rain Dance (for 5 turns normally, or 8 turns while holding Damp Rock).', 'On switch-in, the weather becomes Rain Dance.', 5),
(70, 'drought', 'Drought', 'When this Pokemon enters the battlefield, the weather becomes Sunny Day (for 5 turns normally, or 8 turns while holding Heat Rock).', 'On switch-in, the weather becomes Sunny Day.', 5),
(87, 'dryskin', 'Dry Skin', 'This Pokemon absorbs Water attacks and gains a weakness to Fire attacks. If Sunny Day is in effect, this Pokemon takes damage. If Rain Dance is in effect, this Pokemon recovers health.', 'This Pokemon is healed 1/4 by Water, 1/8 by Rain; is hurt 1.25x by Fire, 1/8 by Sun.', 4),
(48, 'earlybird', 'Early Bird', 'This Pokemon will remain asleep for half as long as it normally would; this includes both opponent-induced sleep and user-induced sleep via Rest.', 'This Pokemon''s sleep status lasts half as long as usual, self-induced or not.', 3),
(27, 'effectspore', 'Effect Spore', 'If an opponent directly attacks this Pokemon, there is a 30% chance that the opponent will become either poisoned, paralyzed or put to sleep. There is an equal chance to inflict each status.', '30% chance of poisoning, paralyzing, or causing sleep on Pokemon making contact.', 2),
(187, 'fairyaura', 'Fairy Aura', 'Increases the power of all Fairy-type moves in battle to 1.33x.', 'Increases the power of all Fairy-type moves in battle to 1.33x.', 3),
(111, 'filter', 'Filter', 'This Pokemon receives one-fourth reduced damage from Super Effective attacks.', 'This Pokemon receives 3/4 damage from super effective attacks.', 3),
(49, 'flamebody', 'Flame Body', 'If an opponent directly attacks this Pokemon, there is a 30% chance that the opponent will become burned.', '30% chance of burning a Pokemon making contact with this Pokemon.', 2),
(138, 'flareboost', 'Flare Boost', 'When the user with this ability is burned, its Special Attack is raised by 50%.', 'When this Pokemon is burned, its special attacks do 1.5x damage.', 3),
(18, 'flashfire', 'Flash Fire', 'This Pokemon is immune to all Fire-type attacks; additionally, its own Fire-type attacks receive a 50% boost if a Fire-type move hits this Pokemon. Multiple boosts do not occur if this Pokemon is hit with multiple Fire-type attacks.', 'This Pokemon''s Fire attacks do 1.5x damage if hit by one Fire move; Fire immunity.', 3),
(122, 'flowergift', 'Flower Gift', 'If this Pokemon is active while Sunny Day is in effect, its Attack and Special Defense stats (as well as its partner''s stats in double battles) receive a 50% boost.', 'If user is Cherrim and Sunny Day is active, it and allies'' Attack and Sp. Def are 1.5x.', 3),
(166, 'flowerveil', 'Flower Veil', 'Prevents ally Grass-type Pokemon from being statused or having their stats lowered.', 'Prevents lowering of ally Grass-type Pokemon''s stats.', 0),
(59, 'forecast', 'Forecast', 'This Pokemon''s type changes according to the current weather conditions: it becomes Fire-type during Sunny Day, Water-type during Rain Dance, Ice-type during Hail and remains its regular type otherwise.', 'Castform''s type changes to the current weather condition''s type, except Sandstorm.', 4),
(108, 'forewarn', 'Forewarn', 'The move with the highest Base Power in the opponent''s moveset is revealed.', 'On switch-in, this Pokemon is alerted to the foes'' move with the highest Base Power.', 1),
(132, 'friendguard', 'Friend Guard', 'Reduces the damage received from an ally in a double or triple battle.', 'This Pokemon''s allies receive 3/4 damage from other Pokemon''s attacks.', 0),
(119, 'frisk', 'Frisk', 'When this Pokemon enters the field, it identifies all the opponent''s held items.', 'On switch-in, this Pokemon identifies the foe''s held items.', 2),
(169, 'furcoat', 'Fur Coat', 'Halves the damage done to this Pokemon by physical attacks.', 'Halves physical damage done to this Pokemon.', 4),
(177, 'galewings', 'Gale Wings', 'This Pokemon''s Flying-type moves have their priority increased by 1.', 'Gives priority to Flying-type moves.', 5),
(82, 'gluttony', 'Gluttony', 'This Pokemon consumes its held berry when its health reaches 50% max HP or lower.', 'When this Pokemon has 1/2 or less of its max HP, it uses certain Berries early.', 2),
(183, 'gooey', 'Gooey', 'Contact with this Pokemon lowers the attacker''s Speed stat by 1.', 'Contact with this Pokemon lowers the attacker''s Speed.', 3),
(179, 'grasspelt', 'Grass Pelt', 'This Pokemon''s Defense is boosted in Grassy Terrain', 'This Pokemon''s Defense is boosted in Grassy Terrain.', 2),
(62, 'guts', 'Guts', 'When this Pokemon is poisoned (including Toxic), burned, paralyzed or asleep (including self-induced Rest), its Attack stat receives a 50% boost; the burn status'' Attack drop is also ignored.', 'If this Pokemon is statused, its Attack is 1.5x; burn''s Attack drop is ignored.', 3),
(139, 'harvest', 'Harvest', 'When the user uses a held Berry, it has a 50% chance of having it restored at the end of the turn. This chance becomes 100% during Sunny Day.', '50% chance this Pokemon''s Berry is restored at the end of each turn. 100% in Sun.', 2),
(131, 'healer', 'Healer', 'Has a 30% chance of curing an adjacent ally''s status ailment at the end of each turn in Double and Triple Battles.', '30% chance of curing an adjacent ally''s status at the end of each turn.', 0),
(85, 'heatproof', 'Heatproof', 'This Pokemon receives half damage from both Fire-type attacks and residual burn damage.', 'This Pokemon receives half damage from Fire-type attacks and burn damage.', 3),
(134, 'heavymetal', 'Heavy Metal', 'The user''s weight is doubled. This increases user''s base power of Heavy Slam and Heat Crash, as well as damage taken from the opponent''s Low Kick and Grass Knot, due to these moves being calculated by the target''s weight.', 'This Pokemon''s weight is doubled.', -1),
(118, 'honeygather', 'Honey Gather', 'If it is not already holding an item, this Pokemon may find and be holding Honey after a battle.', 'No competitive use.', 0),
(37, 'hugepower', 'Huge Power', 'This Pokemon''s Attack stat is doubled. Therefore, if this Pokemon''s Attack stat on the status screen is 200, it effectively has an Attack stat of 400; which is then subject to the full range of stat boosts and reductions.', 'This Pokemon''s Attack is doubled.', 5),
(55, 'hustle', 'Hustle', 'This Pokemon''s Attack receives a 50% boost but its Physical attacks receive a 20% drop in Accuracy. For example, a 100% accurate move would become an 80% accurate move. The accuracy of moves that never miss, such as Aerial Ace, remains unaffected.', 'This Pokemon''s Attack is 1.5x and accuracy of its physical attacks is 0.8x.', 3),
(93, 'hydration', 'Hydration', 'If this Pokemon is active while Rain Dance is in effect, it recovers from poison, paralysis, burn, sleep and freeze at the end of the turn.', 'This Pokemon has its status cured at the end of each turn if Rain Dance is active.', 2),
(52, 'hypercutter', 'Hyper Cutter', 'Opponents cannot reduce this Pokemon''s Attack stat; they can, however, modify stat changes with Power Swap or Heart Swap and inflict a stat boost with Swagger. This ability does not prevent self-inflicted stat reductions.', 'Prevents other Pokemon from lowering this Pokemon''s Attack.', 2),
(115, 'icebody', 'Ice Body', 'If active while Hail is in effect, this Pokemon recovers one-sixteenth of its max HP after each turn. If a non-Ice-type Pokemon receives this ability through Skill Swap, Role Play or the Trace ability, it will not take damage from Hail.', 'If Hail is active, this Pokemon heals 1/16 of its max HP each turn; immunity to Hail.', 3),
(35, 'illuminate', 'Illuminate', 'When this Pokemon is in the first slot of the player''s party, it doubles the rate of wild encounters.', 'No competitive use.', 0),
(149, 'illusion', 'Illusion', 'Illusion will change the appearance of the Pokemon to a different species. This is dependent on the last Pokemon in the player''s party. Along with the species itself, Illusion is broken when the user is damaged, but is not broken by Substitute, weather conditions, status ailments, or entry hazards. Illusion will replicate the type of Poke Ball, the species name, and the gender of the Pokemon it is masquerading as.', 'This Pokemon appears as the last Pokemon in the party until it takes direct damage.', 5),
(17, 'immunity', 'Immunity', 'This Pokemon cannot become poisoned nor Toxic poisoned.', 'This Pokemon cannot be poisoned. Gaining this Ability while poisoned cures it.', 1),
(150, 'imposter', 'Imposter', 'As soon as the user comes into battle, it Transforms into its opponent, copying the opponent''s stats exactly, with the exception of HP. Imposter copies all stat changes on the target originating from moves and abilities such as Swords Dance and Intimidate, but not from items such as Choice Specs. Imposter will not Transform the user if the opponent is an Illusion or if the opponent is behind a Substitute.', 'On switch-in, this Pokemon copies the foe it''s facing; stats, moves, types, Ability.', 5),
(151, 'infiltrator', 'Infiltrator', 'Ignores Substitute, Reflect, Light Screen, and Safeguard on the target.', 'This Pokemon''s moves ignore the foe''s Substitute, Reflect, Light Screen, Safeguard, and Mist.', 3),
(39, 'innerfocus', 'Inner Focus', 'This Pokemon cannot be made to flinch.', 'This Pokemon cannot be made to flinch.', 1),
(15, 'insomnia', 'Insomnia', 'This Pokemon cannot be put to sleep; this includes both opponent-induced sleep as well as user-induced sleep via Rest.', 'This Pokemon cannot fall asleep. Gaining this Ability while asleep cures it.', 2),
(22, 'intimidate', 'Intimidate', 'When this Pokemon enters the field, the Attack stat of each of its opponents lowers by one stage.', 'On switch-in, this Pokemon lowers adjacent foes'' Attack by 1.', 4),
(160, 'ironbarbs', 'Iron Barbs', 'All moves that make contact with the Pokemon with Iron Barbs will damage the user by 1/8 of their maximum HP after damage is dealt.', 'This Pokemon causes other Pokemon making contact to lose 1/8 of their max HP.', 3),
(89, 'ironfist', 'Iron Fist', 'This Pokemon receives a 20% power boost for the following attacks: Bullet Punch, Comet Punch, Dizzy Punch, Drain Punch, Dynamicpunch, Fire Punch, Focus Punch, Hammer Arm, Ice Punch, Mach Punch, Mega Punch, Meteor Mash, Shadow Punch, Sky Uppercut, and Thunderpunch. Sucker Punch, which is known Ambush in Japan, is not boosted.', 'This Pokemon''s punch-based attacks do 1.2x damage. Sucker Punch is not boosted.', 3),
(154, 'justified', 'Justified', 'Will raise the user''s Attack stat one level when hit by any Dark-type moves. Unlike other abilities with immunity to certain typed moves, the user will still receive damage from the attack. Justified will raise Attack one level for each hit of a multi-hit move like Beat Up.', 'This Pokemon''s Attack is boosted by 1 after it is damaged by a Dark-type attack.', 2),
(51, 'keeneye', 'Keen Eye', 'This Pokemon''s Accuracy cannot be lowered.', 'Prevents other Pokemon from lowering this Pokemon''s accuracy.', 1),
(103, 'klutz', 'Klutz', 'This Pokemon ignores both the positive and negative effects of its held item, other than the speed-halving and EV-enhancing effects of Macho Brace, Power Anklet, Power Band, Power Belt, Power Bracer, Power Lens, and Power Weight. Fling cannot be used.', 'This Pokemon''s held item has no effect, except Macho Brace. Fling cannot be used.', 0),
(102, 'leafguard', 'Leaf Guard', 'If this Pokemon is active while Sunny Day is in effect, it cannot become poisoned, burned, paralyzed or put to sleep (other than user-induced Rest). Leaf Guard does not heal status effects that existed before Sunny Day came into effect.', 'If Sunny Day is active, this Pokemon cannot be statused and Rest will fail for it.', 1),
(26, 'levitate', 'Levitate', 'This Pokemon is immune to Ground-type attacks, Spikes, Toxic Spikes and the Arena Trap ability; it loses these immunities while holding Iron Ball, after using Ingrain or if Gravity is in effect.', 'This Pokemon is immune to Ground; Gravity, Ingrain, Smack Down, Iron Ball nullify it.', 4),
(135, 'lightmetal', 'Light Metal', 'The user''s weight is halved. This decreases the damage taken from Low Kick and Grass Knot, and also lowers user''s base power of Heavy Slam and Heat Crash, due these moves being calculated by the target and user''s weight.', 'This Pokemon''s weight is halved.', 1),
(32, 'lightningrod', 'Lightningrod', 'During double battles, this Pokemon draws any single-target Electric-type attack to itself. If an opponent uses an Electric-type attack that affects multiple Pokemon, those targets will be hit. This ability does not affect Electric Hidden Power or Judgment. The user is immune to Electric and its Special Attack is increased one stage when hit by one.', 'This Pokemon draws Electric moves to itself to boost Sp. Atk by 1; Electric immunity.', 4),
(7, 'limber', 'Limber', 'This Pokemon cannot become paralyzed.', 'This Pokemon cannot be paralyzed. Gaining this Ability while paralyzed cures it.', 2),
(64, 'liquidooze', 'Liquid Ooze', 'When another Pokemon uses Absorb, Drain Punch, Dream Eater, Giga Drain, Leech Life, Leech Seed or Mega Drain against this Pokemon, the attacking Pokemon loses the amount of health that it would have gained.', 'This Pokemon damages those draining HP from it for as much as they would heal.', 1),
(156, 'magicbounce', 'Magic Bounce', 'Non-damaging moves are reflected back at the user.', 'This Pokemon blocks certain status moves and uses the move itself.', 5),
(98, 'magicguard', 'Magic Guard', 'Prevents all damage except from direct attacks.', 'This Pokemon can only be damaged by direct attacks.', 5),
(170, 'magician', 'Magician', 'If this Pokemon is not holding an item, it steals the held item of a target it hits with a move.', 'This Pokemon steals the held item of a target it hits with a move.', 2),
(40, 'magmaarmor', 'Magma Armor', 'This Pokemon cannot become frozen.', 'This Pokemon cannot be frozen. Gaining this Ability while frozen cures it.', 1),
(42, 'magnetpull', 'Magnet Pull', 'When this Pokemon enters the field, Steel-type opponents cannot switch out nor flee the battle unless they are holding Shed Shell or use attacks like U-Turn or Baton Pass.', 'Prevents Steel-type foes from switching out normally.', 5),
(63, 'marvelscale', 'Marvel Scale', 'When this Pokemon becomes burned, poisoned (including Toxic), paralyzed, frozen or put to sleep (including self-induced sleep via Rest), its Defense receives a 50% boost.', 'If this Pokemon is statused, its Defense is 1.5x.', 3),
(178, 'megalauncher', 'Mega Launcher', 'Boosts the power of Aura and Pulse moves, such as Aura Sphere and Dark Pulse, by 50%.', 'Boosts the power of Aura/Pulse moves by 50%.', 3),
(58, 'minus', 'Minus', 'This Pokemon''s Special Attack receives a 50% boost in double battles if a partner has the Plus or Minus ability.', 'If an ally has the Ability Plus or Minus, this Pokemon''s Sp. Atk is 1.5x.', 0),
(104, 'moldbreaker', 'Mold Breaker', 'When this Pokemon uses any move, it nullifies the Ability of any active Pokemon that hinder or empower this Pokemon''s attacks. These abilities include Battle Armor, Clear Body, Damp, Dry Skin, Filter, Flash Fire, Flower Gift, Heatproof, Herbivore, Hyper Cutter, Immunity, Inner Focus, Insomnia, Keen Eye, Leaf Guard, Levitate, Lightningrod, Limber, Magma Armor, Marvel Scale, Motor Drive, Oblivious, Own Tempo, Sand Veil, Shell Armor, Shield Dust, Simple, Snow Cloak, Solid Rock, Soundproof, Sticky Hold, Storm Drain, Sturdy, Suction Cups, Tangled Feet, Thick Fat, Unaware, Vital Spirit, Volt Absorb, Water Absorb, Water Veil, White Smoke and Wonder Guard.', 'This Pokemon''s moves ignore any Ability that could modify the effectiveness.', 3),
(141, 'moody', 'Moody', 'At the end of each turn, the Pokemon raises a random stat that isn''t already +6 by two stages, and lowers a random stat that isn''t already -6 by one stage. These stats include accuracy and evasion.', 'Boosts a random stat by 2 and lowers another stat by 1 at the end of each turn.', 5),
(78, 'motordrive', 'Motor Drive', 'This Pokemon is immune to all Electric-type moves (including Status moves). If hit by an Electric-type attack, its Speed increases by one stage.', 'This Pokemon''s Speed is boosted by 1 if hit by an Electric move; Electric immunity.', 3),
(153, 'moxie', 'Moxie', 'If this Pokemon knocks out another Pokemon with a damaging attack, its Attack is raised by one stage.', 'This Pokemon''s Attack is boosted by 1 if it attacks and faints another Pokemon.', 4),
(136, 'multiscale', 'Multiscale', 'If this Pokemon is at full HP, it takes half damage from attacks.', 'If this Pokemon is at full HP, it takes half damage from attacks.', 4),
(121, 'multitype', 'Multitype', 'If this Pokemon is Arceus, its type and sprite change to match its held Plate. Either way, this Pokemon is holding a Plate, the Plate cannot be taken (such as by Trick or Thief). This ability cannot be Skill Swapped, Role Played or Traced.', 'If this Pokemon is Arceus, its type changes to match its held Plate.', 4),
(152, 'mummy', 'Mummy', 'When the user is attacked by a contact move, the opposing Pokemon''s ability is turned into Mummy as well. Multitype, Wonder Guard and Mummy itself are the only abilities not affected by Mummy. The effect of Mummy is not removed by Mold Breaker, Turboblaze, or Teravolt.', 'Pokemon making contact with this Pokemon have their Ability changed to Mummy.', 1),
(30, 'naturalcure', 'Natural Cure', 'When this Pokemon switches out of battle, it is cured of poison (including Toxic), paralysis, burn, freeze and sleep (including self-induced Rest).', 'This Pokemon has its status cured when it switches out.', 4),
(99, 'noguard', 'No Guard', 'Every attack used by or against this Pokemon will always hit, even during evasive two-turn moves such as Fly and Dig.', 'Every move used by or against this Pokemon will always hit.', 4),
(96, 'normalize', 'Normalize', 'Makes all of this Pokemon''s attacks Normal-typed.', 'This Pokemon''s moves all become Normal-typed.', -1),
(12, 'oblivious', 'Oblivious', 'This Pokemon cannot be infatuated (by Attract or Cute Charm) or taunted. Gaining this Ability while afflicted by either condition cures it.', 'This Pokemon cannot be infatuated or taunted. Gaining this Ability cures it.', 1),
(142, 'overcoat', 'Overcoat', 'In battle, the Pokemon does not take damage from weather conditions like Sandstorm or Hail. It is also immune to powder moves.', 'This Pokemon is immune to residual weather damage, and powder moves.', 2),
(65, 'overgrow', 'Overgrow', 'When its health reaches one-third or less of its max HP, this Pokemon''s Grass-type attacks receive a 50% boost in power.', 'When this Pokemon has 1/3 or less of its max HP, its Grass attacks do 1.5x damage.', 2),
(20, 'owntempo', 'Own Tempo', 'This Pokemon cannot be confused. Gaining this Ability while confused cures it.', 'This Pokemon cannot be confused. Gaining this Ability while confused cures it.', 1),
(184, 'parentalbond', 'Parental Bond', 'Allows the Pokemon to hit twice with the same move in one turn. Second hit has 0.5x base power. Does not affect Status, multihit, or spread moves (in doubles).', 'Hits twice in one turn. Second hit has 0.5x base power.', 5),
(124, 'pickpocket', 'Pickpocket', 'If this Pokemon has no item, it steals an item off an attacking Pokemon making contact.', 'If this Pokemon has no item, it steals an item off a Pokemon making contact.', 1),
(53, 'pickup', 'Pickup', 'If an opponent uses a consumable item, Pickup will give the Pokemon the item used, if it is not holding an item. If multiple Pickup Pokemon are in play, one will pick up a copy of the used Berry, and may or may not use it immediately. Works on Berries, Gems, Absorb Bulb, Focus Sash, Herbs, Cell Battery, Red Card, and anything that is thrown with Fling.', 'If this Pokemon has no item, it finds one used by an adjacent Pokemon this turn.', 0),
(182, 'pixilate', 'Pixilate', 'Turns all of this Pokemon''s Normal-typed attacks into Fairy-type and deal 1.3x damage. Does not affect Hidden Power.', 'This Pokemon''s Normal moves become Fairy-type and do 1.3x damage.', 3),
(57, 'plus', 'Plus', 'This Pokemon''s Special Attack receives a 50% boost in double battles if a partner has the Plus or Minus ability.', 'If an ally has the Ability Plus or Minus, this Pokemon''s Sp. Atk is 1.5x.', 0),
(90, 'poisonheal', 'Poison Heal', 'If this Pokemon becomes poisoned (including Toxic), it will recover 1/8 of its max HP after each turn.', 'This Pokemon is healed by 1/8 of its max HP each turn when poisoned; no HP loss.', 4),
(38, 'poisonpoint', 'Poison Point', 'If an opponent contact attacks this Pokemon, there is a 30% chance that the opponent will become poisoned.', '30% chance of poisoning a Pokemon making contact with this Pokemon.', 2),
(143, 'poisontouch', 'Poison Touch', 'This Pokemon''s contact attacks have a 30% chance of poisoning the target.', 'This Pokemon''s contact moves have a 30% chance of poisoning.', 2),
(158, 'prankster', 'Prankster', 'This Pokemon''s Status moves have their priority increased by 1 stage.', 'This Pokemon''s Status moves have their priority increased by 1.', 5),
(46, 'pressure', 'Pressure', 'If this Pokemon is the target of a foe''s move, that move loses one additional PP.', 'If this Pokemon is the target of a foe''s move, that move loses one additional PP.', 2),
(168, 'protean', 'Protean', 'Right before this Pokemon uses a move, it changes its type to match that move. Hidden Power is interpreted as its Hidden Power type, rather than Normal.', 'Right before this Pokemon uses a move, it changes its type to match that move.', 4),
(74, 'purepower', 'Pure Power', 'This Pokemon''s Attack stat is doubled. Note that this is the Attack stat itself, not the base Attack stat of its species.', 'This Pokemon''s Attack is doubled.', 5),
(95, 'quickfeet', 'Quick Feet', 'When this Pokemon is poisoned (including Toxic), burned, paralyzed, asleep (including self-induced Rest) or frozen, its Speed stat receives a 50% boost; the paralysis status'' Speed drop is also ignored.', 'If this Pokemon is statused, its Speed is 1.5x; paralysis'' Speed drop is ignored.', 3),
(44, 'raindish', 'Rain Dish', 'If the weather is Rain Dance, this Pokemon recovers 1/16 of its max HP after each turn.', 'If the weather is Rain Dance, this Pokemon heals 1/16 of its max HP each turn.', 2),
(155, 'rattled', 'Rattled', 'Raises the user''s Speed one stage when hit by a Dark-, Bug-, or Ghost-type move.', 'This Pokemon gets +1 Speed if hit by a Dark-, Bug-, or Ghost-type attack.', 2),
(120, 'reckless', 'Reckless', 'When this Pokemon uses an attack that causes recoil damage, or an attack that has a chance to cause recoil damage such as Jump Kick and High Jump Kick, the attacks''s power receives a 20% boost.', 'This Pokemon''s attacks with recoil or crash damage do 1.2x damage; not Struggle.', 3),
(174, 'refrigerate', 'Refrigerate', 'Turns all of this Pokemon''s Normal-typed attacks into Ice-typed and deal 1.3x damage. Does not affect Hidden Power.', 'This Pokemon''s Normal moves become Ice-type and do 1.3x damage.', 3),
(144, 'regenerator', 'Regenerator', 'This Pokemon heals 1/3 of its max HP when it switches out.', 'This Pokemon heals 1/3 of its max HP when it switches out.', 4),
(79, 'rivalry', 'Rivalry', 'This Pokemon''s attacks do 1.25x damage if their target is the same gender, but 0.75x if their target is the opposite gender.', 'This Pokemon''s attacks do 1.25x on same gender targets; 0.75x on opposite gender.', 1),
(69, 'rockhead', 'Rock Head', 'This Pokemon does not receive recoil damage except from Struggle, Life Orb, or crash damage from Jump Kick or High Jump Kick.', 'This Pokemon does not take recoil damage besides Struggle, Life Orb, crash damage.', 3),
(24, 'roughskin', 'Rough Skin', 'Causes recoil damage equal to 1/8 of the opponent''s max HP if an opponent makes contact.', 'This Pokemon causes other Pokemon making contact to lose 1/8 of their max HP.', 3),
(50, 'runaway', 'Run Away', 'Unless this Pokemon is under the effects of a trapping move or ability, such as Mean Look or Shadow Tag, it will escape from wild Pokemon battles without fail.', 'No competitive use.', 0),
(159, 'sandforce', 'Sand Force', 'Raises the power of this Pokemon''s Rock, Ground, and Steel-type moves by 1.3x if the weather is Sandstorm. This Pokemon is also immune to residual Sandstorm damage.', 'This Pokemon''s Rock/Ground/Steel attacks do 1.3x in Sandstorm; immunity to it.', 2),
(146, 'sandrush', 'Sand Rush', 'This Pokemon''s Speed is doubled if the weather is Sandstorm. This Pokemon is also immune to residual Sandstorm damage.', 'If Sandstorm is active, this Pokemon''s Speed is doubled; immunity to Sandstorm.', 2),
(45, 'sandstream', 'Sand Stream', 'When this Pokemon enters the battlefield, the weather becomes Sandstorm (for 5 turns normally, or 8 turns while holding Smooth Rock).', 'On switch-in, the weather becomes Sandstorm.', 5),
(8, 'sandveil', 'Sand Veil', 'This Pokemon''s Evasion is boosted by 1.25x if the weather is Sandstorm. This Pokemon is also immune to residual Sandstorm damage.', 'If Sandstorm is active, this Pokemon''s evasion is 1.25x; immunity to Sandstorm.', 2),
(157, 'sapsipper', 'Sap Sipper', 'This Pokemon is immune to Grass moves. If hit by a Grass move, its Attack is increased by one stage (once for each hit of Bullet Seed). Does not affect Aromatherapy.', 'This Pokemon''s Attack is boosted by 1 if hit by any Grass move; Grass immunity.', 4),
(113, 'scrappy', 'Scrappy', 'This Pokemon has the ability to hit Ghost-type Pokemon with Normal-type and Fighting-type moves. Effectiveness of these moves takes into account the Ghost-type Pokemon''s other weaknesses and resistances.', 'This Pokemon can hit Ghost-types with Normal- and Fighting-type moves.', 3),
(32, 'serenegrace', 'Serene Grace', 'This Pokemon''s moves have their secondary effect chance doubled. For example, if this Pokemon uses Ice Beam, it will have a 20% chance to freeze its target.', 'This Pokemon''s moves have their secondary effect chance doubled.', 4),
(23, 'shadowtag', 'Shadow Tag', 'When this Pokemon enters the field, its non-Ghost-type opponents cannot switch or flee the battle unless they have the same ability, are holding Shed Shell, or they use the moves Baton Pass or U-Turn.', 'Prevents foes from switching out normally unless they also have this Ability.', 5),
(61, 'shedskin', 'Shed Skin', 'At the end of each turn, this Pokemon has a 33% chance to heal itself from poison (including Toxic), paralysis, burn, freeze or sleep (including self-induced Rest).', 'This Pokemon has a 33% chance to have its status cured at the end of each turn.', 4),
(125, 'sheerforce', 'Sheer Force', 'Raises the base power of all moves that have any secondary effects by 30%, but the secondary effects are ignored. Some side effects of moves, such as recoil, draining, stat reduction, and switching out usually aren''t considered secondary effects. If a Pokemon with Sheer Force is holding a Life Orb and uses an attack that would be boosted by Sheer Force, then the move gains both boosts and the user receives no Life Orb recoil (only if the attack is boosted by Sheer Force).', 'This Pokemon''s attacks with secondary effects do 1.3x damage; nullifies the effects.', 4),
(75, 'shellarmor', 'Shell Armor', 'Attacks targeting this Pokemon can''t be critical hits.', 'This Pokemon cannot be struck by a critical hit.', 1),
(19, 'shielddust', 'Shield Dust', 'If the opponent uses a move that has secondary effects that affect this Pokemon in addition to damage, the move''s secondary effects will not trigger (For example, Ice Beam loses its 10% freeze chance).', 'This Pokemon is not affected by the secondary effect of another Pokemon''s attack.', 2),
(86, 'simple', 'Simple', 'This Pokemon doubles all of its positive and negative stat modifiers. For example, if this Pokemon uses Curse, its Attack and Defense stats increase by two stages and its Speed stat decreases by two stages.', 'This Pokemon has its own stat boosts and drops doubled as they happen.', 4),
(92, 'skilllink', 'Skill Link', 'When this Pokemon uses an attack that strikes multiple times in one turn, such as Fury Attack or Spike Cannon, such attacks will always strike for the maximum number of hits.', 'This Pokemon''s multi-hit attacks always hit the maximum number of times.', 4),
(112, 'slowstart', 'Slow Start', 'After this Pokemon switches into the battle, its Attack and Speed stats are halved for five turns. For example, if this Pokemon has an Attack stat of 400, its Attack will be 200 until the effects of Slow Start wear off.', 'On switch-in, this Pokemon''s Attack and Speed are halved for 5 turns.', -2),
(97, 'sniper', 'Sniper', 'When this Pokemon lands a Critical Hit, the damage is increased to another 1.5x.', 'If this Pokemon strikes with a critical hit, the damage is increased by 50%', 1),
(81, 'snowcloak', 'Snow Cloak', 'This Pokemon''s Evasion is boosted by 1.25x if the weather is Hail. This Pokemon is also immune to residual Hail damage.', 'If Hail is active, this Pokemon''s evasion is 1.25x; immunity to Hail.', 1),
(117, 'snowwarning', 'Snow Warning', 'When this Pokemon enters the battlefield, the weather becomes Hail (for 5 turns normally, or 8 turns while holding Icy Rock).', 'On switch-in, the weather becomes Hail.', 4),
(94, 'solarpower', 'Solar Power', 'If the weather is Sunny Day, this Pokemon''s Special Attack is 1.5x, but it loses 1/8 of its max HP at the end of every turn.', 'If Sunny Day is active, this Pokemon''s Sp. Atk is 1.5x and loses 1/8 max HP per turn.', 2),
(116, 'solidrock', 'Solid Rock', 'Super-effective attacks only deal 3/4 their usual damage against this Pokemon.', 'This Pokemon receives 3/4 damage from super effective attacks.', 3),
(43, 'soundproof', 'Soundproof', 'This Pokemon is immune to the effects of sound-based moves, which are: Bug Buzz, Chatter, Echoed Voice, Grasswhistle, Growl, Heal Bell, Hyper Voice, Metal Sound, Perish Song, Relic Song, Roar, Round, Screech, Sing, Snarl, Snore, Supersonic, and Uproar. This ability doesn''t affect Heal Bell.', 'This Pokemon is immune to sound-based moves, except Heal Bell.', 2),
(3, 'speedboost', 'Speed Boost', 'At the end of every turn, this Pokemon''s Speed increases by one stage (except the turn it switched in).', 'This Pokemon''s Speed is boosted by 1 at the end of each full turn on the field.', 5),
(100, 'stall', 'Stall', 'This Pokemon moves last among Pokemon using the same or greater priority moves.', 'This Pokemon moves last among Pokemon using the same or greater priority moves.', -1),
(176, 'stancechange', 'Stance Change', 'Only affects Aegislash. If this Pokemon uses a Physical or Special move, it changes to Blade forme. If this Pokemon uses King''s Shield, it changes to Shield forme.', 'The Pokemon changes form depending on how it battles.', 5),
(9, 'static', 'Static', 'If an opponent contact attacks this Pokemon, there is a 30% chance that the opponent will become paralyzed.', '30% chance of paralyzing a Pokemon making contact with this Pokemon.', 2),
(80, 'steadfast', 'Steadfast', 'If this Pokemon flinches, its Speed increases by one stage.', 'If this Pokemon flinches, its Speed is boosted by 1.', 1),
(1, 'stench', 'Stench', 'This Pokemon''s damaging moves that don''t already have a flinch chance gain a 10% chance to cause flinch.', 'This Pokemon''s attacks without a chance to flinch have a 10% chance to flinch.', 0),
(60, 'stickyhold', 'Sticky Hold', 'This Pokemon cannot lose its held item due to another Pokemon''s attack.', 'This Pokemon cannot lose its held item due to another Pokemon''s attack.', 1),
(114, 'stormdrain', 'Storm Drain', 'During double battles, this Pokemon draws any single-target Water-type attack to itself. If an opponent uses an Water-type attack that affects multiple Pokemon, those targets will be hit. This ability does not affect Water Hidden Power, Judgment or Weather Ball. The user is immune to Water and its Special Attack is increased one stage when hit by one.', 'This Pokemon draws Water moves to itself to boost Sp. Atk by 1; Water immunity.', 4),
(173, 'strongjaw', 'Strong Jaw', 'This Pokemon receives a 50% power boost for jaw attacks such as Bite and Crunch.', 'This Pokemon''s bite-based attacks do 1.5x damage.', 3),
(5, 'sturdy', 'Sturdy', 'This Pokemon is immune to OHKO moves, and will survive with 1 HP if hit by an attack which would KO it while at full health.', 'If this Pokemon is at full HP, it lives one hit with at least 1HP. OHKO moves fail on it.', 3),
(21, 'suctioncups', 'Suction Cups', 'This Pokemon cannot be forced to switch out by another Pokemon''s attack or item.', 'This Pokemon cannot be forced to switch out by another Pokemon''s attack or item.', 3),
(105, 'superluck', 'Super Luck', 'This Pokemon''s critical hit ratio is boosted by 1.', 'This Pokemon''s critical hit ratio is boosted by 1.', 1),
(68, 'swarm', 'Swarm', 'When its health reaches 1/3 or less of its max HP, this Pokemon''s Bug-type attacks do 1.5x damage.', 'When this Pokemon has 1/3 or less of its max HP, its Bug attacks do 1.5x damage.', 2),
(175, 'sweetveil', 'Sweet Veil', 'Prevents allies from being put to Sleep.', 'Prevents allies from being put to Sleep.', 0),
(33, 'swiftswim', 'Swift Swim', 'If the weather is Rain Dance, this Pokemon''s Speed is doubled.', 'If the weather is Rain Dance, this Pokemon''s Speed is doubled.', 2),
(180, 'symbiosis', 'Symbiosis', 'This Pokemon immediately passes its item to an ally after their item is consumed.', 'This Pokemon passes its item to an ally after their item is consumed.', 0),
(28, 'synchronize', 'Synchronize', 'If an opponent burns, poisons or paralyzes this Pokemon, it receives the same condition.', 'If another Pokemon burns/poisons/paralyzes this Pokemon, it also gets that status.', 3),
(77, 'tangledfeet', 'Tangled Feet', 'When this Pokemon is confused, attacks targeting it have a 50% chance of missing.', 'This Pokemon''s evasion is doubled as long as it is confused.', 1),
(101, 'technician', 'Technician', 'When this Pokemon uses an attack that has 60 Base Power or less (including Struggle), the move''s Base Power receives a 50% boost. For example, a move with 60 Base Power effectively becomes a move with 90 Base Power.', 'This Pokemon''s attacks of 60 Base Power or less do 1.5x damage. Includes Struggle.', 4),
(140, 'telepathy', 'Telepathy', 'This Pokemon will not take damage from its allies'' spread moves in double and triple battles.', 'This Pokemon does not take damage from its allies'' attacks.', 0),
(164, 'teravolt', 'Teravolt', 'When this Pokemon uses any move, it nullifies the Ability of any active Pokemon that hinder or empower this Pokemon''s attacks. These abilities include Battle Armor, Clear Body, Damp, Dry Skin, Filter, Flash Fire, Flower Gift, Heatproof, Herbivore, Hyper Cutter, Immunity, Inner Focus, Insomnia, Keen Eye, Leaf Guard, Levitate, Lightningrod, Limber, Magma Armor, Marvel Scale, Motor Drive, Oblivious, Own Tempo, Sand Veil, Shell Armor, Shield Dust, Simple, Snow Cloak, Solid Rock, Soundproof, Sticky Hold, Storm Drain, Sturdy, Suction Cups, Tangled Feet, Thick Fat, Unaware, Vital Spirit, Volt Absorb, Water Absorb, Water Veil, White Smoke and Wonder Guard.', 'This Pokemon''s moves ignore any Ability that could modify the effectiveness.', 3),
(47, 'thickfat', 'Thick Fat', 'This Pokemon receives half damage from Ice-type and Fire-type attacks.', 'This Pokemon receives half damage from Fire- and Ice-type attacks.', 3),
(110, 'tintedlens', 'Tinted Lens', 'This Pokemon''s attacks that are not very effective on a target do double damage.', 'This Pokemon''s attacks that are not very effective on a target do double damage.', 4),
(67, 'torrent', 'Torrent', 'When its health reaches 1/3 or less of its max HP, this Pokemon''s Water-type attacks do 1.5x damage.', 'When this Pokemon has 1/3 or less of its max HP, its Water attacks do 1.5x damage.', 2),
(181, 'toughclaws', 'Tough Claws', 'This Pokemon''s contact attacks do 1.33x damage.', 'This Pokemon''s contact attacks do 33% more damage.', 3),
(137, 'toxicboost', 'Toxic Boost', 'When this Pokemon is poisoned, its physical attacks do 1.5x damage.', 'When this Pokemon is poisoned, its physical attacks do 1.5x damage.', 3),
(36, 'trace', 'Trace', 'When this Pokemon enters the field, it temporarily copies an opponent''s ability. This ability remains with this Pokemon until it leaves the field.', 'On switch-in, or when it can, this Pokemon copies a random adjacent foe''s Ability.', 4),
(54, 'truant', 'Truant', 'After this Pokemon is switched into battle, it skips every other turn.', 'This Pokemon skips every other turn instead of using a move.', -2),
(163, 'turboblaze', 'Turboblaze', 'When this Pokemon uses any move, it nullifies the Ability of any active Pokemon that hinder or empower this Pokemon''s attacks. These abilities include Battle Armor, Clear Body, Damp, Dry Skin, Filter, Flash Fire, Flower Gift, Heatproof, Herbivore, Hyper Cutter, Immunity, Inner Focus, Insomnia, Keen Eye, Leaf Guard, Levitate, Lightningrod, Limber, Magma Armor, Marvel Scale, Motor Drive, Oblivious, Own Tempo, Sand Veil, Shell Armor, Shield Dust, Simple, Snow Cloak, Solid Rock, Soundproof, Sticky Hold, Storm Drain, Sturdy, Suction Cups, Tangled Feet, Thick Fat, Unaware, Vital Spirit, Volt Absorb, Water Absorb, Water Veil, White Smoke and Wonder Guard.', 'This Pokemon''s moves ignore any Ability that could modify the effectiveness.', 3),
(109, 'unaware', 'Unaware', 'This Pokemon ignores an opponent''s stat boosts for Attack, Defense, Special Attack and Special Defense. These boosts will still affect Base Power calculation for Punishment and Stored Power.', 'This Pokemon ignores other Pokemon''s stat changes when taking or doing damage.', 3),
(84, 'unburden', 'Unburden', 'Doubles this Pokemon''s Speed if it loses its held item (such as by eating Berries, using Gems, or via Thief, Knock Off, etc).', 'Speed is doubled on held item loss; boost is lost if it switches, gets new item/Ability.', 4),
(127, 'unnerve', 'Unnerve', 'While this Pokemon is active, prevents opposing Pokemon from using their Berries.', 'While this Pokemon is active, prevents opposing Pokemon from using their Berries.', 1),
(162, 'victorystar', 'Victory Star', 'Raises every friendly Pokemon''s Accuracy, including this Pokemon''s, by 10% (multiplied).', 'This Pokemon and its allies'' moves have their accuracy boosted to 1.1x.', 2),
(72, 'vitalspirit', 'Vital Spirit', 'This Pokemon cannot fall asleep (Rest will fail if it tries to use it). Gaining this Ability while asleep cures it.', 'This Pokemon cannot fall asleep. Gaining this Ability while asleep cures it.', 2),
(10, 'voltabsorb', 'Volt Absorb', 'This Pokemon is immune to Electric moves. If hit by an Electric move, it recovers 25% of its max HP.', 'This Pokemon heals 1/4 of its max HP when hit by Electric moves; Electric immunity.', 4),
(11, 'waterabsorb', 'Water Absorb', 'This Pokemon is immune to Water moves. If hit by an Water move, it recovers 25% of its max HP.', 'This Pokemon heals 1/4 of its max HP when hit by Water moves; Water immunity.', 4),
(41, 'waterveil', 'Water Veil', 'This Pokemon cannot become burned. Gaining this Ability while burned cures it.', 'This Pokemon cannot be burned. Gaining this Ability while burned cures it.', 2),
(133, 'weakarmor', 'Weak Armor', 'Causes physical moves to lower the Pokemon''s Defense and increase its Speed stat by one stage.', 'If a physical attack hits this Pokemon, Defense is lowered 1 and Speed is boosted 1.', 0),
(73, 'whitesmoke', 'White Smoke', 'Opponents cannot reduce this Pokemon''s stats; they can, however, modify stat changes with Power Swap, Guard Swap and Heart Swap and inflict stat boosts with Swagger and Flatter. This ability does not prevent self-inflicted stat reductions. [Field Effect] If this Pokemon is in the lead spot, the rate of wild Pokemon battles decreases by 50%.', 'Prevents other Pokemon from lowering this Pokemon''s stat stages.', 2),
(25, 'wonderguard', 'Wonder Guard', 'This Pokemon only receives damage from attacks belonging to types that cause Super Effective to this Pokemon. Wonder Guard does not protect a Pokemon from status ailments (burn, freeze, paralysis, poison, sleep, Toxic or any of their side effects or damage), recoil damage nor the moves Beat Up, Bide, Doom Desire, Fire Fang, Future Sight, Hail, Leech Seed, Sandstorm, Spikes, Stealth Rock and Struggle. Wonder Guard cannot be Skill Swapped nor Role Played. Trace, however, does copy Wonder Guard.', 'This Pokemon can only be damaged by super effective moves and indirect damage.', 5),
(147, 'wonderskin', 'Wonder Skin', 'Causes the chance of a status move working to be halved. It does not affect moves that inflict status as a secondary effect like Thunder''s chance to paralyze.', 'All status moves with a set % accuracy are 50% accurate if used on this Pokemon.', 3),
(161, 'zenmode', 'Zen Mode', 'When Darmanitan''s HP drops to below half, it will enter Zen Mode at the end of the turn. If it loses its ability, or recovers HP to above half while in Zen mode, it will change back. This ability only works on Darmanitan, even if it is copied by Role Play, Entrainment, or swapped with Skill Swap.', 'If this Pokemon is Darmanitan, it changes to Zen Mode whenever it is below half HP.', -1);
