INSERT INTO `attack_dex` (`no`, `id`, `name`, `type`, `category`, `base_power`, `pp`, `accuracy`, `priority`, `target`, `desc`, `short_desc`) VALUES
(71, 'absorb', 'Absorb', 'Grass', 'Special', 20, 25, 100, 0, 'normal', 'Deals damage to one adjacent target. The user recovers half of the HP lost by the target, rounded up. If Big Root is held by the user, the HP recovered is 1.3x normal, rounded half down.', 'User recovers 50% of the damage dealt.'),
(51, 'acid', 'Acid', 'Poison', 'Special', 40, 30, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 10% chance to lower their Special Defense by 1 stage each.', '10% chance to lower the foe(s) Sp. Def by 1.'),
(151, 'acidarmor', 'Acid Armor', 'Poison', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Defense by 2 stages.', 'Boosts the user''s Defense by 2.'),
(491, 'acidspray', 'Acid Spray', 'Poison', 'Special', 40, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 100% chance to lower its Special Defense by 2 stages.', '100% chance to lower the target''s Sp. Def by 2.'),
(512, 'acrobatics', 'Acrobatics', 'Flying', 'Physical', 55, 15, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target. Power doubles if the user has no held item. Makes contact.', 'Power doubles if the user has no held item.'),
(367, 'acupressure', 'Acupressure', 'Normal', 'Status', 0, 30, 0, 0, 'adjacentAllyOrSelf', 'Raises a random stat by 2 stages as long as the stat is not already at stage 6. The user can choose to use this move on itself or an adjacent ally. Fails if no stat stage can be raised or if used on an ally with a Substitute. This move ignores Protect and Detect.', 'Boosts a random stat of the user or an ally by 2.'),
(332, 'aerialace', 'Aerial Ace', 'Flying', 'Physical', 60, 20, 0, 0, 'any', 'Deals damage to one adjacent or non-adjacent target and does not check accuracy. Makes contact.', 'This move does not check accuracy.'),
(177, 'aeroblast', 'Aeroblast', 'Flying', 'Special', 100, 5, 95, 0, 'any', 'Deals damage to one adjacent or non-adjacent target with a higher chance for a critical hit.', 'High critical hit ratio.'),
(495, 'afteryou', 'After You', 'Normal', 'Status', 0, 15, 0, 0, 'normal', 'Causes one adjacent target to take its turn immediately after the user this turn, no matter the priority of its selected move. Fails if the target would have moved next anyway, or if the target already moved this turn. This move ignores Protect and Detect. Ignores a target''s Substitute.', 'The target makes its move right after the user.'),
(97, 'agility', 'Agility', 'Psychic', 'Status', 0, 30, 0, 0, 'self', 'Raises the user''s Speed by 2 stages.', 'Boosts the user''s Speed by 2.'),
(314, 'aircutter', 'Air Cutter', 'Flying', 'Special', 60, 25, 95, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a higher chance for a critical hit.', 'High critical hit ratio. Hits adjacent foes.'),
(403, 'airslash', 'Air Slash', 'Flying', 'Special', 75, 15, 95, 0, 'any', 'Deals damage to one adjacent or non-adjacent target with a 30% chance to flinch it.', '30% chance to flinch the target.'),
(502, 'allyswitch', 'Ally Switch', 'Psychic', 'Status', 0, 15, 0, 1, 'self', 'The user swaps positions with its ally on the far side of the field. Fails if there is no Pokemon at that position, if the user is the only Pokemon on its side, or if the user is in the middle. Priority +1.', 'Switches position with the ally on the far side.'),
(133, 'amnesia', 'Amnesia', 'Psychic', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Special Defense by 2 stages.', 'Boosts the user''s Sp. Def by 2.'),
(246, 'ancientpower', 'Ancient Power', 'Rock', 'Special', 60, 5, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to raise the user''s Attack, Defense, Speed, Special Attack, and Special Defense by 1 stage.', '10% chance to boost all stats by 1 (not acc/eva).'),
(453, 'aquajet', 'Aqua Jet', 'Water', 'Physical', 40, 20, 100, 1, 'normal', 'Deals damage to one adjacent target. Makes contact. Priority +1.', 'Usually goes first.'),
(392, 'aquaring', 'Aqua Ring', 'Water', 'Status', 0, 20, 0, 0, 'self', 'The user has 1/16 of its maximum HP restored at the end of each turn while it remains active. If the user uses Baton Pass, the replacement will still receive the healing effect.', 'User recovers 1/16 max HP per turn.'),
(401, 'aquatail', 'Aqua Tail', 'Water', 'Physical', 90, 10, 90, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(292, 'armthrust', 'Arm Thrust', 'Fighting', 'Physical', 15, 20, 100, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times. Makes contact.', 'Hits 2-5 times in one turn.'),
(312, 'aromatherapy', 'Aromatherapy', 'Grass', 'Status', 0, 5, 0, 0, 'allyTeam', 'Every Pokemon in the user''s party is cured of its major status problem.', 'Cures the user''s party of all status conditions.'),
(597, 'aromaticmist', 'Aromatic Mist', 'Fairy', 'Status', 0, 20, 100, 0, 'self', 'The user raises the Special Defense stat of itself and ally Pokemon by 1.', 'Raises user''s and allies'' Special Defense by 1.'),
(274, 'assist', 'Assist', 'Normal', 'Status', 0, 20, 0, 0, 'self', 'A random move among those known by the user''s party members is selected for use. Does not select Assist, Belch, Bestow, Chatter, Circle Throw, Copycat, Counter, Covet, Destiny Bond, Detect, Dragon Tail, Endure, Feint, Focus Punch, Follow Me, Helping Hand, Me First, Metronome, Mimic, Mirror Coat, Mirror Move, Nature Power, Protect, Rage Powder, Sketch, Sleep Talk, Snatch, Spiky Shield, Struggle, Switcheroo, Thief, Transform, or Trick.', 'Uses a random move known by a team member.'),
(372, 'assurance', 'Assurance', 'Dark', 'Physical', 60, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. Power doubles if the target has already taken damage this turn, other than from Pain Split. Makes contact.', 'Power doubles if target was damaged this turn.'),
(310, 'astonish', 'Astonish', 'Ghost', 'Physical', 30, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to flinch it. Makes contact.', '30% chance to flinch the target.'),
(454, 'attackorder', 'Attack Order', 'Bug', 'Physical', 90, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit.', 'High critical hit ratio.'),
(213, 'attract', 'Attract', 'Normal', 'Status', 0, 15, 100, 0, 'normal', 'Causes one adjacent target to become infatuated, making it unable to attack 50% of the time. Fails if both the user and the target are the same gender, if either is genderless, or if the target is already infatuated. The effect ends when either the user or the target is no longer active. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute. Pokemon with the Ability Oblivious are immune.', 'A target of the opposite gender gets infatuated.'),
(396, 'aurasphere', 'Aura Sphere', 'Fighting', 'Special', 80, 20, 0, 0, 'any', 'Deals damage to one adjacent or non-adjacent target and does not check accuracy.', 'This move does not check accuracy.'),
(62, 'aurorabeam', 'Aurora Beam', 'Ice', 'Special', 65, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to lower its Attack by 1 stage.', '10% chance to lower the foe''s Attack by 1.'),
(475, 'autotomize', 'Autotomize', 'Steel', 'Status', 0, 15, 0, 0, 'self', 'Raises the user''s Speed by 2 stages. If the user''s Speed was changed, the user''s weight is reduced by 100kg as long as it remains active. This effect is stackable but cannot reduce the user''s weight to less than 0.1kg.', 'Boosts the user''s Speed by 2; user loses 100kg.'),
(419, 'avalanche', 'Avalanche', 'Ice', 'Physical', 60, 10, 100, -4, 'normal', 'Deals damage to one adjacent target. Power doubles if the user was hit by that target this turn. Makes contact. Priority -4.', 'Power doubles if user is damaged by the target.'),
(608, 'babydolleyes', 'Baby-Doll Eyes', 'Fairy', 'Status', 0, 30, 100, 1, 'normal', 'Lowers the target''s Attack by 1 stage. Priority +1.', 'Lowers foe''s Attack by 1. Priority +1.'),
(140, 'barrage', 'Barrage', 'Normal', 'Physical', 15, 20, 85, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times.', 'Hits 2-5 times in one turn.'),
(112, 'barrier', 'Barrier', 'Psychic', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Defense by 2 stages.', 'Boosts the user''s Defense by 2.'),
(226, 'batonpass', 'Baton Pass', 'Normal', 'Status', 0, 40, 0, 0, 'self', 'The user is replaced with another Pokemon in its party. The selected Pokemon has the user''s stat stage changes, confusion, and certain move effects transferred to it.', 'User switches, passing stat changes and more.'),
(251, 'beatup', 'Beat Up', 'Dark', 'Physical', 0, 10, 100, 0, 'normal', 'Deals damage to one adjacent target and hits one time for the user and one time for each unfainted Pokemon without a major status problem in the user''s party. The power of each hit is equal to 5 + (X/10), where X is each participating Pokemon''s base Attack; each hit is considered to come from the user.', 'All healthy allies aid in damaging the target.'),
(562, 'belch', 'Belch', 'Poison', 'Special', 120, 10, 90, 0, 'normal', 'The user must eat a Berry to use this move.', 'User must eat a Berry to use this move.'),
(187, 'bellydrum', 'Belly Drum', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'Raises the user''s Attack to stage 6 in exchange for the user losing 1/2 of its maximum HP, rounded down. Fails if the user would faint or if its Attack stage is already 6.', 'User loses 50% max HP. Maximizes Attack.'),
(516, 'bestow', 'Bestow', 'Normal', 'Status', 0, 15, 0, 0, 'normal', 'Causes one adjacent target to receive the user''s held item. Fails if the target is already holding an item or if the user is holding a Mail.', 'User passes its held item to the target.'),
(117, 'bide', 'Bide', 'Normal', 'Physical', 0, 10, 0, 1, 'self', 'The user spends two turns locked into this move and then, on the second turn after using this move, the user attacks the last Pokemon that hit it, inflicting double the damage in HP it lost during the two turns. If the last Pokemon that hit it is no longer on the field, the user attacks a random foe instead. If the user is prevented from moving during this move''s use, the effect ends. This move does not check accuracy. Makes contact. Priority +1.', 'Waits 2 turns; deals double the damage taken.'),
(20, 'bind', 'Bind', 'Normal', 'Physical', 15, 20, 85, 0, 'normal', 'Deals damage to one adjacent target and prevents it from switching for four or five turns; seven turns if the user is holding Grip Claw. Causes damage to the target equal to 1/8 of its maximum HP (1/6 if the user is holding Binding Band), rounded down, at the end of each turn during effect. The target can still switch out if it is holding Shed Shell or uses Baton Pass, U-turn, or Volt Switch. The effect ends if either the user or the target leaves the field, or if the target uses Rapid Spin. This effect is not stackable or reset by using this or another partial-trapping move. Makes contact.', 'Traps and damages the target for 4-5 turns.'),
(44, 'bite', 'Bite', 'Dark', 'Physical', 60, 25, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to flinch it. Makes contact.', '30% chance to flinch the target.'),
(307, 'blastburn', 'Blast Burn', 'Fire', 'Special', 150, 5, 90, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful, the user must recharge on the following turn and cannot make a move.', 'User cannot move next turn.'),
(299, 'blazekick', 'Blaze Kick', 'Fire', 'Physical', 85, 10, 90, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to burn it and a higher chance for a critical hit. Makes contact.', 'High critical hit ratio. 10% chance to burn.'),
(59, 'blizzard', 'Blizzard', 'Ice', 'Special', 110, 5, 70, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 10% chance to freeze each. If the weather is Hail, this move cannot miss.', '10% chance to freeze the foe(s).'),
(335, 'block', 'Block', 'Normal', 'Status', 0, 5, 0, 0, 'normal', 'Prevents one adjacent target from switching out. The target can still switch out if it is holding Shed Shell or uses Baton Pass, U-turn, or Volt Switch. If the target leaves the field using Baton Pass, the replacement will remain trapped. The effect ends if the user leaves the field. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'The target cannot switch out.'),
(551, 'blueflare', 'Blue Flare', 'Fire', 'Special', 130, 5, 85, 0, 'normal', 'Deals damage to one adjacent target with a 20% chance to burn it.', '20% chance to burn the target.'),
(34, 'bodyslam', 'Body Slam', 'Normal', 'Physical', 85, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to paralyze it. Makes contact.', '30% chance to paralyze the target.'),
(550, 'boltstrike', 'Bolt Strike', 'Electric', 'Physical', 130, 5, 85, 0, 'normal', 'Deals damage to one adjacent target with a 20% chance to paralyze it. Makes contact.', '20% chance to paralyze the target.'),
(125, 'boneclub', 'Bone Club', 'Ground', 'Physical', 65, 20, 85, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to flinch it.', '10% chance to flinch the target.'),
(198, 'bonerush', 'Bone Rush', 'Ground', 'Physical', 25, 10, 90, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times.', 'Hits 2-5 times in one turn.'),
(155, 'bonemerang', 'Bonemerang', 'Ground', 'Physical', 50, 10, 90, 0, 'normal', 'Deals damage to one adjacent target and hits twice. If the first hit breaks the target''s Substitute, it will take damage for the second hit.', 'Hits 2 times in one turn.'),
(586, 'boomburst', 'Boomburst', 'Normal', 'Special', 140, 10, 100, 0, 'allAdjacent', 'Deals damage to all Pokemon within range, including any allies.', 'Hits adjacent Pokemon, including allies.'),
(340, 'bounce', 'Bounce', 'Flying', 'Physical', 85, 5, 85, 0, 'any', 'Deals damage to one adjacent or non-adjacent target with a 30% chance to paralyze it. This attack charges on the first turn and strikes on the second. On the first turn, the user avoids all attacks other than Gust, Hurricane, Sky Uppercut, Smack Down, Thunder, and Twister. The user cannot make a move between turns. If the user is holding a Power Herb, the move completes in one turn. This move cannot be used while Gravity is in effect. Makes contact.', 'Bounces turn 1. Hits turn 2. 30% paralyze.'),
(413, 'bravebird', 'Brave Bird', 'Flying', 'Physical', 120, 15, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target. If the target lost HP, the user takes recoil damage equal to 33% that HP, rounded half up, but not less than 1HP. Makes contact.', 'Has 33% recoil.'),
(280, 'brickbreak', 'Brick Break', 'Fighting', 'Physical', 75, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. If this attack does not miss, the effects of Reflect and Light Screen end for the target''s side of the field before damage is calculated. Makes contact.', 'Destroys screens, unless the target is immune.'),
(362, 'brine', 'Brine', 'Water', 'Special', 65, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. Power doubles if the target has less than or equal to half of its maximum HP remaining.', 'Power doubles if the target''s HP is 50% or less.'),
(145, 'bubble', 'Bubble', 'Water', 'Special', 40, 30, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 10% chance to lower their Speed by 1 stage each.', '10% chance to lower the foe(s) Speed by 1.'),
(61, 'bubblebeam', 'Bubble Beam', 'Water', 'Special', 65, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to lower its Speed by 1 stage.', '10% chance to lower the target''s Speed by 1.'),
(450, 'bugbite', 'Bug Bite', 'Bug', 'Physical', 60, 20, 100, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful and the user has not fainted, it steals the target''s held Berry if it is holding one and uses it immediately. Makes contact.', 'User steals and eats the target''s Berry.'),
(405, 'bugbuzz', 'Bug Buzz', 'Bug', 'Special', 90, 10, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to lower its Special Defense by 1 stage. Pokemon with the Ability Soundproof are immune.', '10% chance to lower the target''s Sp. Def. by 1.'),
(339, 'bulkup', 'Bulk Up', 'Fighting', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Attack and Defense by 1 stage.', 'Boosts the user''s Attack and Defense by 1.'),
(523, 'bulldoze', 'Bulldoze', 'Ground', 'Physical', 60, 20, 100, 0, 'allAdjacent', 'Deals damage to all adjacent Pokemon with a 100% chance to lower their Speed by 1 stage each.', '100% chance to lower adjacent Pkmn Speed by 1.'),
(418, 'bulletpunch', 'Bullet Punch', 'Steel', 'Physical', 40, 30, 100, 1, 'normal', 'Deals damage to one adjacent target. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist. Priority +1.', 'Usually goes first.'),
(331, 'bulletseed', 'Bullet Seed', 'Grass', 'Physical', 25, 30, 100, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times.', 'Hits 2-5 times in one turn.'),
(347, 'calmmind', 'Calm Mind', 'Psychic', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Special Attack and Special Defense by 1 stage.', 'Boosts the user''s Sp. Atk and Sp. Def by 1.'),
(293, 'camouflage', 'Camouflage', 'Normal', 'Status', 0, 20, 0, 0, 'self', 'The user''s type changes based on the battle terrain: Electric in Electric Terrain, Grass in Grassy Terrain, Fairy in Misty Terrain, and Normal in plain terrain. Fails if the user''s type cannot be changed or if the user is already purely that type.', 'Changes user''s type by terrain (default Normal).'),
(445, 'captivate', 'Captivate', 'Normal', 'Status', 0, 20, 100, 0, 'allAdjacentFoes', 'Lowers all adjacent foes'' Special Attack by 2 stages. A target is unaffected if both the user and the target are the same gender, or if either is genderless. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Pokemon with the Ability Oblivious are immune.', 'Lowers the foe(s) Sp. Atk by 2 if opposite gender.'),
(606, 'celebrate', 'Celebrate', 'Normal', 'Status', 0, 40, 0, 0, 'self', 'No in-game effect.', 'No in-game effect.'),
(268, 'charge', 'Charge', 'Electric', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Special Defense by 1 stage. If the user chooses to use an Electric-type attack on the next turn, its power will be doubled.', 'Boosts next Electric move and user''s Sp. Def by 1.'),
(451, 'chargebeam', 'Charge Beam', 'Electric', 'Special', 50, 10, 90, 0, 'normal', 'Deals damage to one adjacent target with a 70% chance to raise the user''s Special Attack by 1 stage.', '70% chance to boost the user''s Sp. Atk by 1.'),
(204, 'charm', 'Charm', 'Fairy', 'Status', 0, 20, 100, 0, 'normal', 'Lowers one adjacent target''s Attack by 2 stages. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the target''s Attack by 2.'),
(448, 'chatter', 'Chatter', 'Flying', 'Special', 65, 20, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target with a 100% chance to confuse it.', '100% chance to confuse the target.'),
(498, 'chipaway', 'Chip Away', 'Normal', 'Physical', 70, 20, 100, 0, 'normal', 'Deals damage to one adjacent target and ignores the target''s stat stage changes, including evasion. Makes contact.', 'Ignores the target''s stat stage changes.'),
(509, 'circlethrow', 'Circle Throw', 'Fighting', 'Physical', 60, 10, 90, -6, 'normal', 'Deals damage to one adjacent target. If both the user and the target have not fainted, the target is forced to switch out and be replaced with a random unfainted ally. This effect fails if the target used Ingrain previously, has the Ability Suction Cups, or has a Substitute. Makes contact. Priority -6. (Wild battles: The battle ends as long as it is not a double battle and the user''s level is not less than the opponent''s level.)', 'Forces the target to switch to a random ally.'),
(128, 'clamp', 'Clamp', 'Water', 'Physical', 35, 15, 85, 0, 'normal', 'Deals damage to one adjacent target and prevents it from switching for four or five turns; seven turns if the user is holding Grip Claw. Causes damage to the target equal to 1/8 of its maximum HP (1/6 if the user is holding Binding Band), rounded down, at the end of each turn during effect. The target can still switch out if it is holding Shed Shell or uses Baton Pass, U-turn, or Volt Switch. The effect ends if either the user or the target leaves the field, or if the target uses Rapid Spin. This effect is not stackable or reset by using this or another partial-trapping move. Makes contact.', 'Traps and damages the target for 4-5 turns.'),
(499, 'clearsmog', 'Clear Smog', 'Poison', 'Special', 50, 15, 0, 0, 'normal', 'Deals damage to one adjacent target and eliminates all of its stat stage changes.', 'Eliminates the target''s stat changes.'),
(370, 'closecombat', 'Close Combat', 'Fighting', 'Physical', 120, 5, 100, 0, 'normal', 'Deals damage to one adjacent target and lowers the user''s Defense and Special Defense by 1 stage. Makes contact.', 'Lowers the user''s Defense and Sp. Def by 1.'),
(489, 'coil', 'Coil', 'Poison', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Attack, Defense, and accuracy by 1 stage.', 'Boosts user''s Attack, Defense, and accuracy by 1.'),
(4, 'cometpunch', 'Comet Punch', 'Normal', 'Physical', 18, 15, 85, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist.', 'Hits 2-5 times in one turn.'),
(590, 'confide', 'Confide', 'Normal', 'Status', 0, 20, 0, 0, 'normal', 'Lowers the target''s Special Attack stat by 1.', 'Lowers the target''s Sp. Atk by 1.'),
(109, 'confuseray', 'Confuse Ray', 'Ghost', 'Status', 0, 10, 100, 0, 'normal', 'Causes one adjacent target to become confused. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Confuses the target.'),
(93, 'confusion', 'Confusion', 'Psychic', 'Special', 50, 25, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to confuse it.', '10% chance to confuse the target.'),
(132, 'constrict', 'Constrict', 'Normal', 'Physical', 10, 35, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to lower its Speed by 1 stage. Makes contact.', '10% chance to lower the target''s Speed by 1.'),
(160, 'conversion', 'Conversion', 'Normal', 'Status', 0, 30, 0, 0, 'self', 'The user''s type changes to match the original type of one of its four moves besides this move, at random, but not either of its current types. Fails if the user cannot change its type, or if this move would only be able to select one of the user''s current types.', 'Changes user''s type to match a known move.'),
(176, 'conversion2', 'Conversion 2', 'Normal', 'Status', 0, 30, 0, 0, 'normal', 'The user''s type changes to match a type that resists or is immune to the type of the last move used by one adjacent target, but not either of its current types. The determined type of the move is used rather than the original type. Fails if the user cannot change its type, or if this move would only be able to select one of the user''s current types. This move ignores Protect and Detect. Ignores a target''s Substitute.', 'Changes user''s type to resist target''s last move.'),
(383, 'copycat', 'Copycat', 'Normal', 'Status', 0, 20, 0, 0, 'self', 'The user uses the last move used by any Pokemon, including itself. Fails if no move has been used, or if the last move used was Assist, Bestow, Chatter, Circle Throw, Copycat, Counter, Covet, Destiny Bond, Detect, Dragon Tail, Endure, Feint, Focus Punch, Follow Me, Helping Hand, Me First, Metronome, Mimic, Mirror Coat, Mirror Move, Nature Power, Protect, Rage Powder, Sketch, Sleep Talk, Snatch, Struggle, Switcheroo, Thief, Transform, or Trick.', 'Uses the last move used in the battle.'),
(322, 'cosmicpower', 'Cosmic Power', 'Psychic', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Defense and Special Defense by 1 stage.', 'Boosts the user''s Defense and Sp. Def by 1.'),
(538, 'cottonguard', 'Cotton Guard', 'Grass', 'Status', 0, 10, 0, 0, 'self', 'Raises the user''s Defense by 3 stages.', 'Boosts the user''s Defense by 3.'),
(178, 'cottonspore', 'Cotton Spore', 'Grass', 'Status', 0, 40, 100, 0, 'normal', 'Lowers one adjacent target''s Speed by 2 stages. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the target''s Speed by 2.'),
(68, 'counter', 'Counter', 'Fighting', 'Physical', 0, 20, 100, -5, 'scripted', 'Deals damage to the last foe to hit the user with a physical attack this turn. The damage is equal to twice the HP lost by the user from that attack. If that foe''s position is no longer in use, damage is done to a random foe in range. Only the last hit of a multi-hit attack is counted. Fails if the user was not hit by a foe''s physical attack this turn. Makes contact. Priority -5.', 'If hit by physical attack, returns double damage.'),
(343, 'covet', 'Covet', 'Normal', 'Physical', 60, 25, 100, 0, 'normal', 'Deals damage to one adjacent target. If the attack was successful and the user has not fainted, it steals the target''s held item if the user is not holding one. Makes contact.', 'If the user has no item, it steals the target''s.'),
(152, 'crabhammer', 'Crabhammer', 'Water', 'Physical', 100, 10, 90, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit. Makes contact.', 'High critical hit ratio.'),
(578, 'craftyshield', 'Crafty Shield', 'Fairy', 'Status', 0, 10, 0, 3, 'allySide', 'Protects the user and allies from status moves. Priority +3.', 'Protects allies from status moves this turn.'),
(238, 'crosschop', 'Cross Chop', 'Fighting', 'Physical', 100, 5, 80, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit. Makes contact.', 'High critical hit ratio.'),
(440, 'crosspoison', 'Cross Poison', 'Poison', 'Physical', 70, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to poison it and a higher chance for a critical hit. Makes contact.', 'High critical hit ratio. 10% chance to poison.'),
(242, 'crunch', 'Crunch', 'Dark', 'Physical', 80, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 20% chance to lower its Defense by 1 stage. Makes contact.', '20% chance to lower the target''s Defense by 1.'),
(306, 'crushclaw', 'Crush Claw', 'Normal', 'Physical', 75, 10, 95, 0, 'normal', 'Deals damage to one adjacent target with a 50% chance to lower its Defense by 1 stage. Makes contact.', '50% chance to lower the target''s Defense by 1.'),
(462, 'crushgrip', 'Crush Grip', 'Normal', 'Physical', 0, 5, 100, 0, 'normal', 'Deals damage to one adjacent target. Power is equal to 120 * (target''s current HP / target''s maximum HP), rounded half down, but not less than 1. Makes contact.', 'More power the more HP the target has left.'),
(174, 'curse', 'Curse', 'Ghost', 'Status', 0, 10, 0, 0, 'normal', 'If the user is not a Ghost-type, lowers the user''s Speed by 1 stage and raises the user''s Attack and Defense by 1 stage. If the user is a Ghost-type, the user loses 1/2 of its maximum HP, rounded down and even if it would cause fainting, in exchange for one adjacent target losing 1/4 of its maximum HP, rounded down, at the end of each turn while it is active. If the target uses Baton Pass, the replacement will continue to be affected. Fails if there is no target or if the target is already affected. This move ignores Protect and Detect. Ignores a target''s Substitute.', 'Curses if Ghost, else +1 Atk, +1 Def, -1 Spe.'),
(15, 'cut', 'Cut', 'Normal', 'Physical', 50, 30, 95, 0, 'normal', 'Deals damage to one adjacent target. Makes contact. (Field: Can be used to cut down thin trees.)', 'No additional effect.'),
(399, 'darkpulse', 'Dark Pulse', 'Dark', 'Special', 80, 15, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target with a 20% chance to flinch it.', '20% chance to flinch the target.'),
(464, 'darkvoid', 'Dark Void', 'Dark', 'Status', 0, 10, 80, 0, 'allAdjacentFoes', 'Puts all adjacent foes to sleep. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Puts the foe(s) to sleep.'),
(605, 'dazzlinggleam', 'Dazzling Gleam', 'Fairy', 'Special', 80, 10, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes.', 'No additional effect. Hits adjacent foes.'),
(455, 'defendorder', 'Defend Order', 'Bug', 'Status', 0, 10, 0, 0, 'self', 'Raises the user''s Defense and Special Defense by 1 stage.', 'Boosts the user''s Defense and Sp. Def by 1.'),
(111, 'defensecurl', 'Defense Curl', 'Normal', 'Status', 0, 40, 0, 0, 'self', 'Raises the user''s Defense by 1 stage. As long as the user remains active, the power of the user''s Ice Ball and Rollout will be doubled (this effect is not stackable).', 'Boosts the user''s Defense by 1.'),
(432, 'defog', 'Defog', 'Flying', 'Status', 0, 15, 0, 0, 'normal', 'Lowers one adjacent target''s evasion by 1 stage. Whether or not the target''s evasion was affected, the effects of Safeguard, Mist, Spikes, Toxic Spikes, Stealth Rock, and Sticky Web end for the user''s and the target''s sides. In addition, the effects of Reflect and Light Screen will end for the target''s side. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute, although a Substitute will still block the evasion lowering.', 'Removes hazards from field. Lowers foe''s evasion.'),
(194, 'destinybond', 'Destiny Bond', 'Ghost', 'Status', 0, 5, 0, 0, 'self', 'Until the user''s next turn, if a foe''s attack knocks the user out, that foe faints as well, unless the attack was Doom Desire or Future Sight. Ignores a target''s Substitute.', 'If an opponent knocks out the user, it also faints.'),
(197, 'detect', 'Detect', 'Fighting', 'Status', 0, 5, 0, 4, 'self', 'The user is protected from most attacks made by other Pokemon during this turn. This attack has a 1/X chance of being successful, where X starts at 1 and doubles each time this move is successfully used. X resets to 1 if this attack fails or if the user''s last used move is not Detect, Endure, Protect, Quick Guard, or Wide Guard. If X is 256 or more, this move has a 1/(2^32) chance of being successful. Fails if the user moves last this turn. Priority +4.', 'Prevents moves from affecting the user this turn.'),
(591, 'diamondstorm', 'Diamond Storm', 'Rock', 'Physical', 100, 5, 95, 0, 'allAdjacent', 'Deals damage to all adjacent Pokemon with a 50% chance to raise the user''s Defense by 1 stage.', 'Hits all adjacent Pokemon. 50% chance to boost Def by 1.'),
(91, 'dig', 'Dig', 'Ground', 'Physical', 80, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. This attack charges on the first turn and strikes on the second. On the first turn, the user avoids all attacks other than Earthquake and Magnitude but takes double damage from them, and is also unaffected by Hail and Sandstorm damage. The user cannot make a move between turns. If the user is holding a Power Herb, the move completes in one turn. Makes contact. (Field: Can be used to escape a cave quickly.)', 'Digs underground turn 1, strikes turn 2.'),
(50, 'disable', 'Disable', 'Normal', 'Status', 0, 20, 100, 0, 'normal', 'For 4 turns, one adjacent target''s last move used becomes disabled. Fails if one of the target''s moves is already disabled, if the target has not moved, or if the target no longer knows the move. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute.', 'For 4 turns, disables the target''s last move used.'),
(574, 'disarmingvoice', 'Disarming Voice', 'Fairy', 'Special', 40, 15, 0, 0, 'normal', 'Deals damage to one adjacent target and does not check accuracy. Makes contact.', 'This move does not check accuracy.'),
(435, 'discharge', 'Discharge', 'Electric', 'Special', 80, 15, 100, 0, 'allAdjacent', 'Deals damage to all adjacent Pokemon with a 30% chance to paralyze each.', '30% chance to paralyze adjacent Pokemon.'),
(291, 'dive', 'Dive', 'Water', 'Physical', 80, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. This attack charges on the first turn and strikes on the second. On the first turn, the user avoids all attacks other than Surf and Whirlpool but takes double damage from them, and is also unaffected by Hail and Sandstorm damage. The user cannot make a move between turns. If the user is holding a Power Herb, the move completes in one turn. Makes contact. (Field: Can be used to dive underwater.)', 'Dives underwater turn 1, strikes turn 2.'),
(146, 'dizzypunch', 'Dizzy Punch', 'Normal', 'Physical', 70, 10, 100, 0, 'normal', 'Deals damage to one adjacent target with a 20% chance to confuse it. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist.', '20% chance to confuse the target.'),
(353, 'doomdesire', 'Doom Desire', 'Steel', 'Special', 140, 5, 100, 0, 'normal', 'Deals damage to one adjacent target two turns after this move is used. At the end of that turn, the damage is calculated at that time and dealt to the Pokemon at the position the target had when the move was used. If the user is no longer active at the time, damage is calculated based on the user''s natural Special Attack stat, types, and level, with no boosts from its held item or Ability. Fails if this move or Future Sight is already in effect for the target''s position. This move ignores Protect and Detect.', 'Hits two turns after being used.'),
(38, 'doubleedge', 'Double-Edge', 'Normal', 'Physical', 120, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. If the target lost HP, the user takes recoil damage equal to 33% that HP, rounded half up, but not less than 1HP. Makes contact.', 'Has 33% recoil.'),
(458, 'doublehit', 'Double Hit', 'Normal', 'Physical', 35, 10, 90, 0, 'normal', 'Deals damage to one adjacent target and hits twice. If the first hit breaks the target''s Substitute, it will take damage for the second hit. Makes contact.', 'Hits 2 times in one turn.'),
(24, 'doublekick', 'Double Kick', 'Fighting', 'Physical', 30, 30, 100, 0, 'normal', 'Deals damage to one adjacent target and hits twice. If the first hit breaks the target''s Substitute, it will take damage for the second hit. Makes contact.', 'Hits 2 times in one turn.'),
(3, 'doubleslap', 'Double Slap', 'Normal', 'Physical', 15, 10, 85, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times. Makes contact.', 'Hits 2-5 times in one turn.'),
(104, 'doubleteam', 'Double Team', 'Normal', 'Status', 0, 15, 0, 0, 'self', 'Raises the user''s evasion by 1 stage.', 'Boosts the user''s evasion by 1.'),
(434, 'dracometeor', 'Draco Meteor', 'Dragon', 'Special', 130, 5, 90, 0, 'normal', 'Deals damage to one adjacent target and lowers the user''s Special Attack by 2 stages.', 'Lowers the user''s Sp. Atk by 2.'),
(225, 'dragonbreath', 'Dragon Breath', 'Dragon', 'Special', 60, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to paralyze it.', '30% chance to paralyze the target.'),
(337, 'dragonclaw', 'Dragon Claw', 'Dragon', 'Physical', 80, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(349, 'dragondance', 'Dragon Dance', 'Dragon', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Attack and Speed by 1 stage.', 'Boosts the user''s Attack and Speed by 1.'),
(406, 'dragonpulse', 'Dragon Pulse', 'Dragon', 'Special', 85, 10, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target.', 'No additional effect.'),
(82, 'dragonrage', 'Dragon Rage', 'Dragon', 'Special', 0, 10, 100, 0, 'normal', 'Deals damage to one adjacent target equal to 40HP.', 'Always does 40 HP of damage.'),
(407, 'dragonrush', 'Dragon Rush', 'Dragon', 'Physical', 100, 10, 75, 0, 'normal', 'Deals damage to one adjacent target with a 20% chance to flinch it. Makes contact.', '20% chance to flinch the target.'),
(525, 'dragontail', 'Dragon Tail', 'Dragon', 'Physical', 60, 10, 90, -6, 'normal', 'Deals damage to one adjacent target. If both the user and the target have not fainted, the target is forced to switch out and be replaced with a random unfainted ally. This effect fails if the target used Ingrain previously, has the Ability Suction Cups, or has a Substitute. Makes contact. Priority -6. (Wild battles: The battle ends as long as it is not a double battle and the user''s level is not less than the opponent''s level.)', 'Forces the target to switch to a random ally.'),
(577, 'drainingkiss', 'Draining Kiss', 'Fairy', 'Special', 50, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. The user recovers 75% of the HP lost by the target, rounded up. If Big Root is held by the user, the HP recovered is 1.3x normal, rounded half down. Makes contact.', 'User recovers 75% of the damage dealt.'),
(409, 'drainpunch', 'Drain Punch', 'Fighting', 'Physical', 75, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. The user recovers half of the HP lost by the target, rounded up. If Big Root is held by the user, the HP recovered is 1.3x normal, rounded half down. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist.', 'User recovers 50% of the damage dealt.'),
(138, 'dreameater', 'Dream Eater', 'Psychic', 'Special', 100, 15, 100, 0, 'normal', 'Deals damage to one adjacent target, if it is asleep. The user recovers half of the HP lost by the target, rounded up. If Big Root is held by the user, the HP recovered is 1.3x normal, rounded half down.', 'User gains 1/2 HP inflicted. Sleeping target only.'),
(65, 'drillpeck', 'Drill Peck', 'Flying', 'Physical', 80, 20, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target. Makes contact.', 'No additional effect.'),
(529, 'drillrun', 'Drill Run', 'Ground', 'Physical', 80, 10, 95, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit. Makes contact.', 'High critical hit ratio.'),
(530, 'dualchop', 'Dual Chop', 'Dragon', 'Physical', 40, 15, 90, 0, 'normal', 'Deals damage to one adjacent target and hits twice. If the first hit breaks the target''s Substitute, it will take damage for the second hit. Makes contact.', 'Hits 2 times in one turn.'),
(223, 'dynamicpunch', 'Dynamic Punch', 'Fighting', 'Physical', 100, 5, 50, 0, 'normal', 'Deals damage to one adjacent target with a 100% chance to confuse it. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist.', '100% chance to confuse the target.'),
(414, 'earthpower', 'Earth Power', 'Ground', 'Special', 90, 10, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to lower its Special Defense by 1 stage.', '10% chance to lower the target''s Sp. Def. by 1.'),
(89, 'earthquake', 'Earthquake', 'Ground', 'Physical', 100, 10, 100, 0, 'allAdjacent', 'Deals damage to all adjacent Pokemon. Power doubles against Pokemon using Dig.', 'Hits adjacent Pokemon. Power doubles on Dig.'),
(497, 'echoedvoice', 'Echoed Voice', 'Normal', 'Special', 40, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. For every consecutive turn that this move is used by at least one Pokemon, this move''s power is multiplied by the number of turns to pass, but not more than 5. Pokemon with the Ability Soundproof are immune.', 'Power increases when used on consecutive turns.'),
(598, 'eerieimpulse', 'Eerie Impulse', 'Electric', 'Status', 0, 15, 100, 0, 'normal', 'Harshly lowers the target''s Special Attack stat.', 'Lowers the target''s Sp. Atk by 2.'),
(121, 'eggbomb', 'Egg Bomb', 'Normal', 'Physical', 100, 10, 75, 0, 'normal', 'Deals damage to one adjacent target.', 'No additional effect.'),
(604, 'electricterrain', 'Electric Terrain', 'Electric', 'Status', 0, 10, 0, 0, 'all', 'For five turns, Pokemon on the ground cannot fall asleep. Their Electric-type moves are powered up by 50%.', 'If on ground, can''t sleep + Electric moves stronger.'),
(582, 'electrify', 'Electrify', 'Electric', 'Status', 0, 20, 0, 0, 'normal', 'If the target is electrified before it uses a move during that turn, the target''s move becomes Electric type.', 'Changes the target''s move to Electric type.'),
(486, 'electroball', 'Electro Ball', 'Electric', 'Special', 0, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. The power of this move depends on (user''s current Speed / target''s current Speed), rounded down. Power is equal to 150 if the result is 4 or more, 120 if 3, 80 if 2, 60 if 1, 40 if less than 1.', 'More power the faster the user is than the target.'),
(527, 'electroweb', 'Electroweb', 'Electric', 'Special', 55, 15, 95, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 100% chance to lower their Speed by 1 stage.', '100% chance to lower the foe(s) Speed by 1.'),
(373, 'embargo', 'Embargo', 'Dark', 'Status', 0, 15, 100, 0, 'normal', 'For 5 turns, one adjacent target cannot use its held item. Items thrown at the target with Fling will still activate for it. If the target uses Baton Pass, the replacement will remain unable to use items. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'For 5 turns, the target can''t use any items.'),
(52, 'ember', 'Ember', 'Fire', 'Special', 40, 25, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to burn it.', '10% chance to burn the target.'),
(227, 'encore', 'Encore', 'Normal', 'Status', 0, 5, 100, 0, 'normal', 'For 3 turns, one adjacent target is forced to repeat its last move used. If the affected move runs out of PP, the effect ends. Fails if the target is already under this effect, if it has not moved yet, if the move has 0PP, or if the move is Encore, Mimic, Mirror Move, Sketch, Struggle, or Transform. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute.', 'The target repeats its last move for 3 turns.'),
(283, 'endeavor', 'Endeavor', 'Normal', 'Physical', 0, 5, 100, 0, 'normal', 'Deals damage to one adjacent target equal to (target''s current HP - user''s current HP). Fails if the target''s current HP is less than or equal to the user''s current HP. Makes contact.', 'Lowers the target''s HP to the user''s HP.'),
(203, 'endure', 'Endure', 'Normal', 'Status', 0, 10, 0, 4, 'self', 'The user will survive attacks made by other Pokemon during this turn with at least 1HP. This attack has a 1/X chance of being successful, where X starts at 1 and doubles each time this move is successfully used. X resets to 1 if this attack fails or if the user''s last used move is not Detect, Endure, Protect, Quick Guard, or Wide Guard. If X is 256 or more, this move has a 1/(2^32) chance of being successful. Fails if the user moves last this turn. Priority +4.', 'The user survives the next hit with at least 1 HP.'),
(412, 'energyball', 'Energy Ball', 'Grass', 'Special', 90, 10, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to lower its Special Defense by 1 stage.', '10% chance to lower the target''s Sp. Def. by 1.'),
(494, 'entrainment', 'Entrainment', 'Normal', 'Status', 0, 15, 100, 0, 'normal', 'Causes one adjacent target''s Ability to become the same as the user''s. Fails if the target''s Ability is Multitype, Stance Change, Truant, or the same Ability as the user, or if the user''s Ability is Flower Gift, Forecast, Illusion, Imposter, Multitype, Stance Change, Trace, or Zen Mode. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'The target''s Ability changes to match the user''s.'),
(284, 'eruption', 'Eruption', 'Fire', 'Special', 150, 5, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes. Power is equal to (user''s current HP * 150 / user''s maximum HP), rounded down, but not less than 1.', 'Less power as user''s HP decreases. Hits foe(s).'),
(153, 'explosion', 'Explosion', 'Normal', 'Physical', 250, 5, 100, 0, 'allAdjacent', 'The user faints and then damage is dealt to all adjacent Pokemon.', 'Hits adjacent Pokemon. The user faints.'),
(326, 'extrasensory', 'Extrasensory', 'Psychic', 'Special', 80, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to flinch it.', '10% chance to flinch the target.'),
(245, 'extremespeed', 'Extreme Speed', 'Normal', 'Physical', 80, 5, 100, 2, 'normal', 'Deals damage to one adjacent target. Makes contact. Priority +2.', 'Nearly always goes first.'),
(263, 'facade', 'Facade', 'Normal', 'Physical', 70, 20, 100, 0, 'normal', 'Deals damage to one adjacent target. Power doubles if the user is burned, paralyzed, or poisoned. Makes contact.', 'Power doubles if user is burn/poison/paralyzed.'),
(185, 'feintattack', 'Feint Attack', 'Dark', 'Physical', 60, 20, 0, 0, 'normal', 'Deals damage to one adjacent target and does not check accuracy. Makes contact.', 'This move does not check accuracy.'),
(587, 'fairylock', 'Fairy Lock', 'Fairy', 'Status', 0, 10, 0, 0, 'all', 'Keeps all Pokemon from fleeing during the next turn.', 'Prevents fleeing for one turn.'),
(584, 'fairywind', 'Fairy Wind', 'Fairy', 'Special', 40, 30, 100, 0, 'normal', 'Deals damage to one adjacent target.', 'No additional effect.'),
(252, 'fakeout', 'Fake Out', 'Normal', 'Physical', 40, 10, 100, 3, 'normal', 'Deals damage to one adjacent target with a 100% chance to flinch it. Fails unless it is the user''s first turn on the field. Makes contact. Priority +3.', 'Hits first. First turn out only. 100% flinch chance.'),
(313, 'faketears', 'Fake Tears', 'Dark', 'Status', 0, 20, 100, 0, 'normal', 'Lowers one adjacent target''s Special Defense by 2 stages. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the target''s Sp. Def by 2.'),
(206, 'falseswipe', 'False Swipe', 'Normal', 'Physical', 40, 40, 100, 0, 'normal', 'Deals damage to one adjacent target but leaves it with at least 1HP. Makes contact.', 'Always leaves the target with at least 1 HP.'),
(297, 'featherdance', 'Feather Dance', 'Flying', 'Status', 0, 15, 100, 0, 'normal', 'Lowers one adjacent target''s Attack by 2 stages. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the target''s Attack by 2.'),
(364, 'feint', 'Feint', 'Normal', 'Physical', 30, 10, 100, 2, 'normal', 'Deals damage to one adjacent target and breaks through Detect, King''s Shield, Spiky Shield and Protect for this turn, allowing other Pokemon to attack the target normally. If the target is a foe, Quick Guard and Wide Guard are also broken for this turn and other Pokemon may attack the target normally. Priority +2.', 'Nullifies Detect, Protect, and Quick/Wide Guard.'),
(565, 'fellstinger', 'Fell Stinger', 'Bug', 'Physical', 30, 25, 100, 0, 'normal', 'When the user knocks out a target with this move, the user''s Attack stat rises sharply.', 'Raises Attack by 2 if knocks out target.'),
(552, 'fierydance', 'Fiery Dance', 'Fire', 'Special', 80, 10, 100, 0, 'normal', 'Deals damage to one adjacent target with a 50% chance to raise the user''s Special Attack by 1 stage.', '50% chance to boost the user''s Sp. Atk by 1.'),
(515, 'finalgambit', 'Final Gambit', 'Fighting', 'Special', 0, 5, 100, 0, 'normal', 'Deals damage to one adjacent target equal to the user''s current HP. If this move is successful, the user faints. Makes contact.', 'Does damage equal to the user''s HP. User faints.'),
(126, 'fireblast', 'Fire Blast', 'Fire', 'Special', 110, 5, 85, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to burn it.', '10% chance to burn the target.'),
(424, 'firefang', 'Fire Fang', 'Fire', 'Physical', 65, 15, 95, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to burn it and a 10% chance to flinch it. Makes contact.', '10% chance to burn. 10% chance to flinch.');
INSERT INTO `attack_dex` (`no`, `id`, `name`, `type`, `category`, `base_power`, `pp`, `accuracy`, `priority`, `target`, `desc`, `short_desc`) VALUES
(519, 'firepledge', 'Fire Pledge', 'Fire', 'Special', 80, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. If one of the user''s allies chose to use Grass Pledge or Water Pledge this turn and has not moved yet, they take their turn immediately after the user and the user''s move does nothing. Power goes up to 150 if this move is used by an ally that way, and a sea of fire appears on the target''s side if the other move was Grass Pledge, or a rainbow appears on the user''s side if the other move was Water Pledge.', 'Use with Grass or Water Pledge for added effect.'),
(7, 'firepunch', 'Fire Punch', 'Fire', 'Physical', 75, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to burn it. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist.', '10% chance to burn the target.'),
(83, 'firespin', 'Fire Spin', 'Fire', 'Special', 35, 15, 85, 0, 'normal', 'Deals damage to one adjacent target and prevents it from switching for four or five turns; seven turns if the user is holding Grip Claw. Causes damage to the target equal to 1/8 of its maximum HP (1/6 if the user is holding Binding Band), rounded down, at the end of each turn during effect. The target can still switch out if it is holding Shed Shell or uses Baton Pass, U-turn, or Volt Switch. The effect ends if either the user or the target leaves the field, or if the target uses Rapid Spin. This effect is not stackable or reset by using this or another partial-trapping move.', 'Traps and damages the target for 4-5 turns.'),
(90, 'fissure', 'Fissure', 'Ground', 'Physical', 0, 5, 30, 0, 'normal', 'Deals damage to one adjacent target equal to the target''s max HP. Ignores accuracy and evasion modifiers. This attack''s accuracy is equal to (user''s level - target''s level + 30)%, and fails if the target is at a higher level. Pokemon with the Ability Sturdy are immune.', 'OHKOs the target. Fails if user is a lower level.'),
(175, 'flail', 'Flail', 'Normal', 'Physical', 0, 15, 100, 0, 'normal', 'Deals damage to one adjacent target based on the amount of HP the user has left. X is equal to (user''s current HP * 48 / user''s maximum HP), rounded down; the base power of this attack is 20 if X is 33 to 48, 40 if X is 17 to 32, 80 if X is 10 to 16, 100 if X is 5 to 9, 150 if X is 2 to 4, and 200 if X is 0 or 1. Makes contact.', 'More power the less HP the user has left.'),
(481, 'flameburst', 'Flame Burst', 'Fire', 'Special', 70, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful, each ally adjacent to the target loses 1/16 of its maximum HP, rounded down, unless it has the Ability Magic Guard.', 'Damages Pokemon next to the target as well.'),
(488, 'flamecharge', 'Flame Charge', 'Fire', 'Physical', 50, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 100% chance to raise the user''s Speed by 1 stage. Makes contact.', '100% chance to boost the user''s Speed by 1.'),
(172, 'flamewheel', 'Flame Wheel', 'Fire', 'Physical', 60, 25, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to burn it. If the user is frozen, it will defrost before using this move. Makes contact.', '10% chance to burn the target. Thaws user.'),
(53, 'flamethrower', 'Flamethrower', 'Fire', 'Special', 90, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to burn it.', '10% chance to burn the target.'),
(394, 'flareblitz', 'Flare Blitz', 'Fire', 'Physical', 120, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to burn it. If the target lost HP, the user takes recoil damage equal to 33% that HP, rounded half up, but not less than 1HP. If the user is frozen, it will defrost before using this move. Makes contact.', 'Has 33% recoil. 10% chance to burn. Thaws user.'),
(148, 'flash', 'Flash', 'Normal', 'Status', 0, 20, 100, 0, 'normal', 'Lowers one adjacent target''s accuracy by 1 stage. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. (Field: Can be used to light up dark caves.)', 'Lowers the target''s accuracy by 1.'),
(430, 'flashcannon', 'Flash Cannon', 'Steel', 'Special', 80, 10, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to lower its Special Defense by 1 stage.', '10% chance to lower the target''s Sp. Def by 1.'),
(260, 'flatter', 'Flatter', 'Dark', 'Status', 0, 15, 100, 0, 'normal', 'Raises one adjacent target''s Special Attack by 1 stage and confuses it. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Boosts the target''s Sp. Atk by 1 and confuses it.'),
(374, 'fling', 'Fling', 'Dark', 'Physical', 0, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. The power of this move is based on the user''s held item. The held item is lost and it activates for the target if applicable. If there is no target or the target avoids this move using Protect or Detect, the user''s held item is still lost. Fails if the user has no held item, if the held item cannot be thrown, if the user is under the effect of Embargo or Magic Room, or if the user has the Ability Klutz.', 'Flings the user''s item at the target. Power varies.'),
(579, 'flowershield', 'Flower Shield', 'Fairy', 'Status', 0, 10, 0, 0, 'all', 'The user raises the Defense stat of all Grass-type Pokemon in battle.', 'Raises Defense by 1 of Grass types in battle.'),
(19, 'fly', 'Fly', 'Flying', 'Physical', 90, 15, 95, 0, 'any', 'Deals damage to one adjacent or non-adjacent target. This attack charges on the first turn and strikes on the second. On the first turn, the user avoids all attacks other than Gust, Hurricane, Sky Uppercut, Smack Down, Thunder, and Twister. The user cannot make a move between turns. If the user is holding a Power Herb, the move completes in one turn. This move cannot be used while Gravity is in effect. Makes contact. (Field: Can be used to fly to a previously visited area.)', 'Flies up on first turn, then strikes the next turn.'),
(560, 'flyingpress', 'Flying Press', 'Fighting', 'Physical', 80, 10, 95, 0, 'normal', 'Both Fighting-type and Flying-type simultaneously.', 'Both Fighting-type and Flying-type simultaneously.'),
(411, 'focusblast', 'Focus Blast', 'Fighting', 'Special', 120, 5, 70, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to lower its Special Defense by 1 stage.', '10% chance to lower the target''s Sp. Def by 1.'),
(116, 'focusenergy', 'Focus Energy', 'Normal', 'Status', 0, 30, 0, 0, 'self', 'Raises the user''s chance for a critical hit by 2 stages. Baton Pass can be used to transfer this effect to an ally.', 'Boosts the user''s critical hit ratio by 2.'),
(264, 'focuspunch', 'Focus Punch', 'Fighting', 'Physical', 150, 20, 100, -3, 'normal', 'Deals damage to one adjacent target. The user loses its focus and does nothing if it is hit by a damaging attack this turn before it can execute the move. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist. Priority -3.', 'Fails if the user takes damage before it hits.'),
(266, 'followme', 'Follow Me', 'Normal', 'Status', 0, 20, 0, 2, 'self', 'Until the end of the turn, all single-target attacks from the foe''s team are redirected to the user if they are in range. Such attacks are redirected to the user before they can be reflected by Magic Coat or the Ability Magic Bounce, or drawn in by the Abilities Lightningrod or Storm Drain. Fails if it is not a double or triple battle. Priority +3.', 'The foes'' moves target the user on the turn used.'),
(395, 'forcepalm', 'Force Palm', 'Fighting', 'Physical', 60, 10, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to paralyze it. Makes contact.', '30% chance to paralyze the target.'),
(193, 'foresight', 'Foresight', 'Normal', 'Status', 0, 40, 0, 0, 'normal', 'Causes one adjacent target to have its positive evasion stat stage set to 0 while it is active. Normal and Fighting-type attacks can hit the target if it is a Ghost-type. The effect ends when the target is no longer active. Fails if the target is already affected. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute.', 'Blocks evasion mods. Fighting, Normal hit Ghost.'),
(571, 'forestscurse', 'Forest''s Curse', 'Grass', 'Status', 0, 20, 100, 0, 'normal', 'Adds Grass to the target''s type(s). If the target was affected by Trick-or-Treat, its Ghost type is replaced.', 'Adds Grass to the target''s type(s).'),
(492, 'foulplay', 'Foul Play', 'Dark', 'Physical', 95, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. Damage is calculated using the target''s Attack stat, including stat stage changes. However, the effect of any ability or status ailment is calculated normally. Makes contact.', 'Uses target''s Attack stat in damage calculation.'),
(573, 'freezedry', 'Freeze-Dry', 'Ice', 'Special', 70, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to freeze it. Super-effective against Water-type Pokemon.', 'Super-effective against Water. 10% freeze chance.'),
(553, 'freezeshock', 'Freeze Shock', 'Ice', 'Physical', 140, 5, 90, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to paralyze it. This attack charges on the first turn and strikes on the second. The user cannot make a move between turns. If the user is holding a Power Herb, the move completes in one turn.', 'Charges turn 1. Hits turn 2. 30% paralyze.'),
(338, 'frenzyplant', 'Frenzy Plant', 'Grass', 'Special', 150, 5, 90, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful, the user must recharge on the following turn and cannot make a move.', 'User cannot move next turn.'),
(524, 'frostbreath', 'Frost Breath', 'Ice', 'Special', 60, 10, 90, 0, 'normal', 'Deals damage to one adjacent target. This move is always a critical hit unless the target is under the effect of Lucky Chant or has the Abilities Battle Armor or Shell Armor.', 'Always results in a critical hit.'),
(218, 'frustration', 'Frustration', 'Normal', 'Physical', 0, 20, 100, 0, 'normal', 'Deals damage to one adjacent target. Power is equal to the greater of ((255 - user''s Happiness) * 2/5), rounded down, or 1. Makes contact.', 'Max 102 power at minimum Happiness.'),
(31, 'furyattack', 'Fury Attack', 'Normal', 'Physical', 15, 20, 85, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times. Makes contact.', 'Hits 2-5 times in one turn.'),
(210, 'furycutter', 'Fury Cutter', 'Bug', 'Physical', 40, 20, 95, 0, 'normal', 'Deals damage to one adjacent target. Power doubles with each successful hit, up to a maximum of 160 power; resets to 20 power if the move misses or another move is used. Makes contact.', 'Power doubles with each hit, up to 160.'),
(154, 'furyswipes', 'Fury Swipes', 'Normal', 'Physical', 18, 15, 80, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times. Makes contact.', 'Hits 2-5 times in one turn.'),
(559, 'fusionbolt', 'Fusion Bolt', 'Electric', 'Physical', 100, 5, 100, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful, the next use of Fusion Flare by any Pokemon this turn will have its power doubled.', 'Power doubles if used after Fusion Flare.'),
(558, 'fusionflare', 'Fusion Flare', 'Fire', 'Special', 100, 5, 100, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful, the next use of Fusion Bolt by any Pokemon this turn will have its power doubled. If the user is frozen, it will defrost before using this move.', 'Power doubles if used after Fusion Bolt.'),
(248, 'futuresight', 'Future Sight', 'Psychic', 'Special', 120, 10, 100, 0, 'normal', 'Deals damage to one adjacent target two turns after this move is used. At the end of that turn, the damage is dealt to the Pokemon at the position the target had when the move was used. If the user is no longer active at the time, damage is calculated based on the user''s natural Special Attack stat, types, and level, with no boosts from its held item or Ability. Fails if this move or Doom Desire is already in effect for the target''s position. This move ignores Protect and Detect.', 'Hits two turns after being used.'),
(380, 'gastroacid', 'Gastro Acid', 'Poison', 'Status', 0, 10, 100, 0, 'normal', 'Causes one adjacent target''s Ability to be rendered ineffective as long as it remains active. If the target uses Baton Pass, the replacement will remain under this effect. Fails if the target''s Ability is Multitype or Stance Change. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Nullifies the target''s Ability'),
(544, 'geargrind', 'Gear Grind', 'Steel', 'Physical', 50, 15, 85, 0, 'normal', 'Deals damage to one adjacent target and hits twice. If the first hit breaks the target''s Substitute, it will take damage for the second hit. Makes contact.', 'Hits 2 times in one turn.'),
(601, 'geomancy', 'Geomancy', 'Fairy', 'Status', 0, 10, 0, 0, 'self', 'The user charges turn one, then sharply raise Special Attack, Special Defense, and Speed the next turn.', 'Sharply raises SpAtk, SpDef, and Speed on turn 2.'),
(202, 'gigadrain', 'Giga Drain', 'Grass', 'Special', 75, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. The user recovers half of the HP lost by the target, rounded up. If Big Root is held by the user, the HP recovered is 1.3x normal, rounded half down.', 'User recovers 50% of the damage dealt.'),
(416, 'gigaimpact', 'Giga Impact', 'Normal', 'Physical', 150, 5, 90, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful, the user must recharge on the following turn and cannot make a move. Makes contact.', 'User cannot move next turn.'),
(549, 'glaciate', 'Glaciate', 'Ice', 'Special', 65, 10, 95, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 100% chance to lower their Speed by 1 stage each.', '100% chance to lower the foe(s) Speed by 1.'),
(137, 'glare', 'Glare', 'Normal', 'Status', 0, 30, 100, 0, 'normal', 'Paralyzes one adjacent target. Ghost-types are not immune. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Paralyzes the target.'),
(447, 'grassknot', 'Grass Knot', 'Grass', 'Special', 0, 20, 100, 0, 'normal', 'Deals damage to one adjacent target based on that target''s weight. Power is 20 if less than 10kg, 40 if less than 25kg, 60 if less than 50kg, 80 if less than 100kg, 100 if less than 200kg, and 120 if greater than or equal to 200kg. Makes contact.', 'More power the heavier the target.'),
(520, 'grasspledge', 'Grass Pledge', 'Grass', 'Special', 80, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. If one of the user''s allies chose to use Fire Pledge or Water Pledge this turn and has not moved yet, they take their turn immediately after the user and the user''s move does nothing. Power goes up to 150 if this move is used by an ally that way, and a sea of fire appears on the target''s side if the other move was Fire Pledge, or a swamp appears on the target''s side if the other move was Water Pledge.', 'Use with Fire or Water Pledge for added effect.'),
(320, 'grasswhistle', 'Grass Whistle', 'Grass', 'Status', 0, 15, 55, 0, 'normal', 'Puts one adjacent target to sleep. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Pokemon with the Ability Soundproof are immune.', 'Puts the target to sleep.'),
(580, 'grassyterrain', 'Grassy Terrain', 'Grass', 'Status', 0, 10, 0, 0, 'all', 'For five turns, Pokemon on the ground restore 1/16 of their HP each turn. Their Grass-type moves are powered up by 50%.', 'If on ground, restore HP + Grass moves stronger.'),
(356, 'gravity', 'Gravity', 'Psychic', 'Status', 0, 5, 0, 0, 'all', 'For 5 turns, the evasion of all active Pokemon is 0.6x. At the time of use, Bounce, Fly, Magnet Rise, Sky Drop, and Telekinesis end immediately for all active Pokemon. During the effect, Bounce, Fly, High Jump Kick, Jump Kick, Magnet Rise, Sky Drop, Splash, and Telekinesis are prevented from being used by all active Pokemon. Ground-type attacks, Spikes, Toxic Spikes, and the Ability Arena Trap can affect Flying-types or Pokemon with the Ability Levitate. Fails if this move is already in effect.', 'For 5 turns, negates all Ground immunities.'),
(45, 'growl', 'Growl', 'Normal', 'Status', 0, 40, 100, 0, 'allAdjacentFoes', 'Lowers all adjacent foes'' Attack by 1 stage. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Pokemon with the Ability Soundproof are immune.', 'Lowers the foe(s) Attack by 1.'),
(74, 'growth', 'Growth', 'Normal', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Attack and Special Attack by 1 stage. If the weather is Sunny Day, raises the user''s Attack and Special Attack by 2 stages.', 'Boosts the user''s Attack and Sp. Atk by 1.'),
(288, 'grudge', 'Grudge', 'Ghost', 'Status', 0, 5, 0, 0, 'self', 'Until the user''s next turn, if a foe''s attack knocks the user out, that foe loses all remaining PP for that attack. Ignores a target''s Substitute.', 'If the user faints, the attack used loses all its PP.'),
(470, 'guardsplit', 'Guard Split', 'Psychic', 'Status', 0, 10, 0, 0, 'normal', 'The user and one adjacent target have their Defense and Special Defense stats set to be equal to the average of the user and the target''s Defense and Special Defense stats, respectively, rounded down. Stat stage changes are unaffected.', 'Averages Defense and Sp. Def stats with target.'),
(385, 'guardswap', 'Guard Swap', 'Psychic', 'Status', 0, 10, 0, 0, 'normal', 'The user swaps its Defense and Special Defense stat stage changes with one adjacent target. Ignores a target''s Substitute.', 'Swaps Defense and Sp. Def changes with target.'),
(12, 'guillotine', 'Guillotine', 'Normal', 'Physical', 0, 5, 30, 0, 'normal', 'Deals damage to one adjacent target equal to the target''s maximum HP. Ignores accuracy and evasion modifiers. This attack''s accuracy is equal to (user''s level - target''s level + 30)%, and fails if the target is at a higher level. Pokemon with the Ability Sturdy are immune. Makes contact.', 'OHKOs the target. Fails if user is a lower level.'),
(441, 'gunkshot', 'Gunk Shot', 'Poison', 'Physical', 120, 5, 80, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to poison it.', '30% chance to poison the target.'),
(16, 'gust', 'Gust', 'Flying', 'Special', 40, 35, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target. Power doubles against Pokemon using Bounce, Fly, or Sky Drop.', 'Power doubles during Fly, Bounce, and Sky Drop.'),
(360, 'gyroball', 'Gyro Ball', 'Steel', 'Physical', 0, 5, 100, 0, 'normal', 'Deals damage to one adjacent target. Power is equal to (25 * target''s current Speed / user''s current Speed), rounded down, + 1, but not more than 150. Makes contact.', 'More power the slower the user than the target.'),
(258, 'hail', 'Hail', 'Ice', 'Status', 0, 10, 0, 0, 'all', 'For 5 turns, the weather becomes Hail. At the end of each turn except the last, all active Pokemon lose 1/16 of their maximum HP, rounded down, unless they are an Ice-type, or have the Abilities Ice Body, Magic Guard, Overcoat, or Snow Cloak. Lasts for 8 turns if the user is holding Icy Rock. Fails if the current weather is Hail.', 'For 5 turns, hail crashes down.'),
(359, 'hammerarm', 'Hammer Arm', 'Fighting', 'Physical', 100, 10, 90, 0, 'normal', 'Deals damage to one adjacent target and lowers the user''s Speed by 1 stage. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist.', 'Lowers the user''s Speed by 1.'),
(603, 'happyhour', 'Happy Hour', 'Normal', 'Status', 0, 30, 0, 0, 'self', 'No competitive effect. (Doubles the prize money received after battle.)', 'No effect.'),
(106, 'harden', 'Harden', 'Normal', 'Status', 0, 30, 0, 0, 'self', 'Raises the user''s Defense by 1 stage.', 'Boosts the user''s Defense by 1.'),
(114, 'haze', 'Haze', 'Ice', 'Status', 0, 30, 0, 0, 'all', 'Eliminates any stat stage changes from all active Pokemon.', 'Eliminates all stat changes.'),
(543, 'headcharge', 'Head Charge', 'Normal', 'Physical', 120, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. If the target lost HP, the user takes recoil damage equal to 1/4 that HP, rounded half up, but not less than 1HP. Makes contact.', 'Has 1/4 recoil.'),
(457, 'headsmash', 'Head Smash', 'Rock', 'Physical', 150, 5, 80, 0, 'normal', 'Deals damage to one adjacent target. If the target lost HP, the user takes recoil damage equal to 1/2 that HP, rounded half up, but not less than 1HP. Makes contact.', 'Has 1/2 recoil.'),
(29, 'headbutt', 'Headbutt', 'Normal', 'Physical', 70, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to flinch it. Makes contact.', '30% chance to flinch the target.'),
(215, 'healbell', 'Heal Bell', 'Normal', 'Status', 0, 5, 0, 0, 'allyTeam', 'Every Pokemon in the user''s party is cured of its major status problem. Although this move is sound-based, Pokemon with the Ability Soundproof are also cured.', 'Cures the user''s party of all status conditions.'),
(377, 'healblock', 'Heal Block', 'Psychic', 'Status', 0, 15, 100, 0, 'allAdjacentFoes', 'For 5 turns, all adjacent foes are prevented from restoring any HP as long as they remain active. During the effect, direct healing moves are unusable, draining moves will not heal the user, and Abilities and items that grant healing will not heal the user. If an affected Pokemon uses Baton Pass, the replacement will remain unable to restore its HP. Pain Split and the Ability Regenerator are unaffected. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'For 5 turns, the foe(s) is prevented from healing.'),
(456, 'healorder', 'Heal Order', 'Bug', 'Status', 0, 10, 0, 0, 'self', 'The user restores 1/2 of its maximum HP, rounded half up.', 'Heals the user by 50% of its max HP.'),
(505, 'healpulse', 'Heal Pulse', 'Psychic', 'Status', 0, 10, 0, 0, 'normal', 'Causes one adjacent or non-adjacent target to gain 1/2 of its maximum HP, rounded half up. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Heals the target by 50% of its max HP.'),
(361, 'healingwish', 'Healing Wish', 'Psychic', 'Status', 0, 10, 0, 0, 'self', 'The user faints and the Pokemon brought out to replace it has its HP fully restored along with having any major status condition cured. Fails if the user is the last unfainted Pokemon in its party.', 'User faints. Replacement is fully healed.'),
(531, 'heartstamp', 'Heart Stamp', 'Psychic', 'Physical', 60, 25, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to flinch it. Makes contact.', '30% chance to flinch the target.'),
(391, 'heartswap', 'Heart Swap', 'Psychic', 'Status', 0, 10, 0, 0, 'normal', 'The user swaps all its stat stage changes with one adjacent target. Ignores a target''s Substitute.', 'Swaps all stat changes with target.'),
(535, 'heatcrash', 'Heat Crash', 'Fire', 'Physical', 0, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. The power of this move depends on (user''s weight / target''s weight), rounded down. Power is equal to 120 if the result is 5 or more, 100 if 4, 80 if 3, 60 if 2, and 40 if 1 or less. Makes contact.', 'More power the heavier the user than the target.'),
(257, 'heatwave', 'Heat Wave', 'Fire', 'Special', 95, 10, 90, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 10% chance to burn each.', '10% chance to burn the foe(s).'),
(484, 'heavyslam', 'Heavy Slam', 'Steel', 'Physical', 0, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. The power of this move depends on (user''s weight / target''s weight), rounded down. Power is equal to 120 if the result is 5 or more, 100 if 4, 80 if 3, 60 if 2, and 40 if 1 or less. Makes contact.', 'More power the heavier the user than the target.'),
(270, 'helpinghand', 'Helping Hand', 'Normal', 'Status', 0, 20, 0, 5, 'adjacentAlly', 'Causes one adjacent ally to have the power of its attack this turn boosted to 1.5x (this effect is stackable). Fails if there is no adjacent ally, but does not fail if the ally is using a two-turn move. This move ignores Protect and Detect. Ignores a target''s Substitute. Priority +5.', 'One adjacent ally''s move power is 1.5x this turn.'),
(506, 'hex', 'Hex', 'Ghost', 'Special', 65, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. Power doubles if the target has a major status problem.', 'Power doubles if the target has a status ailment.'),
(237, 'hiddenpower', 'Hidden Power', 'Normal', 'Special', 60, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. This move''s type depends on the user''s individual values (IVs). Type can be any but Normal or Fairy.', 'Varies in type based on the user''s IVs.'),
(136, 'highjumpkick', 'High Jump Kick', 'Fighting', 'Physical', 130, 10, 90, 0, 'normal', 'Deals damage to one adjacent target. If this attack is not successful, the user loses half of its maximum HP, rounded down, as crash damage. Pokemon with the Ability Magic Guard are unaffected by crash damage. This move cannot be used while Gravity is in effect. Makes contact.', 'User is hurt by 50% of its max HP if it misses.'),
(610, 'holdback', 'Hold Back', 'Normal', 'Physical', 40, 40, 100, 0, 'normal', 'Deals damage to one adjacent target but leaves it with at least 1HP. Makes contact.', 'Always leaves the target with at least 1 HP.'),
