(30, 'hornattack', 'Horn Attack', 'Normal', 'Physical', 65, 25, 100, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(32, 'horndrill', 'Horn Drill', 'Normal', 'Physical', 0, 5, 30, 0, 'normal', 'Deals damage to one adjacent target equal to the target''s maximum HP. Ignores accuracy and evasion modifiers. This attack''s accuracy is equal to (user''s level - target''s level + 30)%, and fails if the target is at a higher level. Pokemon with the Ability Sturdy are immune. Makes contact.', 'OHKOs the target. Fails if user is a lower level.'),
(532, 'hornleech', 'Horn Leech', 'Grass', 'Physical', 75, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. The user recovers half of the HP lost by the target, rounded up. If Big Root is held by the user, the HP recovered is 1.3x normal, rounded half down. Makes contact.', 'User recovers 50% of the damage dealt.'),
