(542, 'hurricane', 'Hurricane', 'Flying', 'Special', 110, 10, 70, 0, 'any', 'Deals damage to one adjacent or non-adjacent target with a 30% chance to confuse it. This move can hit a target using Bounce, Fly, or Sky Drop. If the weather is Rain Dance, this move cannot miss. If the weather is Sunny Day, this move''s accuracy is 50%.', '30% chance to confuse target. Can''t miss in rain.'),
(308, 'hydrocannon', 'Hydro Cannon', 'Water', 'Special', 150, 5, 90, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful, the user must recharge on the following turn and cannot make a move.', 'User cannot move next turn.'),
