(304, 'hypervoice', 'Hyper Voice', 'Normal', 'Special', 90, 10, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes. Pokemon with the Ability Soundproof are immune.', 'No additional effect. Hits adjacent foes.'),
(95, 'hypnosis', 'Hypnosis', 'Psychic', 'Status', 0, 20, 60, 0, 'normal', 'Puts one adjacent target to sleep. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Puts the target to sleep.'),
(301, 'iceball', 'Ice Ball', 'Ice', 'Physical', 30, 20, 90, 0, 'normal', 'Deals damage to one adjacent target. The user is locked into this move and cannot make another move until it misses, 5 turns have passed, or the attack cannot be used. Power doubles with each successful hit of this move and doubles again if Defense Curl was used previously by the user. If this move is called by Sleep Talk, the move is used for one turn. Makes contact.', 'Power doubles with each hit. Repeats for 5 turns.'),
