(333, 'iciclespear', 'Icicle Spear', 'Ice', 'Physical', 25, 30, 100, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times.', 'Hits 2-5 times in one turn.'),
(196, 'icywind', 'Icy Wind', 'Ice', 'Special', 55, 15, 95, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 100% chance to lower their Speed by 1 stage each.', '100% chance to lower the foe(s) Speed by 1.'),
(286, 'imprison', 'Imprison', 'Psychic', 'Status', 0, 10, 0, 0, 'self', 'The user prevents all of its foes from using any moves that the user also knows as long as the user remains active. Ignores a target''s Substitute.', 'No foe can use any move known by the user.'),
(510, 'incinerate', 'Incinerate', 'Fire', 'Special', 60, 15, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes and destroys any Berry or Gem they may be holding.', 'Destroys the foe(s) Berry/Gem.'),
(517, 'inferno', 'Inferno', 'Fire', 'Special', 100, 5, 50, 0, 'normal', 'Deals damage to one adjacent target with a 100% chance to burn it.', '100% chance to burn the target.'),
(611, 'infestation', 'Infestation', 'Bug', 'Special', 20, 20, 100, 0, 'normal', 'Deals damage to one adjacent target and prevents it from switching for four or five turns; seven turns if the user is holding Grip Claw. Causes damage to the target equal to 1/8 of its maximum HP (1/6 if the user is holding Binding Band), rounded down, at the end of each turn during effect. The target can still switch out if it is holding Shed Shell or uses Baton Pass, U-turn, or Volt Switch. The effect ends if either the user or the target leaves the field, or if the target uses Rapid Spin. This effect is not stackable or reset by using this or another partial-trapping move.', 'Traps and damages the target for 4-5 turns.'),
(275, 'ingrain', 'Ingrain', 'Grass', 'Status', 0, 20, 0, 0, 'self', 'The user has 1/16 of its maximum HP restored at the end of each turn, but it is prevented from switching out and other Pokemon cannot force the user to switch out. The user can still switch out if it uses Baton Pass, U-turn, or Volt Switch. If the user leaves the field using Baton Pass, the replacement will remain trapped and still receive the healing effect. During the effect, the user can be hit normally by Ground-type attacks and be affected by Spikes and Toxic Spikes, even if the user is a Flying-type or has the Ability Levitate.', 'User recovers 1/16 max HP per turn. Traps user.'),
(569, 'iondeluge', 'Ion Deluge', 'Electric', 'Status', 0, 25, 0, 1, 'all', 'Changes Normal-type moves to Electric-type moves. Priority +1.', 'Changes Normal moves to Electric type. Priority +1.'),
(334, 'irondefense', 'Iron Defense', 'Steel', 'Status', 0, 15, 0, 0, 'self', 'Raises the user''s Defense by 2 stages.', 'Boosts the user''s Defense by 2.'),
(442, 'ironhead', 'Iron Head', 'Steel', 'Physical', 80, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to flinch it. Makes contact.', '30% chance to flinch the target.'),
(231, 'irontail', 'Iron Tail', 'Steel', 'Physical', 100, 15, 75, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to lower its Defense by 1 stage. Makes contact.', '30% chance to lower the target''s Defense by 1.'),
(449, 'judgment', 'Judgment', 'Normal', 'Special', 100, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. This move''s type depends on the user''s held Plate.', 'Type varies based on the held Plate.'),
(26, 'jumpkick', 'Jump Kick', 'Fighting', 'Physical', 100, 10, 95, 0, 'normal', 'Deals damage to one adjacent target. If this attack is not successful, the user loses half of its maximum HP, rounded down, as crash damage. Pokemon with the Ability Magic Guard are unaffected by crash damage. This move cannot be used while Gravity is in effect. Makes contact.', 'User is hurt by 50% of its max HP if it misses.'),
(2, 'karatechop', 'Karate Chop', 'Fighting', 'Physical', 50, 25, 100, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit. Makes contact.', 'High critical hit ratio.'),
(134, 'kinesis', 'Kinesis', 'Psychic', 'Status', 0, 15, 80, 0, 'normal', 'Lowers one adjacent target''s accuracy by 1 stage. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the target''s accuracy by 1.'),
(588, 'kingsshield', 'King''s Shield', 'Steel', 'Status', 0, 10, 0, 4, 'self', 'Protects the user from attacks. Contactors get their Attack lowered by 2 stages. Priority +4', 'Protects user from attacks. Contactors get -Atk.'),
(282, 'knockoff', 'Knock Off', 'Dark', 'Physical', 65, 25, 100, 0, 'normal', 'Deals damage to one adjacent target and causes it to drop its held item. Does 50% more damage if the target is holding an item. This move cannot force Pokemon with the Ability Sticky Hold to lose their held item, or force a Giratina, an Arceus, a Genesect, or a pokémon able to Mega-evolve to lose their Griseous Orb, Plate, Drive, or Mega Stone respectively. Items lost to this move cannot be regained with Recycle. Makes contact.', '1.5x damage if foe holds an item. Removes item.'),
(616, 'landswrath', 'Land''s Wrath', 'Ground', 'Physical', 90, 10, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes.', 'No additional effect.'),
(387, 'lastresort', 'Last Resort', 'Normal', 'Physical', 140, 5, 100, 0, 'normal', 'Deals damage to one adjacent target. Fails unless the user knows this move and at least one other move, and has used all the other moves it knows at least once each since it became active or Transformed. Makes contact.', 'Fails unless each known move has been used.'),
(436, 'lavaplume', 'Lava Plume', 'Fire', 'Special', 80, 15, 100, 0, 'allAdjacent', 'Deals damage to all adjacent Pokemon with a 30% chance to burn each.', '30% chance to burn adjacent Pokemon.'),
(348, 'leafblade', 'Leaf Blade', 'Grass', 'Physical', 90, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit. Makes contact.', 'High critical hit ratio.'),
(437, 'leafstorm', 'Leaf Storm', 'Grass', 'Special', 130, 5, 90, 0, 'normal', 'Deals damage to one adjacent target and lowers the user''s Special Attack by 2 stages.', 'Lowers the user''s Sp. Atk by 2.'),
(536, 'leaftornado', 'Leaf Tornado', 'Grass', 'Special', 65, 10, 90, 0, 'normal', 'Deals damage to one adjacent target with a 50% chance to lower its accuracy by 1 stage.', '50% chance to lower the target''s accuracy by 1.'),
(141, 'leechlife', 'Leech Life', 'Bug', 'Physical', 20, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. The user recovers half of the HP lost by the target, rounded up. If Big Root is held by the user, the HP recovered is 1.3x normal, rounded half down. Makes contact.', 'User recovers 50% of the damage dealt.'),
(73, 'leechseed', 'Leech Seed', 'Grass', 'Status', 0, 10, 90, 0, 'normal', 'The Pokemon at the user''s position steals 1/8 of one adjacent target''s max HP, rounded down, at the end of each turn. If Big Root is held by the recipient, the HP recovered is 1.3x normal, rounded half down. If the target uses Baton Pass, the replacement will continue being leeched. If the target switches out or uses Rapid Spin, the effect ends. Grass-types are unaffected. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', '1/8 of target''s HP is restored to user every turn.'),
(43, 'leer', 'Leer', 'Normal', 'Status', 0, 30, 100, 0, 'allAdjacentFoes', 'Lowers all adjacent foes'' Defense by 1 stage. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the foe(s) Defense by 1.'),
(122, 'lick', 'Lick', 'Ghost', 'Physical', 30, 30, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to paralyze it. Makes contact.', '30% chance to paralyze the target.'),
(617, 'lightofruin', 'Light of Ruin', 'Fairy', 'Special', 140, 5, 90, 0, 'normal', 'Deals damage to one adjacent target. If the target lost HP, the user takes recoil damage equal to 1/2 that HP, rounded half up, but not less than 1 HP.', 'Has 1/2 recoil.'),
(113, 'lightscreen', 'Light Screen', 'Psychic', 'Status', 0, 30, 0, 0, 'allySide', 'For 5 turns, the user and its party members take 0.5x damage from special attacks, or 0.66x damage if in a double or triple battle. Critical hits ignore this protection. It is removed from the user''s side if the user or an ally is successfully hit by Brick Break or Defog. Lasts for 8 turns if the user is holding Light Clay.', 'For 5 turns, special damage to allies is halved.'),
(199, 'lockon', 'Lock-On', 'Normal', 'Status', 0, 5, 0, 0, 'normal', 'On the following turn, one adjacent target cannot avoid the user''s moves, even if the target is in the middle of a two-turn move. Fails if the user tries to use this move again during effect.', 'User''s next move will not miss the target.'),
(142, 'lovelykiss', 'Lovely Kiss', 'Normal', 'Status', 0, 10, 75, 0, 'normal', 'Puts one adjacent target to sleep. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Puts the target to sleep.'),
(67, 'lowkick', 'Low Kick', 'Fighting', 'Physical', 0, 20, 100, 0, 'normal', 'Deals damage to one adjacent target based on that target''s weight. Power is 20 if less than 10kg, 40 if less than 25kg, 60 if less than 50kg, 80 if less than 100kg, 100 if less than 200kg, and 120 if greater than or equal to 200kg. Makes contact.', 'More power the heavier the target.'),
(490, 'lowsweep', 'Low Sweep', 'Fighting', 'Physical', 65, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 100% chance to lower its Speed by 1 stage. Makes contact.', '100% chance to lower the target''s Speed by 1.'),
(381, 'luckychant', 'Lucky Chant', 'Normal', 'Status', 0, 30, 0, 0, 'allySide', 'For 5 turns, the user and its party members cannot be struck by a critical hit. Fails if this move is already in effect for the user''s side.', 'For 5 turns, shields user''s party from critical hits.'),
(461, 'lunardance', 'Lunar Dance', 'Psychic', 'Status', 0, 10, 0, 0, 'self', 'The user faints and the Pokemon brought out to replace it has its HP and PP fully restored along with having any major status condition cured. Fails if the user is the last unfainted Pokemon in its party.', 'User faints. Replacement is fully healed, with PP.'),
(295, 'lusterpurge', 'Luster Purge', 'Psychic', 'Special', 70, 5, 100, 0, 'normal', 'Deals damage to one adjacent target with a 50% chance to lower its Special Defense by 1 stage.', '50% chance to lower the target''s Sp. Def by 1.'),
(183, 'machpunch', 'Mach Punch', 'Fighting', 'Physical', 40, 30, 100, 1, 'normal', 'Deals damage to one adjacent target. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist. Priority +1.', 'Usually goes first.'),
(277, 'magiccoat', 'Magic Coat', 'Psychic', 'Status', 0, 15, 0, 4, 'self', 'Until the end of the turn, the user is unaffected by certain non-damaging moves directed at it and will instead use such moves against the original user. Moves reflected in this way are unable to be reflected again by this or the Ability Magic Bounce''s effect. Spikes, Stealth Rock, and Toxic Spikes can only be reflected once per side, by the leftmost Pokemon under this or the Ability Magic Bounce''s effect. If the user has the Ability Soundproof, this move''s effect happens before a sound-based move can be nullified. The Abilities Lightningrod and Storm Drain redirect their respective moves before this move takes effect. Priority +4.', 'Bounces back certain non-damaging moves.'),
(478, 'magicroom', 'Magic Room', 'Psychic', 'Status', 0, 10, 0, 0, 'all', 'For 5 turns, the held items of all active Pokemon have no effect. During the effect, Fling and Natural Gift are prevented from being used by all active Pokemon. If this move is used during the effect, the effect ends.', 'For 5 turns, all held items have no effect.'),
(345, 'magicalleaf', 'Magical Leaf', 'Grass', 'Special', 60, 20, 0, 0, 'normal', 'Deals damage to one adjacent target and does not check accuracy.', 'This move does not check accuracy.'),
(463, 'magmastorm', 'Magma Storm', 'Fire', 'Special', 100, 5, 75, 0, 'normal', 'Deals damage to one adjacent target and prevents it from switching for four or five turns; seven turns if the user is holding Grip Claw. Causes damage to the target equal to 1/8 of its maximum HP (1/6 if the user is holding Binding Band), rounded down, at the end of each turn during effect. The target can still switch out if it is holding Shed Shell or uses Baton Pass, U-turn, or Volt Switch. The effect ends if either the user or the target leaves the field, or if the target uses Rapid Spin. This effect is not stackable or reset by using this or another partial-trapping move.', 'Traps and damages the target for 4-5 turns.'),
(443, 'magnetbomb', 'Magnet Bomb', 'Steel', 'Physical', 60, 20, 0, 0, 'normal', 'Deals damage to one adjacent target and does not check accuracy.', 'This move does not check accuracy.'),
(602, 'magneticflux', 'Magnetic Flux', 'Electric', 'Status', 0, 20, 0, 0, 'allySide', 'Raises the Defense and Sp. Def stats of ally PokÃ©mon with the Plus or Minus Ability.', 'Raises defenses of ally Pokemon with Plus/Minus.'),
(393, 'magnetrise', 'Magnet Rise', 'Electric', 'Status', 0, 10, 0, 0, 'self', 'For 5 turns, the user is immune to Ground-type attacks and the effects of Spikes, Toxic Spikes, and the Ability Arena Trap as long as it remains active. If the user uses Baton Pass, the replacement will gain the effect. Ingrain, Smack Down, and Iron Ball override this move if the user is under any of their effects. Fails if the user is already under this effect or the effects of Ingrain or Smack Down. This move cannot be used while Gravity is in effect.', 'For 5 turns, the user is immune to Ground moves.'),
(222, 'magnitude', 'Magnitude', 'Ground', 'Physical', 0, 30, 100, 0, 'allAdjacent', 'Deals damage to all adjacent Pokemon. The power of this move varies; 5% chances for 10 and 150 power, 10% chances for 30 and 110 power, 20% chances for 50 and 90 power, and 30% chance for 70 power. Power doubles against Pokemon using Dig.', 'Hits adjacent Pokemon. Power varies; 2x on Dig.'),
(561, 'matblock', 'Mat Block', 'Fighting', 'Status', 0, 10, 0, 0, 'allySide', 'The user protects itself and its allies from damaging moves. Only works first turn out.', 'Protects from damaging moves. First turn out only.'),
(382, 'mefirst', 'Me First', 'Normal', 'Status', 0, 20, 0, 0, 'adjacentFoe', 'The user selects one adjacent foe and uses the move it chose for use this turn against it, if possible, with 1.5x the power. The move must be a damaging move other than Chatter, Counter, Covet, Focus Punch, Me First, Metal Burst, Mirror Coat, Thief, or Struggle. Fails if the foe moves before the user. Ignores the foe''s Substitute for the purpose of copying the move.', 'Copies a foe at 1.5x power. User must be faster.'),
(212, 'meanlook', 'Mean Look', 'Normal', 'Status', 0, 5, 0, 0, 'normal', 'Prevents one adjacent target from switching out. The target can still switch out if it is holding Shed Shell or uses Baton Pass, U-turn, or Volt Switch. If the target leaves the field using Baton Pass, the replacement will remain trapped. The effect ends if the user leaves the field. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'The target cannot switch out.'),
(96, 'meditate', 'Meditate', 'Psychic', 'Status', 0, 40, 0, 0, 'self', 'Raises the user''s Attack by 1 stage.', 'Boosts the user''s Attack by 1.'),
(72, 'megadrain', 'Mega Drain', 'Grass', 'Special', 40, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. The user recovers half of the HP lost by the target, rounded up. If Big Root is held by the user, the HP recovered is 1.3x, rounded half down.', 'User recovers 50% of the damage dealt.'),
(25, 'megakick', 'Mega Kick', 'Normal', 'Physical', 120, 5, 75, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(5, 'megapunch', 'Mega Punch', 'Normal', 'Physical', 80, 20, 85, 0, 'normal', 'Deals damage to one adjacent target. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist.', 'No additional effect.'),
(224, 'megahorn', 'Megahorn', 'Bug', 'Physical', 120, 10, 85, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(262, 'memento', 'Memento', 'Dark', 'Status', 0, 10, 100, 0, 'normal', 'Lowers one adjacent target''s Attack and Special Attack by 2 stages. The user faints unless this move misses or there is no target. Fails entirely if the target has a Substitute, but does not fail if the target''s stats cannot be changed.', 'Lowers target''s Attack, Sp. Atk by 2. User faints.'),
(368, 'metalburst', 'Metal Burst', 'Steel', 'Physical', 0, 10, 100, 0, 'scripted', 'Deals damage to the last foe to hit the user with an attack this turn. The damage is equal to 1.5x the HP lost by the user from that attack. If that foe''s position is no longer in use, damage is done to a random foe in range. Only the last hit of a multi-hit attack is counted. Fails if the user moves first or if the user was not hit by a foe''s attack this turn.', 'If hit by an attack, returns 1.5x damage.'),
(232, 'metalclaw', 'Metal Claw', 'Steel', 'Physical', 50, 35, 95, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to raise the user''s Attack by 1 stage. Makes contact.', '10% chance to boost the user''s Attack by 1.'),
(319, 'metalsound', 'Metal Sound', 'Steel', 'Status', 0, 40, 85, 0, 'normal', 'Lowers one adjacent target''s Special Defense by 2 stages. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Pokemon with the Ability Soundproof are immune.', 'Lowers the target''s Sp. Def by 2.'),
(309, 'meteormash', 'Meteor Mash', 'Steel', 'Physical', 90, 10, 90, 0, 'normal', 'Deals damage to one adjacent target with a 20% chance to raise the user''s Attack by 1 stage. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist.', '20% chance to boost the user''s Attack by 1.');
INSERT INTO `attack_dex` (`no`, `id`, `name`, `type`, `category`, `base_power`, `pp`, `accuracy`, `priority`, `target`, `desc`, `short_desc`) VALUES
(118, 'metronome', 'Metronome', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'A random move is selected for use, other than After You, Assist, Bestow, Chatter, Copycat, Counter, Covet, Destiny Bond, Detect, Endure, Feint, Focus Punch, Follow Me, Freeze Shock, Helping Hand, Ice Burn, Me First, Metronome, Mimic, Mirror Coat, Mirror Move, Nature Power, Protect, Quash, Quick Guard, Rage Powder, Relic Song, Secret Sword, Sketch, Sleep Talk, Snarl, Snatch, Snore, Struggle, Switcheroo, Techno Blast, Thief, Transform, Trick, V-create, or Wide Guard.', 'Picks a random move.'),
(208, 'milkdrink', 'Milk Drink', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'The user restores 1/2 of its maximum HP, rounded half up. (Field: Can be used to heal an ally by draining 1/5 of the user''s maximum HP, rounded down, and restoring that amount to the selected ally. Fails if the user''s HP would be reduced to less than 1.)', 'Heals the user by 50% of its max HP.'),
(102, 'mimic', 'Mimic', 'Normal', 'Status', 0, 10, 0, 0, 'normal', 'This move is replaced by the last move used by one adjacent target. The copied move has the maximum PP for that move. Fails if the target has not made a move, if the user has Transformed, or if the move is Chatter, Mimic, Sketch, Struggle, or Transform. Ignores a target''s Substitute.', 'The last move the target used replaces this one.'),
(170, 'mindreader', 'Mind Reader', 'Normal', 'Status', 0, 5, 0, 0, 'normal', 'On the following turn, one adjacent target cannot avoid the user''s moves, even if the target is in the middle of a two-turn move. Fails if the user tries to use this move again during effect.', 'User''s next move will not miss the target.'),
(107, 'minimize', 'Minimize', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'Raises the user''s evasion by 2 stages. After using this move, Stomp, Steamroller, Body Slam, Flying Press, Dragon Rush and Phantom Force will have their power doubled and won''t check accuracy if used against the user while it is active.', 'Boosts the user''s evasion by 2.'),
(357, 'miracleeye', 'Miracle Eye', 'Psychic', 'Status', 0, 40, 0, 0, 'normal', 'Causes one adjacent target to have its positive evasion stat stage set to 0 while it is active. Psychic-type attacks can hit the target if it is a Dark-type. The effect ends when the target is no longer active. Fails if the target is already affected. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute.', 'Blocks evasion mods. Psychic hits Dark.'),
(243, 'mirrorcoat', 'Mirror Coat', 'Psychic', 'Special', 0, 20, 100, -5, 'scripted', 'Deals damage to the last foe to hit the user with a special attack this turn. The damage is equal to twice the HP lost by the user from that attack. If that foe''s position is no longer in use, damage is done to a random foe in range. Only the last hit of a multi-hit attack is counted. Fails if the user was not hit by a foe''s special attack this turn. Priority -5.', 'If hit by special attack, returns double damage.'),
(119, 'mirrormove', 'Mirror Move', 'Flying', 'Status', 0, 20, 0, 0, 'normal', 'The user uses the last move used by a selected adjacent target. The copied move is used against that target, if possible. Fails if the target has not yet used a move, or the last move used was Acupressure, After You, Aromatherapy, Chatter, Conversion 2, Counter, Curse, Doom Desire, Feint, Final Gambit, Focus Punch, Future Sight, Gravity, Guard Split, Hail, Haze, Heal Bell, Heal Pulse, Helping Hand, Light Screen, Lucky Chant, Me First, Mimic, Mirror Coat, Mist, Mud Sport, Nature Power, Perish Song, Power Split, Psych Up, Quick Guard, Rain Dance, Reflect, Reflect Type, Role Play, Safeguard, Sandstorm, Sketch, Spikes, Spit Up, Stealth Rock, Struggle, Sunny Day, Tailwind, Toxic Spikes, Transform, Water Sport, Wide Guard, or any move that is self-targeting.', 'User uses the target''s last used move against it.'),
(429, 'mirrorshot', 'Mirror Shot', 'Steel', 'Special', 65, 10, 85, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to lower its accuracy by 1 stage.', '30% chance to lower the target''s accuracy by 1.'),
(54, 'mist', 'Mist', 'Ice', 'Status', 0, 30, 0, 0, 'allySide', 'For 5 turns, the user and its party members are protected from having their stats lowered by other Pokemon.', 'For 5 turns, protects user''s party from stat drops.'),
(296, 'mistball', 'Mist Ball', 'Psychic', 'Special', 70, 5, 100, 0, 'normal', 'Deals damage to one adjacent target with a 50% chance to lower its Special Attack by 1 stage.', '50% chance to lower the target''s Sp. Atk by 1.'),
(581, 'mistyterrain', 'Misty Terrain', 'Fairy', 'Status', 0, 10, 0, 0, 'all', 'For five turns, Grounded Pokemon cannot have major status problem inflicted on them by other Pokemon. Dragon-type moves used against them are weakened by 50%.', 'Prevents status and weakens Dragon if grounded.'),
(585, 'moonblast', 'Moonblast', 'Fairy', 'Special', 95, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to lower its Special Attack by 1 stage.', '30% chance to lower the target''s Sp. Atk by 1.'),
(236, 'moonlight', 'Moonlight', 'Fairy', 'Status', 0, 5, 0, 0, 'self', 'The user restores 1/2 of its maximum HP if no weather conditions are in effect, 2/3 of its maximum HP if the weather is Sunny Day, and 1/4 of its maximum HP if the weather is Hail, Rain Dance, or Sandstorm, all rounded half down.', 'Heals the user by a weather-dependent amount.'),
(234, 'morningsun', 'Morning Sun', 'Normal', 'Status', 0, 5, 0, 0, 'self', 'The user restores 1/2 of its maximum HP if no weather conditions are in effect, 2/3 of its maximum HP if the weather is Sunny Day, and 1/4 of its maximum HP if the weather is Hail, Rain Dance, or Sandstorm, all rounded half down.', 'Heals the user by a weather-dependent amount.'),
(189, 'mudslap', 'Mud-Slap', 'Ground', 'Special', 20, 10, 100, 0, 'normal', 'Deals damage to one adjacent target with a 100% chance to lower its accuracy by 1 stage.', '100% chance to lower the target''s accuracy by 1.'),
(426, 'mudbomb', 'Mud Bomb', 'Ground', 'Special', 65, 10, 85, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to lower its accuracy by 1 stage.', '30% chance to lower the target''s accuracy by 1.'),
(341, 'mudshot', 'Mud Shot', 'Ground', 'Special', 55, 15, 95, 0, 'normal', 'Deals damage to one adjacent target with a 100% chance to lower its Speed by 1 stage.', '100% chance to lower the target''s Speed by 1.'),
(300, 'mudsport', 'Mud Sport', 'Ground', 'Status', 0, 15, 0, 0, 'all', 'For 5 turns, all Electric-type attacks used by any active Pokemon have their power reduced to 0.33x. Fails if this move is already in effect; not stackable.', 'For 5 turns, Electric-type attacks have 1/3 power.'),
(330, 'muddywater', 'Muddy Water', 'Water', 'Special', 90, 10, 85, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 30% chance to lower their accuracy by 1 stage each.', '30% chance to lower the foe(s) accuracy by 1.'),
(595, 'mysticalfire', 'Mystical Fire', 'Fire', 'Special', 65, 10, 100, 0, 'normal', 'Deals damage to one adjacent target and lowers its Special Attack by 1 stage.', 'Lowers the target''s Special Attack by 1.'),
(417, 'nastyplot', 'Nasty Plot', 'Dark', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Special Attack by 2 stages.', 'Boosts the user''s Sp. Atk by 2.'),
(363, 'naturalgift', 'Natural Gift', 'Normal', 'Physical', 0, 15, 100, 0, 'normal', 'Deals damage to one adjacent target if the user''s held item is a Berry. The type and power of this move depend on the kind of Berry held, and the Berry is lost. Fails if the user is not holding a Berry, if the user has the Ability Klutz, or if Embargo or Magic Room is in effect for the user.', 'Power and type depends on the user''s Berry.'),
(267, 'naturepower', 'Nature Power', 'Normal', 'Status', 0, 20, 0, 0, 'self', 'This move calls another move for use depending on the battle terrain: Thunderbolt in Electric Terrain, Energy Ball in Grassy Terrain, Moonblast in Misty Terrain, and Tri Attack in plain terrain.', 'Attack depends on terrain (default Tri Attack).'),
(302, 'needlearm', 'Needle Arm', 'Grass', 'Physical', 60, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to flinch it. Makes contact.', '30% chance to flinch the target.'),
(539, 'nightdaze', 'Night Daze', 'Dark', 'Special', 85, 10, 95, 0, 'normal', 'Deals damage to one adjacent target with a 40% chance to lower its accuracy by 1 stage.', '40% chance to lower the target''s accuracy by 1.'),
(101, 'nightshade', 'Night Shade', 'Ghost', 'Special', 0, 15, 100, 0, 'normal', 'Deals damage to one adjacent target equal to the user''s level.', 'Does damage equal to the user''s level.'),
(400, 'nightslash', 'Night Slash', 'Dark', 'Physical', 70, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit. Makes contact.', 'High critical hit ratio.'),
(171, 'nightmare', 'Nightmare', 'Ghost', 'Status', 0, 15, 100, 0, 'normal', 'Causes one adjacent target to lose 1/4 of its maximum HP, rounded down, at the end of each turn as long as it is asleep. This move does not affect the target unless it is asleep. The effect ends when the target wakes up.', 'A sleeping target is hurt by 1/4 max HP per turn.'),
(568, 'nobleroar', 'Noble Roar', 'Normal', 'Status', 0, 30, 100, 0, 'normal', 'Lowers the target''s Attack and Special Attack by 1 stage. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers target''s Atk and SpAtk by 1.'),
(609, 'nuzzle', 'Nuzzle', 'Electric', 'Physical', 20, 20, 100, 0, 'normal', 'Deals damage and paralyzes the target.', 'Deals damage and paralyzes the target.'),
(613, 'oblivionwing', 'Oblivion Wing', 'Flying', 'Special', 80, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. The user recovers 75% of the HP lost by the target, rounded up.', 'User recovers 75% of the damage dealt.'),
(190, 'octazooka', 'Octazooka', 'Water', 'Special', 65, 10, 85, 0, 'normal', 'Deals damage to one adjacent target with a 50% chance to lower its accuracy by 1 stage.', '50% chance to lower the target''s accuracy by 1.'),
(316, 'odorsleuth', 'Odor Sleuth', 'Normal', 'Status', 0, 40, 0, 0, 'normal', 'Causes one adjacent target to have its positive evasion stat stage set to 0 while it is active. Normal and Fighting-type attacks can hit the target if it is a Ghost-type. The effect ends when the target is no longer active. Fails if the target is already affected. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute.', 'Blocks evasion mods. Fighting, Normal hit Ghost.'),
(466, 'ominouswind', 'Ominous Wind', 'Ghost', 'Special', 60, 5, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to raise the user''s Attack, Defense, Speed, Special Attack, and Special Defense by 1 stage.', '10% chance to boost all stats by 1 (not acc/eva).'),
(200, 'outrage', 'Outrage', 'Dragon', 'Physical', 120, 10, 100, 0, 'randomNormal', 'Deals damage to one adjacent foe at random. The user spends two or three turns locked into this move and becomes confused after the last turn of the effect if it is not already. If the user is prevented from moving or the attack is not successful against the target on the first turn of the effect or the second turn of a three-turn effect, the effect ends without causing confusion. If this move is called by Sleep Talk, the move is used for one turn and does not confuse the user. Makes contact.', 'Lasts 2-3 turns. Confuses the user afterwards.'),
(315, 'overheat', 'Overheat', 'Fire', 'Special', 130, 5, 90, 0, 'normal', 'Deals damage to one adjacent target and lowers the user''s Special Attack by 2 stages.', 'Lowers the user''s Sp. Atk by 2.'),
(220, 'painsplit', 'Pain Split', 'Normal', 'Status', 0, 20, 0, 0, 'normal', 'The user and one adjacent target''s HP become the average of their current HP, rounded down, but not more than the maximum HP of either one.', 'Shares HP of user and target equally.'),
(570, 'paraboliccharge', 'Parabolic Charge', 'Electric', 'Special', 50, 20, 100, 0, 'allAdjacent', 'Deals damage to all adjacent targets. The user recovers half of the HP lost by the target, rounded up.', 'User recovers 50% of the damage dealt.'),
(575, 'partingshot', 'Parting Shot', 'Dark', 'Status', 0, 20, 100, 0, 'normal', 'Lowers all adjacent foes'' Attack and Special Attack by 1 stage, then the user switches out.', 'Foe''s Atk/SpA -1, then switch out.'),
(6, 'payday', 'Pay Day', 'Normal', 'Physical', 40, 20, 100, 0, 'normal', 'Deals damage to one adjacent target. (In-game: Each time this move is successfully used in battle, an amount of money equal to five times the user''s level is added to the total the player receives upon winning the battle.)', 'Scatters coins.'),
(371, 'payback', 'Payback', 'Dark', 'Physical', 50, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. Power doubles if the target moves before the user; power is not doubled if the target switches out. Makes contact.', 'Power doubles if the user moves after the target.'),
(64, 'peck', 'Peck', 'Flying', 'Physical', 35, 35, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target. Makes contact.', 'No additional effect.'),
(195, 'perishsong', 'Perish Song', 'Normal', 'Status', 0, 5, 0, 0, 'all', 'Causes the user and all adjacent and non-adjacent Pokemon to receive a perish count of 4 if it doesn''t already have a perish count. At the end of each turn including the turn used, the perish count of all active Pokemon lowers by 1 and Pokemon faint if the number reaches 0. The perish count is removed from Pokemon who switch out. If a Pokemon uses Baton Pass while it has a perish count, the replacement will gain the perish count and continue to count down. Pokemon with the Ability Soundproof are immune. Ignores a target''s Substitute.', 'All active Pokemon will faint in 3 turns.'),
(572, 'petalblizzard', 'Petal Blizzard', 'Grass', 'Physical', 90, 15, 100, 0, 'allAdjacent', 'Hits all adjacent Pokemon.', 'Hits all adjacent Pokemon.'),
(80, 'petaldance', 'Petal Dance', 'Grass', 'Special', 120, 10, 100, 0, 'randomNormal', 'Deals damage to one adjacent foe at random. The user spends two or three turns locked into this move and becomes confused after the last turn of the effect if it is not already. If the user is prevented from moving or the attack is not successful against the target on the first turn of the effect or the second turn of a three-turn effect, the effect ends without causing confusion. If this move is called by Sleep Talk, the move is used for one turn and does not confuse the user. Makes contact.', 'Lasts 2-3 turns. Confuses the user afterwards.'),
(566, 'phantomforce', 'Phantom Force', 'Ghost', 'Physical', 90, 10, 100, 0, 'normal', 'Deals damage to one adjacent target and breaks through Protect and Detect for this turn, allowing other Pokemon to attack the target normally. This attack charges on the first turn and strikes on the second. On the first turn, the user avoids all attacks. The user cannot make a move between turns. If the user is holding a Power Herb, the move completes in one turn. Makes contact.', 'Disappears turn 1. Hits turn 2. Breaks protection.'),
(42, 'pinmissile', 'Pin Missile', 'Bug', 'Physical', 25, 20, 95, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times.', 'Hits 2-5 times in one turn.'),
(589, 'playnice', 'Play Nice', 'Normal', 'Status', 0, 20, 0, 0, 'normal', 'Lowers the target''s Attack by 1 stage. Ignores Protect.', 'Lowers target''s Attack by 1. Ignores Protect.'),
(583, 'playrough', 'Play Rough', 'Fairy', 'Physical', 90, 10, 90, 0, 'normal', 'May lower the target''s Attack stat by 1.', 'May lower the target''s Attack by 1.'),
(365, 'pluck', 'Pluck', 'Flying', 'Physical', 60, 20, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target. If this move is successful and the user has not fainted, it steals the target''s held Berry if it is holding one and uses it immediately. Makes contact.', 'User steals and eats the target''s Berry.'),
(305, 'poisonfang', 'Poison Fang', 'Poison', 'Physical', 50, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to badly poison it. Makes contact.', '30% chance to badly poison the target.'),
(139, 'poisongas', 'Poison Gas', 'Poison', 'Status', 0, 40, 90, 0, 'allAdjacentFoes', 'Poisons all adjacent foes. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Poisons the foe(s).'),
(398, 'poisonjab', 'Poison Jab', 'Poison', 'Physical', 80, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to poison it. Makes contact.', '30% chance to poison the target.'),
(77, 'poisonpowder', 'Poison Powder', 'Poison', 'Status', 0, 35, 75, 0, 'normal', 'Poisons one adjacent target. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Poisons the target.'),
(40, 'poisonsting', 'Poison Sting', 'Poison', 'Physical', 15, 35, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to poison it.', '30% chance to poison the target.'),
(342, 'poisontail', 'Poison Tail', 'Poison', 'Physical', 50, 25, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to poison it and a higher chance for a critical hit. Makes contact.', 'High critical hit ratio. 10% chance to poison.'),
(1, 'pound', 'Pound', 'Normal', 'Physical', 40, 35, 100, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(600, 'powder', 'Powder', 'Bug', 'Status', 0, 20, 100, 1, 'normal', 'Covers the target in powder that explodes if the target uses a Fire-type move. +1 Priority.', 'Foe takes damage when using Fire moves. +1 Priority.'),
(181, 'powdersnow', 'Powder Snow', 'Ice', 'Special', 40, 25, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 10% chance to freeze each.', '10% chance to freeze the foe(s).'),
(408, 'powergem', 'Power Gem', 'Rock', 'Special', 80, 20, 100, 0, 'normal', 'Deals damage to one adjacent target.', 'No additional effect.'),
(471, 'powersplit', 'Power Split', 'Psychic', 'Status', 0, 10, 0, 0, 'normal', 'The user and one adjacent target have their Attack and Special Attack stats set to be equal to the average of the user and the target''s Attack and Special Attack stats, respectively, rounded down. Stat stage changes are unaffected.', 'Averages Attack and Sp. Atk stats with target.'),
(384, 'powerswap', 'Power Swap', 'Psychic', 'Status', 0, 10, 0, 0, 'normal', 'The user swaps its Attack and Special Attack stat stage changes with one adjacent target. Ignores a target''s Substitute.', 'Swaps Attack and Sp. Atk stat stages with target.'),
(379, 'powertrick', 'Power Trick', 'Psychic', 'Status', 0, 10, 0, 0, 'self', 'The user swaps its Attack and Defense stats; stat stage changes remain on their respective stats. This move can be used again to swap the stats back. If the user uses Baton Pass, the replacement will have its Attack and Defense stats swapped if the effect is active.', 'Switches user''s Attack and Defense stats.'),
(612, 'poweruppunch', 'Power-Up Punch', 'Fighting', 'Physical', 40, 20, 100, 0, 'normal', 'Hitting a target raises the Attack stat.', 'Hitting a target raises Attack by 1'),
(438, 'powerwhip', 'Power Whip', 'Grass', 'Physical', 120, 10, 85, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(217, 'present', 'Present', 'Normal', 'Physical', 0, 15, 90, 0, 'normal', 'Deals damage or heals one adjacent target. 40% chance for 40 power, 30% chance for 80 power, 10% chance for 120 power, and 20% chance to heal the target by 1/4 of its maximum HP, rounded down. This move must hit to be effective.', '40, 80, 120 power, or heals target by 1/4 max HP.'),
(182, 'protect', 'Protect', 'Normal', 'Status', 0, 10, 0, 4, 'self', 'The user is protected from most attacks made by other Pokemon during this turn. This attack has a 1/X chance of being successful, where X starts at 1 and doubles each time this move is successfully used. X resets to 1 if this attack fails or if the user''s last used move is not Detect, Endure, Protect, Quick Guard, or Wide Guard. If X is 256 or more, this move has a 1/(2^32) chance of being successful. Fails if the user moves last this turn. Priority +4.', 'Prevents moves from affecting the user this turn.'),
(60, 'psybeam', 'Psybeam', 'Psychic', 'Special', 65, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to confuse it.', '10% chance to confuse the target.'),
(244, 'psychup', 'Psych Up', 'Normal', 'Status', 0, 10, 0, 0, 'normal', 'The user copies all of one adjacent target''s current stat stage changes. This move ignores Protect and Detect. Ignores a target''s Substitute.', 'Copies the target''s current stat stages.'),
(94, 'psychic', 'Psychic', 'Psychic', 'Special', 90, 10, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to lower its Special Defense by 1 stage.', '10% chance to lower the target''s Sp. Def by 1.'),
(354, 'psychoboost', 'Psycho Boost', 'Psychic', 'Special', 140, 5, 90, 0, 'normal', 'Deals damage to one adjacent target and lowers the user''s Special Attack by 2 stages.', 'Lowers the user''s Sp. Atk by 2.'),
(427, 'psychocut', 'Psycho Cut', 'Psychic', 'Physical', 70, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit.', 'High critical hit ratio.'),
(375, 'psychoshift', 'Psycho Shift', 'Psychic', 'Status', 0, 10, 100, 0, 'normal', 'The user''s major status problem is transferred to one adjacent target, and the user is cured. Fails if the target already has a major status problem.', 'Transfers the user''s status ailment to the target.'),
(473, 'psyshock', 'Psyshock', 'Psychic', 'Special', 80, 10, 100, 0, 'normal', 'Deals damage to one adjacent target based on its Defense instead of Special Defense.', 'Damages target based on Defense, not Sp. Def.'),
(540, 'psystrike', 'Psystrike', 'Psychic', 'Special', 100, 10, 100, 0, 'normal', 'Deals damage to one adjacent target based on its Defense instead of Special Defense.', 'Damages target based on Defense, not Sp. Def.'),
(149, 'psywave', 'Psywave', 'Psychic', 'Special', 0, 15, 100, 0, 'normal', 'Deals damage to one adjacent target equal to (user''s level) * (X + 50) / 100, where X is a random number from 0 to 100, rounded down, but not less than 1HP.', 'Random damage equal to 0.5x-1.5x user''s level.'),
(386, 'punishment', 'Punishment', 'Dark', 'Physical', 0, 5, 100, 0, 'normal', 'Deals damage to one adjacent target. Power is equal to 60 + (X * 20), where X is the target''s total stat stage changes that are greater than 0, but not more than 200 power. Makes contact.', '60 power + 20 for each of the target''s stat boosts.'),
(228, 'pursuit', 'Pursuit', 'Dark', 'Physical', 40, 20, 100, 0, 'normal', 'Deals damage to one adjacent target. If an adjacent foe switches out this turn, this move hits that Pokemon before it leaves the field. If the user moves after a foe using U-turn or Volt Switch, but not Baton Pass, it will hit that foe before it leaves the field. Power doubles and no accuracy check is done if the user hits a foe switching out, and the user''s turn is over; if a foe faints from this, the replacement Pokemon does not become active until the end of the turn. Makes contact.', 'Power doubles if a foe is switching out.'),
(511, 'quash', 'Quash', 'Dark', 'Status', 0, 15, 100, 0, 'normal', 'Causes one adjacent target to take its turn after all other Pokemon this turn, no matter the priority of its selected move. Fails if the target already moved this turn.', 'Forces the target to move last this turn.'),
(98, 'quickattack', 'Quick Attack', 'Normal', 'Physical', 40, 30, 100, 1, 'normal', 'Deals damage to one adjacent target. Makes contact. Priority +1.', 'Usually goes first.'),
(501, 'quickguard', 'Quick Guard', 'Fighting', 'Status', 0, 15, 0, 3, 'allySide', 'The user and its party members are protected from attacks with priority greater than 0 made by other Pokemon, including allies, during this turn. Fails if this move is already in effect for the user''s side. Priority +3.', 'Protects allies from priority attacks this turn.'),
(483, 'quiverdance', 'Quiver Dance', 'Bug', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Special Attack, Special Defense, and Speed by 1 stage.', 'Boosts the user''s Sp. Atk, Sp. Def, Speed by 1.'),
(99, 'rage', 'Rage', 'Normal', 'Physical', 20, 20, 100, 0, 'normal', 'Deals damage to one adjacent target. Once this move is used, the user''s Attack is raised by 1 stage every time it is hit by another Pokemon''s attack as long as this move is chosen for use. Makes contact.', 'Boosts the user''s Attack by 1 if hit during use.'),
(476, 'ragepowder', 'Rage Powder', 'Bug', 'Status', 0, 20, 0, 2, 'self', 'Until the end of the turn, all single-target attacks from the foe''s team are redirected to the user if they are in range. Such attacks are redirected to the user before they can be reflected by Magic Coat or the Ability Magic Bounce, or drawn in by the Abilities Lightningrod or Storm Drain. Fails if it is not a double or triple battle. Priority +3.', 'The foes'' moves target the user on the turn used.'),
(240, 'raindance', 'Rain Dance', 'Water', 'Status', 0, 5, 0, 0, 'all', 'For 5 turns, the weather becomes Rain Dance. The power of Water-type attacks is 1.5x and the power of Fire-type attacks is 0.5x during the effect. Lasts for 8 turns if the user is holding Damp Rock. Fails if the current weather is Rain Dance.', 'For 5 turns, heavy rain powers Water moves.'),
(229, 'rapidspin', 'Rapid Spin', 'Normal', 'Physical', 20, 40, 100, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful and the user has not fainted, the effects of Leech Seed and partial-trapping moves end for the user, and all hazards are removed from the user''s side of the field.', 'Frees user from hazards/partial trap/Leech Seed.'),
(75, 'razorleaf', 'Razor Leaf', 'Grass', 'Physical', 55, 25, 95, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a higher chance for a critical hit.', 'High critical hit ratio. Hits adjacent foes.'),
(534, 'razorshell', 'Razor Shell', 'Water', 'Physical', 75, 10, 95, 0, 'normal', 'Deals damage to one adjacent target with a 50% chance to lower its Defense by 1 stage. Makes contact.', '50% chance to lower the target''s Defense by 1.'),
(13, 'razorwind', 'Razor Wind', 'Normal', 'Special', 80, 10, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a higher chance for a critical hit. This attack charges on the first turn and strikes on the second. The user cannot make a move between turns. If the user is holding a Power Herb, the move completes in one turn.', 'Charges, then hits foe(s) turn 2. High crit ratio.'),
(105, 'recover', 'Recover', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'The user restores 1/2 of its maximum HP, rounded half up.', 'Heals the user by 50% of its max HP.'),
(278, 'recycle', 'Recycle', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'The user regains the item it last used, if it is not holding an item. Fails if the user was not holding an item, if the item was a popped Air Balloon, or if the item was lost to Bug Bite, Covet, Incinerate, Knock Off, Pluck, or Thief. Items thrown with Fling can be regained.', 'Restores the item the user last used.'),
(115, 'reflect', 'Reflect', 'Psychic', 'Status', 0, 20, 0, 0, 'allySide', 'For 5 turns, the user and its party members take 0.5x damage from physical attacks, or 0.66x damage if in a double or triple battle. Critical hits ignore this protection. It is removed from the user''s side if the user or an ally is successfully hit by Brick Break or Defog. Brick Break removes the effect before damage is calculated. Lasts for 8 turns if the user is holding Light Clay.', 'For 5 turns, physical damage to allies is halved.'),
(513, 'reflecttype', 'Reflect Type', 'Normal', 'Status', 0, 15, 0, 0, 'normal', 'Causes the user''s types to become those of one adjacent target. Fails if the user is an Arceus. Ignores a target''s Substitute.', 'User becomes the same type as the target.'),
(287, 'refresh', 'Refresh', 'Normal', 'Status', 0, 20, 0, 0, 'self', 'The user cures its burn, poison, or paralysis.', 'Removes status from the user.'),
(547, 'relicsong', 'Relic Song', 'Normal', 'Special', 75, 10, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 10% chance to put each to sleep. If this move is successful on at least one foe and the user is a Meloetta, it changes to the Pirouette Forme if it is currently in Aria Forme, or changes to Aria Forme if it is currently in Pirouette Forme. The Pirouette Forme reverts to Aria Forme when Meloetta is not active. Pokemon with the Ability Soundproof are immune.', '10% chance to sleep foe(s). Meloetta transforms.'),
(156, 'rest', 'Rest', 'Psychic', 'Status', 0, 10, 0, 0, 'self', 'The user falls asleep for the next two turns and restores all of its HP, curing itself of any major status problem in the process. Fails if the user has full HP, is already asleep, or if another effect is preventing sleep.', 'User sleeps 2 turns and restores HP and status.'),
(514, 'retaliate', 'Retaliate', 'Normal', 'Physical', 70, 5, 100, 0, 'normal', 'Deals damage to one adjacent target. Power doubles if one of the user''s party members fainted last turn. Makes contact.', 'Power doubles if an ally fainted last turn.'),
(216, 'return', 'Return', 'Normal', 'Physical', 0, 20, 100, 0, 'normal', 'Deals damage to one adjacent target. Power is equal to the greater of (user''s Happiness * 2/5), rounded down, or 1. Makes contact.', 'Max 102 power at maximum Happiness.'),
(279, 'revenge', 'Revenge', 'Fighting', 'Physical', 60, 10, 100, -4, 'normal', 'Deals damage to one adjacent target. Power doubles if the user was hit by that target this turn. Makes contact. Priority -4.', 'Power doubles if user is damaged by the target.'),
(179, 'reversal', 'Reversal', 'Fighting', 'Physical', 0, 15, 100, 0, 'normal', 'Deals damage to one adjacent target based on the amount of HP the user has left. X is equal to (user''s current HP * 48 / user''s maximum HP), rounded down; the base power of this attack is 20 if X is 33 to 48, 40 if X is 17 to 32, 80 if X is 10 to 16, 100 if X is 5 to 9, 150 if X is 2 to 4, and 200 if X is 0 or 1. Makes contact.', 'More power the less HP the user has left.'),
(46, 'roar', 'Roar', 'Normal', 'Status', 0, 20, 0, -6, 'normal', 'Causes one adjacent target to be forced to switch out and be replaced with a random unfainted ally. Fails if the target used Ingrain previously or has the Ability Suction Cups. Pokemon with the Ability Soundproof are immune. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute. Priority -6. (Wild battles: The battle ends as long as it is not a double battle and the user''s level is not less than the opponent''s level.)', 'Forces the target to switch to a random ally.'),
(459, 'roaroftime', 'Roar of Time', 'Dragon', 'Special', 150, 5, 90, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful, the user must recharge on the following turn and cannot make a move.', 'User cannot move next turn.'),
(350, 'rockblast', 'Rock Blast', 'Rock', 'Physical', 25, 10, 90, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times.', 'Hits 2-5 times in one turn.'),
(431, 'rockclimb', 'Rock Climb', 'Normal', 'Physical', 90, 20, 85, 0, 'normal', 'Deals damage to one adjacent target with a 20% chance to confuse it. Makes contact.', '20% chance to confuse the target.'),
(397, 'rockpolish', 'Rock Polish', 'Rock', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Speed by 2 stages.', 'Boosts the user''s Speed by 2.'),
(157, 'rockslide', 'Rock Slide', 'Rock', 'Physical', 75, 10, 90, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 30% chance to flinch each.', '30% chance to flinch the foe(s).'),
(249, 'rocksmash', 'Rock Smash', 'Fighting', 'Physical', 40, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 50% chance to lower its Defense by 1 stage. Makes contact.', '50% chance to lower the target''s Defense by 1.'),
(88, 'rockthrow', 'Rock Throw', 'Rock', 'Physical', 50, 15, 90, 0, 'normal', 'Deals damage to one adjacent target.', 'No additional effect.'),
(317, 'rocktomb', 'Rock Tomb', 'Rock', 'Physical', 60, 15, 95, 0, 'normal', 'Deals damage to one adjacent target with a 100% chance to lower its Speed by 1 stage.', '100% chance to lower the target''s Speed by 1.'),
(439, 'rockwrecker', 'Rock Wrecker', 'Rock', 'Physical', 150, 5, 90, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful, the user must recharge on the following turn and cannot make a move.', 'User cannot move next turn.'),
(272, 'roleplay', 'Role Play', 'Psychic', 'Status', 0, 10, 0, 0, 'normal', 'The user''s Ability changes to match one adjacent target''s Ability. Fails if the user''s Ability is Multitype or already matches the target, or if the target''s Ability is Flower Gift, Forecast, Illusion, Imposter, Multitype, Trace, Wonder Guard, or Zen Mode. This move ignores Protect and Detect. Ignores a target''s Substitute.', 'User replaces its Ability with the target''s.'),
(27, 'rollingkick', 'Rolling Kick', 'Fighting', 'Physical', 60, 15, 85, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to flinch it. Makes contact.', '30% chance to flinch the target.'),
(205, 'rollout', 'Rollout', 'Rock', 'Physical', 30, 20, 90, 0, 'normal', 'Deals damage to one adjacent target. The user is locked into this move and cannot make another move until it misses, 5 turns have passed, or the attack cannot be used. Power doubles with each successful hit of this move and doubles again if Defense Curl was used previously by the user. If this move is called by Sleep Talk, the move is used for one turn. Makes contact.', 'Power doubles with each hit. Repeats for 5 turns.'),
(355, 'roost', 'Roost', 'Flying', 'Status', 0, 10, 0, 0, 'self', 'The user restores 1/2 of its maximum HP, rounded half up. Until the end of the turn, Flying-type users lose their Flying-type and pure Flying-type users become Normal-type. Does nothing if the user''s HP is full.', 'Heals 50% HP. Flying-type removed ''til turn ends.'),
(563, 'rototiller', 'Rototiller', 'Ground', 'Status', 0, 10, 0, 0, 'all', 'Raises the Attack and Sp. Atk stats of Grass-type Pokemon.', 'Raises Attack and Sp. Atk of Grass Pokemon.'),
(496, 'round', 'Round', 'Normal', 'Special', 60, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. If there are other active Pokemon that chose this move for use this turn, those Pokemon take their turn immediately after the user, in Speed order, and this move''s power is 120 for each other user. Pokemon with the Ability Soundproof are immune.', 'Power doubles if others used Round this turn.'),
(221, 'sacredfire', 'Sacred Fire', 'Fire', 'Physical', 100, 5, 95, 0, 'normal', 'Deals damage to one adjacent target with a 50% chance to burn it. If the user is frozen, it will defrost before using this move.', '50% chance to burn the target. Thaws user.'),
(533, 'sacredsword', 'Sacred Sword', 'Fighting', 'Physical', 90, 15, 100, 0, 'normal', 'Deals damage to one adjacent target and ignores the target''s stat stage changes, including evasion. Makes contact.', 'Ignores the target''s stat stage changes.'),
(219, 'safeguard', 'Safeguard', 'Normal', 'Status', 0, 25, 0, 0, 'allySide', 'For 5 turns, the user and its party members cannot have major status problems or confusion inflicted on them by other Pokemon. It is removed from the user''s side if the user or an ally is successfully hit by Defog.', 'For 5 turns, protects user''s party from status.'),
(28, 'sandattack', 'Sand Attack', 'Ground', 'Status', 0, 15, 100, 0, 'normal', 'Lowers one adjacent target''s accuracy by 1 stage. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the target''s accuracy by 1.'),
(328, 'sandtomb', 'Sand Tomb', 'Ground', 'Physical', 35, 15, 85, 0, 'normal', 'Deals damage to one adjacent target and prevents it from switching for four or five turns; seven turns if the user is holding Grip Claw. Causes damage to the target equal to 1/8 of its maximum HP (1/6 if the user is holding Binding Band), rounded down, at the end of each turn during effect. The target can still switch out if it is holding Shed Shell or uses Baton Pass, U-turn, or Volt Switch. The effect ends if either the user or the target leaves the field, or if the target uses Rapid Spin. This effect is not stackable or reset by using this or another partial-trapping move.', 'Traps and damages the target for 4-5 turns.'),
(201, 'sandstorm', 'Sandstorm', 'Rock', 'Status', 0, 10, 0, 0, 'all', 'For 5 turns, the weather becomes Sandstorm. At the end of each turn except the last, all active Pokemon lose 1/16 of their maximum HP, rounded down, unless they are a Ground, Rock, or Steel-type, or have the Abilities Magic Guard, Overcoat, Sand Force, Sand Rush, or Sand Veil. The Special Defense of Rock-types is 1.5x during the effect. Lasts for 8 turns if the user is holding Smooth Rock. Fails if the current weather is Sandstorm.', 'For 5 turns, a sandstorm rages.'),
(503, 'scald', 'Scald', 'Water', 'Special', 80, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to burn it. If the user is frozen, it thaws out just before attacking.', '30% chance to burn the target. Thaws user.'),
(184, 'scaryface', 'Scary Face', 'Normal', 'Status', 0, 10, 100, 0, 'normal', 'Lowers one adjacent target''s Speed by 2 stages. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the target''s Speed by 2.'),
(10, 'scratch', 'Scratch', 'Normal', 'Physical', 40, 35, 100, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(103, 'screech', 'Screech', 'Normal', 'Status', 0, 40, 85, 0, 'normal', 'Lowers one adjacent target''s Defense by 2 stages. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Pokemon with the Ability Soundproof are immune.', 'Lowers the target''s Defense by 2.'),
(545, 'searingshot', 'Searing Shot', 'Fire', 'Special', 100, 5, 100, 0, 'allAdjacent', 'Deals damage to all adjacent Pokemon with a 30% chance to burn each.', '30% chance to burn adjacent Pokemon.'),
(290, 'secretpower', 'Secret Power', 'Normal', 'Physical', 70, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to cause a secondary effect on the target based on the battle terrain. Lowers accuracy by 1 stage in Wi-Fi battles. (In-game: Causes sleeping in grass, lowers Speed by 1 stage in puddles, lowers Attack by 1 stage on water, flinching in caves, lowers accuracy by 1 stage on rocky ground and sand, freezing on snow and ice, and causes paralysis everywhere else.) The secondary effect chance is not affected by the Ability Serene Grace.', 'Effect varies with terrain. (30% accuracy lower 1)'),
(548, 'secretsword', 'Secret Sword', 'Fighting', 'Special', 85, 10, 100, 0, 'normal', 'Deals damage to one adjacent target based on its Defense instead of Special Defense.', 'Damages target based on Defense, not Sp. Def.'),
(402, 'seedbomb', 'Seed Bomb', 'Grass', 'Physical', 80, 15, 100, 0, 'normal', 'Deals damage to one adjacent target.', 'No additional effect.'),
(465, 'seedflare', 'Seed Flare', 'Grass', 'Special', 120, 5, 85, 0, 'normal', 'Deals damage to one adjacent target with a 40% chance to lower its Special Defense by 2 stages.', '40% chance to lower the target''s Sp. Def by 2.'),
(69, 'seismictoss', 'Seismic Toss', 'Fighting', 'Physical', 0, 20, 100, 0, 'normal', 'Deals damage to one adjacent target equal to the user''s level. Makes contact.', 'Does damage equal to the user''s level.'),
(120, 'selfdestruct', 'Self-Destruct', 'Normal', 'Physical', 200, 5, 100, 0, 'allAdjacent', 'The user faints and then damage is dealt to all adjacent Pokemon.', 'Hits adjacent Pokemon. The user faints.'),
(247, 'shadowball', 'Shadow Ball', 'Ghost', 'Special', 80, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 20% chance to lower its Special Defense by 1 stage.', '20% chance to lower the target''s Sp. Def by 1.'),
(421, 'shadowclaw', 'Shadow Claw', 'Ghost', 'Physical', 70, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit. Makes contact.', 'High critical hit ratio.'),
(467, 'shadowforce', 'Shadow Force', 'Ghost', 'Physical', 120, 5, 100, 0, 'normal', 'Deals damage to one adjacent target and breaks through Protect and Detect for this turn, allowing other Pokemon to attack the target normally. This attack charges on the first turn and strikes on the second. On the first turn, the user avoids all attacks. The user cannot make a move between turns. If the user is holding a Power Herb, the move completes in one turn. Makes contact.', 'Disappears turn 1. Hits turn 2. Breaks protection.'),
(325, 'shadowpunch', 'Shadow Punch', 'Ghost', 'Physical', 60, 20, 0, 0, 'normal', 'Deals damage to one adjacent target and does not check accuracy. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist.', 'This move does not check accuracy.'),
(425, 'shadowsneak', 'Shadow Sneak', 'Ghost', 'Physical', 40, 30, 100, 1, 'normal', 'Deals damage to one adjacent target. Makes contact. Priority +1.', 'Usually goes first.'),
(159, 'sharpen', 'Sharpen', 'Normal', 'Status', 0, 30, 0, 0, 'self', 'Raises the user''s Attack by 1 stage.', 'Boosts the user''s Attack by 1.'),
(329, 'sheercold', 'Sheer Cold', 'Ice', 'Special', 0, 5, 30, 0, 'normal', 'Deals damage to one adjacent target equal to the target''s max HP. Ignores accuracy and evasion modifiers. This attack''s accuracy is equal to (user''s level - target''s level + 30)%, and fails if the target is at a higher level. Pokemon with the Ability Sturdy are immune.', 'OHKOs the target. Fails if user is a lower level.'),
(504, 'shellsmash', 'Shell Smash', 'Normal', 'Status', 0, 15, 0, 0, 'self', 'Raises the user''s Attack, Special Attack, and Speed by 2 stages. Lowers the user''s Defense and Special Defense by 1 stage.', 'Boosts Atk, SpA, Spe by 2. Lowers Def, SpD by 1.'),
(508, 'shiftgear', 'Shift Gear', 'Steel', 'Status', 0, 10, 0, 0, 'self', 'Raises the user''s Attack by 1 stage and its Speed by 2 stages.', 'Boosts the user''s Speed by 2 and Attack by 1.'),
(351, 'shockwave', 'Shock Wave', 'Electric', 'Special', 60, 20, 0, 0, 'normal', 'Deals damage to one adjacent target and does not check accuracy.', 'This move does not check accuracy.'),
(324, 'signalbeam', 'Signal Beam', 'Bug', 'Special', 75, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to confuse it.', '10% chance to confuse the target.'),
(318, 'silverwind', 'Silver Wind', 'Bug', 'Special', 60, 5, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to raise the user''s Attack, Defense, Speed, Special Attack, and Special Defense by 1 stage.', '10% chance to boost all stats by 1 (not acc/eva).'),
(493, 'simplebeam', 'Simple Beam', 'Normal', 'Status', 0, 15, 100, 0, 'normal', 'Causes one adjacent target''s Ability to become Simple. Fails if the target''s Ability is Multitype, Simple, Stance Change, or Truant. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'The target''s Ability becomes Simple.'),
(47, 'sing', 'Sing', 'Normal', 'Status', 0, 15, 55, 0, 'normal', 'Puts one adjacent target to sleep. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Pokemon with the Ability Soundproof are immune.', 'Puts the target to sleep.'),
(166, 'sketch', 'Sketch', 'Normal', 'Status', 0, 1, 0, 0, 'normal', 'This move is permanently replaced by the last move used by one adjacent target. The copied move has the maximum PP for that move. Fails if the target has not made a move, if the user has Transformed, or if the move is Chatter, Sketch, Struggle, or any move the user knows. This move ignores Protect and Detect. Ignores a target''s Substitute.', 'Permanently copies the last move target used.'),
(285, 'skillswap', 'Skill Swap', 'Psychic', 'Status', 0, 10, 0, 0, 'normal', 'The user trades its Ability with one adjacent target. Fails if either the user or the target''s Ability is Illusion, Multitype, Stance Change, or Wonder Guard, or if both have the same Ability. Ignores a target''s Substitute.', 'The user and the target trade Abilities.'),
(130, 'skullbash', 'Skull Bash', 'Normal', 'Physical', 130, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. This attack charges on the first turn and strikes on the second. The user cannot make a move between turns. Raises the user''s Defense by 1 stage on the first turn. If the user is holding a Power Herb, the move completes in one turn. Makes contact.', 'Boosts user''s Defense by 1 on turn 1. Hits turn 2.'),
(143, 'skyattack', 'Sky Attack', 'Flying', 'Physical', 140, 5, 90, 0, 'any', 'Deals damage to one adjacent or non-adjacent target with a 30% chance to flinch it and a higher chance for a critical hit. This attack charges on the first turn and strikes on the second. The user cannot make a move between turns. If the user is holding a Power Herb, the move completes in one turn.', 'Charges, then hits turn 2. 30% flinch. High crit.'),
(507, 'skydrop', 'Sky Drop', 'Flying', 'Physical', 60, 10, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target. This attack takes the target into the air with the user on the first turn and strikes on the second. On the first turn, the user and the target avoid all attacks other than Gust, Hurricane, Sky Uppercut, Smack Down, Thunder, and Twister. The user and the target cannot make a move between turns. This move has no effect on Flying-types. Fails on the first turn if the target is an ally or if the target has a Substitute. This move cannot be used while Gravity is in effect. Makes contact.', 'User and foe fly up turn 1. Damages on turn 2.'),
(327, 'skyuppercut', 'Sky Uppercut', 'Fighting', 'Physical', 85, 15, 90, 0, 'normal', 'Deals damage to one adjacent target. This move can hit a target using Bounce, Fly, or Sky Drop. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist.', 'Can hit Pokemon using Bounce, Fly, or Sky Drop.'),
(303, 'slackoff', 'Slack Off', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'The user restores 1/2 of its maximum HP, rounded half up.', 'Heals the user by 50% of its max HP.'),
(21, 'slam', 'Slam', 'Normal', 'Physical', 80, 20, 75, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(163, 'slash', 'Slash', 'Normal', 'Physical', 70, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit. Makes contact.', 'High critical hit ratio.'),
(79, 'sleeppowder', 'Sleep Powder', 'Grass', 'Status', 0, 15, 75, 0, 'normal', 'Puts one adjacent target to sleep. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Puts the target to sleep.'),
(214, 'sleeptalk', 'Sleep Talk', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'One of the user''s known moves is selected for use at random. Fails if the user is not asleep. The selected move does not have PP deducted from it, and can currently have 0PP. This move cannot select Assist, Bide, Chatter, Copycat, Focus Punch, Me First, Metronome, Mimic, Mirror Move, Nature Power, Sketch, Sleep Talk, Struggle, Uproar, or any two-turn move.', 'User must be asleep. Uses another known move.'),
(124, 'sludge', 'Sludge', 'Poison', 'Special', 65, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to poison it.', '30% chance to poison the target.'),
(188, 'sludgebomb', 'Sludge Bomb', 'Poison', 'Special', 90, 10, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to poison it.', '30% chance to poison the target.'),
(482, 'sludgewave', 'Sludge Wave', 'Poison', 'Special', 95, 10, 100, 0, 'allAdjacent', 'Deals damage to all adjacent Pokemon with a 10% chance to poison each.', '10% chance to poison adjacent Pokemon.'),
(479, 'smackdown', 'Smack Down', 'Rock', 'Physical', 50, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. This move can hit a target using Bounce, Fly, or Sky Drop. If this move hits a target under the effect of Bounce, Fly, Magnet Rise, or Telekinesis, the effect ends. If the target is a Flying-type that has not used Roost this turn or a Pokemon with the Ability Levitate, it loses its immunity to Ground-type attacks and the Ability Arena Trap as long as it remains active. During the effect, Magnet Rise fails for the target and Telekinesis fails against the target.', 'Removes the target''s Ground immunity.'),
(265, 'smellingsalts', 'Smelling Salts', 'Normal', 'Physical', 70, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. Power doubles if the target is paralyzed, and the target is cured of paralysis. Makes contact.', 'Power doubles if target is paralyzed, and cures it.');
INSERT INTO `attack_dex` (`no`, `id`, `name`, `type`, `category`, `base_power`, `pp`, `accuracy`, `priority`, `target`, `desc`, `short_desc`) VALUES
(123, 'smog', 'Smog', 'Poison', 'Special', 30, 20, 70, 0, 'normal', 'Deals damage to one adjacent target with a 40% chance to poison it.', '40% chance to poison the target.'),
(108, 'smokescreen', 'Smokescreen', 'Normal', 'Status', 0, 20, 100, 0, 'normal', 'Lowers one adjacent target''s accuracy by 1 stage. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the target''s accuracy by 1.'),
(555, 'snarl', 'Snarl', 'Dark', 'Special', 55, 15, 95, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 100% chance to lower their Special Attack by 1 stage each. Pokemon with the Ability Soundproof are immune.', '100% chance to lower the foe(s) Sp. Atk by 1.'),
(289, 'snatch', 'Snatch', 'Dark', 'Status', 0, 10, 0, 4, 'self', 'If another Pokemon uses one of the following moves this turn, the user steals that move to use itself. If multiple Pokemon use this move in the same turn, the applicable moves will be stolen in turn order; a move cannot be stolen multiple times. Aqua Ring, Aromatherapy, Autotomize, Belly Drum, Camouflage, Charge, Conversion, Cosmic Power, Cotton Guard, Heal Bell, Healing Wish, Imprison, Ingrain, Light Screen, Lucky Chant, Lunar Dance, Magnet Rise, Mist, Power Trick, Quick Guard, Recycle, Reflect, Refresh, Safeguard, Stockpile, Substitute, Swallow, Tailwind, Wide Guard, Wish, and any move that has a primary effect of raising the user''s stats or healing the user. Ignores a target''s Substitute. Priority +4.', 'User steals certain support moves to use itself.'),
(173, 'snore', 'Snore', 'Normal', 'Special', 50, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to flinch it. Fails if the user is not asleep. Pokemon with the Ability Soundproof are immune.', 'User must be asleep. 30% chance to flinch target.'),
(596, 'spikyshield', 'Spiky Shield', 'Grass', 'Status', 0, 10, 0, 4, 'self', 'In addition to protecting the user from attacks, this move also damages any attacker who makes direct contact by 1/8 of their maximum HP.', 'Protects user. Damages contactors.'),
(487, 'soak', 'Soak', 'Water', 'Status', 0, 20, 100, 0, 'normal', 'Causes one adjacent target to become a Water-type. Fails if the target is an Arceus. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Changes the target''s type to Water.'),
(135, 'softboiled', 'Soft-Boiled', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'The user restores 1/2 of its maximum HP, rounded half up. (Field: Can be used to heal an ally by draining 1/5 of the user''s maximum HP, rounded down, and restoring that amount to the selected ally. Fails if the user''s HP would be reduced to less than 1.)', 'Heals the user by 50% of its max HP.'),
(76, 'solarbeam', 'Solar Beam', 'Grass', 'Special', 120, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. This attack charges on the first turn and strikes on the second. The user cannot make a move between turns. Power is halved if the weather is Hail, Rain Dance, or Sandstorm. If the user is holding a Power Herb or the weather is Sunny Day, the move completes in one turn.', 'Charges turn 1. Hits turn 2. No charge in sunlight.'),
(49, 'sonicboom', 'Sonic Boom', 'Normal', 'Special', 0, 20, 90, 0, 'normal', 'Deals damage to one adjacent target equal to 20HP.', 'Always does 20 HP of damage.'),
(460, 'spacialrend', 'Spacial Rend', 'Dragon', 'Special', 100, 5, 95, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit.', 'High critical hit ratio.'),
(209, 'spark', 'Spark', 'Electric', 'Physical', 65, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to paralyze it. Makes contact.', '30% chance to paralyze the target.'),
(169, 'spiderweb', 'Spider Web', 'Bug', 'Status', 0, 10, 0, 0, 'normal', 'Prevents one adjacent target from switching out. The target can still switch out if it is holding Shed Shell or uses Baton Pass, U-turn, or Volt Switch. If the target leaves the field using Baton Pass, the replacement will remain trapped. The effect ends if the user leaves the field. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'The target cannot switch out.'),
(131, 'spikecannon', 'Spike Cannon', 'Normal', 'Physical', 20, 15, 100, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times.', 'Hits 2-5 times in one turn.'),
(191, 'spikes', 'Spikes', 'Ground', 'Status', 0, 20, 0, 0, 'foeSide', 'Sets up a hazard on the foe''s side of the field, damaging each foe that switches in, unless it is a Flying-type or has the Ability Levitate. Can be used up to three times before failing. Foes lose 1/8 of their maximum HP with one layer, 1/6 of their maximum HP with two layers, and 1/4 of their maximum HP with three layers, all rounded down. Can be removed from the foe''s side if any foe uses Rapid Spin or is hit by Defog. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Hurts grounded foes on switch-in. Max 3 layers.'),
(255, 'spitup', 'Spit Up', 'Normal', 'Special', 0, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. Power is equal to 100 times the user''s Stockpile count. Fails if the user''s Stockpile count is 0. Whether or not this move is successful, the user''s Defense and Special Defense decrease by as many stages as Stockpile had increased them, and the user''s Stockpile count resets to 0.', 'More power with more uses of Stockpile.'),
(180, 'spite', 'Spite', 'Ghost', 'Status', 0, 10, 100, 0, 'normal', 'Causes one adjacent target''s last used move to decrease by 4PP. Fails if the target has not made a move, if the move has 0PP, or if it no longer knows the move. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute.', 'Lowers the PP of the target''s last move by 4.'),
(150, 'splash', 'Splash', 'Normal', 'Status', 0, 40, 0, 0, 'self', 'Nothing happens... This move cannot be used while Gravity is in effect.', 'Does nothing (but we still love it).'),
(147, 'spore', 'Spore', 'Grass', 'Status', 0, 15, 100, 0, 'normal', 'Puts one adjacent target to sleep. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Puts the target to sleep.'),
(446, 'stealthrock', 'Stealth Rock', 'Rock', 'Status', 0, 20, 0, 0, 'foeSide', 'Sets up a hazard on the foe''s side of the field, damaging each foe that switches in. Can be used only once before failing. Foes lose 1/32, 1/16, 1/8, 1/4, or 1/2 of their maximum HP, rounded down, based on their weakness to the Rock-type; 0.25x, 0.5x, neutral, 2x, or 4x, respectively. Can be removed from the foe''s side if any foe uses Rapid Spin or is hit by Defog. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. (CAP: Pokemon with the Ability Mountaineer are immune.)', 'Hurts foes on switch-in. Factors Rock weakness.'),
(592, 'steameruption', 'Steam Eruption', 'Water', 'Special', 110, 5, 95, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to burn it.', '30% chance to burn the target.'),
(211, 'steelwing', 'Steel Wing', 'Steel', 'Physical', 70, 25, 90, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to raise the user''s Defense by 1 stage. Makes contact.', '10% chance to boost the user''s Defense by 1.'),
(564, 'stickyweb', 'Sticky Web', 'Bug', 'Status', 0, 20, 0, 0, 'foeSide', 'Lowers the Speed stat of the opposing team''s Pokemon upon switching into battle.', 'Lowers Speed of opposing Pokemon switched in.'),
(254, 'stockpile', 'Stockpile', 'Normal', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Defense and Special Defense by 1 stage. The user''s Stockpile count increases by 1. Fails if the user''s Stockpile count is 3.', 'Boosts user''s Defense, Sp. Def by 1. Max 3 uses.'),
(23, 'stomp', 'Stomp', 'Normal', 'Physical', 65, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to flinch it. Damage doubles if Minimize was used previously by the target. Makes contact.', '30% chance to flinch the target.'),
(444, 'stoneedge', 'Stone Edge', 'Rock', 'Physical', 100, 5, 80, 0, 'normal', 'Deals damage to one adjacent target with a higher chance for a critical hit.', 'High critical hit ratio.'),
(500, 'storedpower', 'Stored Power', 'Psychic', 'Special', 20, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. Power is equal to 20 + (X * 20), where X is the user''s total stat stage changes that are greater than 0.', ' + 20 power for each of the user''s stat boosts.'),
(480, 'stormthrow', 'Storm Throw', 'Fighting', 'Physical', 60, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. This move is always a critical hit unless the target is under the effect of Lucky Chant or has the Abilities Battle Armor or Shell Armor. Makes contact.', 'Always results in a critical hit.'),
(537, 'steamroller', 'Steamroller', 'Bug', 'Physical', 65, 20, 100, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to flinch it. Damage doubles if Minimize was used previously by the target. Makes contact.', '30% chance to flinch the target.'),
(70, 'strength', 'Strength', 'Normal', 'Physical', 80, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. Makes contact. (Field: Can be used to move boulders.)', 'No additional effect.'),
(81, 'stringshot', 'String Shot', 'Bug', 'Status', 0, 40, 95, 0, 'allAdjacentFoes', 'Lowers all adjacent foes'' Speed by 2 stages. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the foe(s) Speed by 2.'),
(165, 'struggle', 'Struggle', 'Normal', 'Physical', 50, 1, 0, 0, 'normal', 'Deals typeless damage to one adjacent foe at random. If this move was successful, the user loses 1/4 of its maximum HP, rounded half up; the Ability Rock Head does not prevent this. This move can only be used if none of the user''s known moves can be selected. Makes contact.', 'User loses 25% of its max HP as recoil.'),
(522, 'strugglebug', 'Struggle Bug', 'Bug', 'Special', 50, 20, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 100% chance to lower their Special Attack by 1 stage each.', '100% chance to lower the foe(s) Sp. Atk by 1.'),
(78, 'stunspore', 'Stun Spore', 'Grass', 'Status', 0, 30, 75, 0, 'normal', 'Paralyzes one adjacent target. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Paralyzes the target.'),
(66, 'submission', 'Submission', 'Fighting', 'Physical', 80, 25, 80, 0, 'normal', 'Deals damage to one adjacent target. If the target lost HP, the user takes recoil damage equal to 1/4 that HP, rounded half up, but not less than 1HP. Makes contact.', 'Has 1/4 recoil.'),
(164, 'substitute', 'Substitute', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'The user takes 1/4 of its maximum HP, rounded down, and puts it into a substitute to take its place in battle. The substitute is removed once enough damage is inflicted on it, or if the user switches out or faints. Baton Pass can be used to transfer the substitute to an ally, and the substitute will keep its remaining HP. Until the substitute is broken, it receives damage from all attacks made by other Pokemon and shields the user from status effects and stat stage changes caused by other Pokemon. The user still takes normal damage from weather and status effects while behind its substitute. If the substitute breaks during a multi-hit attack, the user will take damage from any remaining hits. This move fails if the user does not have enough HP remaining to create a substitute, or if it already has a substitute.', 'User takes 1/4 its max HP to put in a Substitute.'),
(389, 'suckerpunch', 'Sucker Punch', 'Dark', 'Physical', 80, 5, 100, 1, 'normal', 'Deals damage to one adjacent target. Fails if the target did not select a damaging move for use this turn, or if the target moves before the user. Makes contact. Priority +1.', 'Usually goes first. Fails if target is not attacking.'),
(241, 'sunnyday', 'Sunny Day', 'Fire', 'Status', 0, 5, 0, 0, 'all', 'For 5 turns, the weather becomes Sunny Day. The power of Fire-type attacks is 1.5x and the power of Water-type attacks is 0.5x during the effect. Lasts for 8 turns if the user is holding Heat Rock. Fails if the current weather is Sunny Day.', 'For 5 turns, intense sunlight powers Fire moves.'),
(162, 'superfang', 'Super Fang', 'Normal', 'Physical', 0, 10, 90, 0, 'normal', 'Deals damage to one adjacent target equal to half of its current HP, rounded down, but not less than 1HP. Makes contact.', 'Does damage equal to 1/2 target''s current HP.'),
(276, 'superpower', 'Superpower', 'Fighting', 'Physical', 120, 5, 100, 0, 'normal', 'Deals damage to one adjacent target and lowers the user''s Attack and Defense by 1 stage. Makes contact.', 'Lowers the user''s Attack and Defense by 1.'),
(48, 'supersonic', 'Supersonic', 'Normal', 'Status', 0, 20, 55, 0, 'normal', 'Causes one adjacent target to become confused. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Pokemon with the Ability Soundproof are immune.', 'Confuses the target.'),
(57, 'surf', 'Surf', 'Water', 'Special', 90, 15, 100, 0, 'allAdjacent', 'Deals damage to all adjacent Pokemon. Power doubles against Pokemon using Dive. (Field: Can be used to surf on water.)', 'Hits adjacent Pokemon. Power doubles on Dive.'),
(207, 'swagger', 'Swagger', 'Normal', 'Status', 0, 15, 90, 0, 'normal', 'Raises one adjacent target''s Attack by 2 stages and confuses it. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Boosts the target''s Attack by 2 and confuses it.'),
(256, 'swallow', 'Swallow', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'The user restores its HP based on its Stockpile count. Restores 1/4 of its maximum HP if it''s 1, 1/2 of its maximum HP if it''s 2, both rounded half down, and all of its HP if it''s 3. Fails if the user''s Stockpile count is 0. The user''s Defense and Special Defense decrease by as many stages as Stockpile had increased them, and the user''s Stockpile count resets to 0.', 'Heals the user based on uses of Stockpile.'),
(186, 'sweetkiss', 'Sweet Kiss', 'Fairy', 'Status', 0, 10, 75, 0, 'normal', 'Causes one adjacent target to become confused. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Confuses the target.'),
(230, 'sweetscent', 'Sweet Scent', 'Normal', 'Status', 0, 20, 100, 0, 'allAdjacentFoes', 'Lowers all adjacent foes'' evasion by 2 stages. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the foe(s) evasion by 2.'),
(129, 'swift', 'Swift', 'Normal', 'Special', 60, 20, 0, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes and does not check accuracy.', 'This move does not check accuracy. Hits foes.'),
(415, 'switcheroo', 'Switcheroo', 'Dark', 'Status', 0, 10, 100, 0, 'normal', 'The user trades its held item with one adjacent target. Fails if either the user or the target is holding a Mail, if neither is holding an item, or if the user is trying to give or take a Griseous Orb, a Plate, a Drive, or a Mega Stone to or from a Giratina, an Arceus, a Genesect, or a pokémon able to Mega-evolve respectively. Pokemon with the Ability Sticky Hold are immune.', 'User switches its held item with the target''s.'),
(14, 'swordsdance', 'Swords Dance', 'Normal', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Attack by 2 stages.', 'Boosts the user''s Attack by 2.'),
(485, 'synchronoise', 'Synchronoise', 'Psychic', 'Special', 120, 15, 100, 0, 'allAdjacent', 'Deals damage to all adjacent Pokemon. This move has no effect on targets that do not share a type with the user.', 'Hits adjacent Pokemon sharing the user''s type.'),
(235, 'synthesis', 'Synthesis', 'Grass', 'Status', 0, 5, 0, 0, 'self', 'The user restores 1/2 of its maximum HP if no weather conditions are in effect, 2/3 of its maximum HP if the weather is Sunny Day, and 1/4 of its maximum HP if the weather is Hail, Rain Dance, or Sandstorm, all rounded half down.', 'Heals the user by a weather-dependent amount.'),
(33, 'tackle', 'Tackle', 'Normal', 'Physical', 50, 35, 100, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(294, 'tailglow', 'Tail Glow', 'Bug', 'Status', 0, 20, 0, 0, 'self', 'Raises the user''s Special Attack by 3 stages.', 'Boosts the user''s Sp. Atk by 3.'),
(541, 'tailslap', 'Tail Slap', 'Normal', 'Physical', 25, 10, 85, 0, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times. Makes contact.', 'Hits 2-5 times in one turn.'),
(39, 'tailwhip', 'Tail Whip', 'Normal', 'Status', 0, 30, 100, 0, 'allAdjacentFoes', 'Lowers all adjacent foes'' Defense by 1 stage. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the foe(s) Defense by 1.'),
(366, 'tailwind', 'Tailwind', 'Flying', 'Status', 0, 15, 0, 0, 'allySide', 'For 4 turns, the user and its party members have their Speed doubled. Fails if this move is already in effect for the user''s side.', 'For 4 turns, allies'' Speed is doubled.'),
(36, 'takedown', 'Take Down', 'Normal', 'Physical', 90, 20, 85, 0, 'normal', 'Deals damage to one adjacent target. If the target lost HP, the user takes recoil damage equal to 1/4 that HP, rounded half up, but not less than 1HP. Makes contact.', 'Has 1/4 recoil.'),
(269, 'taunt', 'Taunt', 'Dark', 'Status', 0, 20, 100, 0, 'normal', 'Prevents one adjacent target from using non-damaging moves for its next three turns. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute.', 'For 3 turns, the target can''t use status moves.'),
(546, 'technoblast', 'Techno Blast', 'Normal', 'Special', 120, 5, 100, 0, 'normal', 'Deals damage to one adjacent target. This move''s type depends on the user''s held Drive.', 'Type varies based on the held Drive.'),
(298, 'teeterdance', 'Teeter Dance', 'Normal', 'Status', 0, 20, 100, 0, 'allAdjacent', 'Causes all adjacent Pokemon to become confused.', 'Confuses adjacent Pokemon.'),
(477, 'telekinesis', 'Telekinesis', 'Psychic', 'Status', 0, 15, 0, 0, 'normal', 'For 3 turns, one adjacent target cannot avoid any attacks made against it, other than OHKO moves, as long as it remains active. During the effect, the target is immune to Ground-type attacks and the effects of Spikes, Toxic Spikes, and the Ability Arena Trap as long as it remains active. If the target uses Baton Pass, the replacement will gain the effect. Ingrain, Smack Down, and Iron Ball override this move if the target is under any of their effects. Fails if the target is already under this effect or the effects of Ingrain or Smack Down. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. This move cannot be used while Gravity is in effect.', 'For 3 turns, target floats but moves can''t miss it.'),
(100, 'teleport', 'Teleport', 'Psychic', 'Status', 0, 20, 0, 0, 'self', 'Fails when used. (Wild battles: The user flees the battle, unless it is a double battle. Field: Can be used to teleport to the last Pokemon Center visited.)', 'Flee from wild Pokemon battles.'),
(168, 'thief', 'Thief', 'Dark', 'Physical', 60, 25, 100, 0, 'normal', 'Deals damage to one adjacent target. If the attack was successful and the user has not fainted, it steals the target''s held item if the user is not holding one. Makes contact.', 'If the user has no item, it steals the target''s.'),
(614, 'thousandarrows', 'Thousand Arrows', 'Ground', 'Physical', 90, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. This move can hit a target using Bounce, Fly, or Sky Drop. If this move hits a target under the effect of Bounce, Fly, Magnet Rise, or Telekinesis, the effect ends. If the target is a Flying-type that has not used Roost this turn or a Pokemon with the Ability Levitate, it loses its immunity to Ground-type attacks and the Ability Arena Trap as long as it remains active. During the effect, Magnet Rise fails for the target and Telekinesis fails against the target.', 'Removes the target''s Ground immunity.'),
(615, 'thousandwaves', 'Thousand Waves', 'Ground', 'Physical', 90, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. Prevents the target from switching out.', 'Prevents the target from switching out.'),
(37, 'thrash', 'Thrash', 'Normal', 'Physical', 120, 10, 100, 0, 'randomNormal', 'Deals damage to one adjacent foe at random. The user spends two or three turns locked into this move and becomes confused after the last turn of the effect if it is not already. If the user is prevented from moving or the attack is not successful against the target on the first turn of the effect or the second turn of a three-turn effect, the effect ends without causing confusion. If this move is called by Sleep Talk, the move is used for one turn and does not confuse the user. Makes contact.', 'Lasts 2-3 turns. Confuses the user afterwards.'),
(87, 'thunder', 'Thunder', 'Electric', 'Special', 110, 10, 70, 0, 'normal', 'Deals damage to one adjacent target with a 30% chance to paralyze it. This move can hit a target using Bounce, Fly, or Sky Drop. If the weather is Rain Dance, this move cannot miss. If the weather is Sunny Day, this move''s accuracy is 50%.', '30% chance to paralyze target. Can''t miss in rain.'),
(422, 'thunderfang', 'Thunder Fang', 'Electric', 'Physical', 65, 15, 95, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to paralyze it and a 10% chance to flinch it. Makes contact.', '10% chance to paralyze. 10% chance to flinch.'),
(9, 'thunderpunch', 'Thunder Punch', 'Electric', 'Physical', 75, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to paralyze it. Makes contact. Damage is boosted to 1.2x by the Ability Iron Fist.', '10% chance to paralyze the target.'),
(84, 'thundershock', 'Thunder Shock', 'Electric', 'Special', 40, 30, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to paralyze it.', '10% chance to paralyze the target.'),
(86, 'thunderwave', 'Thunder Wave', 'Electric', 'Status', 0, 20, 100, 0, 'normal', 'Paralyzes one adjacent target. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Paralyzes the target.'),
(85, 'thunderbolt', 'Thunderbolt', 'Electric', 'Special', 90, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to paralyze it.', '10% chance to paralyze the target.'),
(321, 'tickle', 'Tickle', 'Normal', 'Status', 0, 20, 100, 0, 'normal', 'Lowers one adjacent target''s Attack and Defense by 1 stage. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Lowers the target''s Attack and Defense by 1.'),
(576, 'topsyturvy', 'Topsy-Turvy', 'Dark', 'Status', 0, 20, 0, 0, 'normal', 'Inverts target''s stat stages.', 'Inverts target''s stat stages.'),
(259, 'torment', 'Torment', 'Dark', 'Status', 0, 15, 100, 0, 'normal', 'Prevents one adjacent target from using the same move two turns in a row, starting next turn. This effect lasts until the target leaves the field. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute.', 'Target can''t select the same move twice in a row.'),
(92, 'toxic', 'Toxic', 'Poison', 'Status', 0, 10, 90, 0, 'normal', 'Badly poisons one adjacent target. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Badly poisons the target.'),
(390, 'toxicspikes', 'Toxic Spikes', 'Poison', 'Status', 0, 20, 0, 0, 'foeSide', 'Sets up a hazard on the foe''s side of the field, poisoning each foe that switches in, unless it is a Flying-type or has the Ability Levitate. Can be used up to two times before failing. Foes become poisoned with one layer and badly poisoned with two layers. Can be removed from the foe''s side if any foe uses Rapid Spin, is hit by Defog, or a grounded Poison-type switches in. Safeguard prevents the foe''s party from being poisoned on switch-in, but Substitute does not. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Poisons grounded foes on switch-in. Max 2 layers.'),
(144, 'transform', 'Transform', 'Normal', 'Status', 0, 10, 0, 0, 'normal', 'The user transforms into one adjacent target. The target''s current stats, stat stages, types, moves, Ability, weight, gender, and sprite are copied. The user''s level and HP remain the same and each copied move receives only 5PP, with a maximum of 5PP each. The user can no longer change formes if it would have the ability to do so. This move fails if the target has a Substitute, if either the user or the target has transformed previously, or if either is behind an Illusion. This move ignores Protect and Detect.', 'Copies target''s stats, moves, types, and Ability.'),
(161, 'triattack', 'Tri Attack', 'Normal', 'Special', 80, 10, 100, 0, 'normal', 'Deals damage to one adjacent target with a 20% chance to either burn, freeze, or paralyze it.', '20% chance to paralyze or burn or freeze target.'),
(271, 'trick', 'Trick', 'Psychic', 'Status', 0, 10, 100, 0, 'normal', 'The user trades its held item with one adjacent target. Fails if either the user or the target is holding a Mail, if neither is holding an item, or if the user is trying to give or take a Griseous Orb, a Plate, a Drive, or a Mega Stone to or from a Giratina, an Arceus, a Genesect, or a pokémon able to Mega-evolve respectively. Pokemon with the Ability Sticky Hold are immune.', 'User switches its held item with the target''s.'),
(567, 'trickortreat', 'Trick-or-Treat', 'Ghost', 'Status', 0, 20, 100, 0, 'normal', 'Adds Ghost to the target''s type(s). If the target was affected by Forest''s Curse, its Grass type is replaced.', 'Adds Ghost to the target''s type(s).'),
(433, 'trickroom', 'Trick Room', 'Psychic', 'Status', 0, 5, 0, -7, 'all', 'For 5 turns, all active Pokemon with lower Speed will move before those with higher Speed, within their priority brackets. If this move is used during the effect, the effect ends. Priority -7.', 'For 5 turns, slower Pokemon move first.'),
(167, 'triplekick', 'Triple Kick', 'Fighting', 'Physical', 10, 10, 90, 0, 'normal', 'Deals damage to one adjacent target and hits three times. The base power increases to 20 for the second hit and 30 for the third. If any of the hits misses the target, the attack ends. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. Makes contact.', 'Hits 3 times. Each hit can miss, but power rises.'),
(376, 'trumpcard', 'Trump Card', 'Normal', 'Special', 0, 5, 0, 0, 'normal', 'Deals damage to one adjacent target and does not check accuracy. The power of this move is based on the amount of PP remaining after normal PP reduction and the Ability Pressure resolve. 200 power for 0PP, 80 power for 1PP, 60 power for 2PP, 50 power for 3PP, and 40 power for 4 or more PP. Makes contact.', 'More power the fewer PP this move has left.'),
(41, 'twineedle', 'Twineedle', 'Bug', 'Physical', 25, 20, 100, 0, 'normal', 'Deals damage to one adjacent target and hits twice, with each hit having a 20% chance to poison it. If the first hit breaks the target''s Substitute, it will take damage for the second hit.', 'Hits 2 times. Each hit has 20% chance to poison.'),
(239, 'twister', 'Twister', 'Dragon', 'Special', 40, 20, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes with a 20% chance to flinch each. Power doubles against Pokemon using Bounce, Fly, or Sky Drop.', '20% chance to flinch the foe(s).'),
(369, 'uturn', 'U-turn', 'Bug', 'Physical', 70, 20, 100, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful and the user has not fainted, the user switches out even if it is trapped and is replaced immediately by another party member. The user does not switch out if there are no unfainted party members, or if the target switched out using an Eject Button. Makes contact.', 'User switches out after damaging the target.'),
(253, 'uproar', 'Uproar', 'Normal', 'Special', 90, 10, 100, 0, 'randomNormal', 'Deals damage to one adjacent foe at random. The user spends three turns locked into this move. On the first of the three turns, all sleeping active Pokemon wake up. During the three turns, no active Pokemon can fall asleep by any means; Pokemon switched in during the effect do not wake up. If the user is prevented from moving or the attack is not successful against the target during one of the turns, the effect ends. Pokemon with the Ability Soundproof are immune.', 'Lasts 3 turns. Active Pokemon cannot fall asleep.'),
(557, 'vcreate', 'V-create', 'Fire', 'Physical', 180, 5, 95, 0, 'normal', 'Deals damage to one adjacent target and lowers the user''s Defense, Special Defense, and Speed by 1 stage. Makes contact.', 'Lowers the user''s Defense, Sp. Def, Speed by 1.'),
(410, 'vacuumwave', 'Vacuum Wave', 'Fighting', 'Special', 40, 30, 100, 1, 'normal', 'Deals damage to one adjacent target. Priority +1.', 'Usually goes first.'),
(599, 'venomdrench', 'Venom Drench', 'Poison', 'Status', 0, 20, 100, 0, 'normal', 'Lowers the Attack, Special Attack, and Speed stats of a poisoned target.', 'Lowers Attack, Sp. Atk, Speed of poisoned target.'),
(474, 'venoshock', 'Venoshock', 'Poison', 'Special', 65, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. Power doubles if the target is poisoned.', 'Power doubles if the target is poisoned.'),
(11, 'vicegrip', 'Vice Grip', 'Normal', 'Physical', 55, 30, 100, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(22, 'vinewhip', 'Vine Whip', 'Grass', 'Physical', 45, 25, 100, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(233, 'vitalthrow', 'Vital Throw', 'Fighting', 'Physical', 70, 10, 0, -1, 'normal', 'Deals damage to one adjacent target and does not check accuracy. Makes contact. Priority -1.', 'This move does not check accuracy. Goes last.'),
(521, 'voltswitch', 'Volt Switch', 'Electric', 'Special', 70, 20, 100, 0, 'normal', 'Deals damage to one adjacent target. If this move is successful and the user has not fainted, the user switches out even if it is trapped and is replaced immediately by another party member. The user does not switch out if there are no unfainted party members, or if the target switched out using an Eject Button.', 'User switches out after damaging the target.'),
(344, 'volttackle', 'Volt Tackle', 'Electric', 'Physical', 120, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 10% chance to paralyze it. If the target lost HP, the user takes recoil damage equal to 33% that HP, rounded half up, but not less than 1HP. Makes contact.', 'Has 33% recoil. 10% chance to paralyze target.'),
(358, 'wakeupslap', 'Wake-Up Slap', 'Fighting', 'Physical', 70, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. Power doubles if the target is asleep, and the target wakes up. Makes contact.', 'Power doubles if target is asleep, and wakes it.'),
(55, 'watergun', 'Water Gun', 'Water', 'Special', 40, 25, 100, 0, 'normal', 'Deals damage to one adjacent target.', 'No additional effect.'),
(518, 'waterpledge', 'Water Pledge', 'Water', 'Special', 80, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. If one of the user''s allies chose to use Fire Pledge or Grass Pledge this turn and has not moved yet, they take their turn immediately after the user and the user''s move does nothing. Power goes up to 150 if this move is used by an ally that way, and a rainbow appears on the user''s side if the other move was Fire Pledge, or a swamp appears on the target''s side if the other move was Grass Pledge.', 'Use with Grass or Fire Pledge for added effect.'),
(352, 'waterpulse', 'Water Pulse', 'Water', 'Special', 60, 20, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target with a 10% chance to confuse it.', '20% chance to confuse the target.'),
(346, 'watersport', 'Water Sport', 'Water', 'Status', 0, 15, 0, 0, 'all', 'For 5 turns, all Fire-type attacks used by any active Pokemon have their power reduced to 0.33x. Fails if this move is already in effect; not stackable.', 'For 5 turns, Fire-type attacks have 1/3 power.'),
(323, 'waterspout', 'Water Spout', 'Water', 'Special', 150, 5, 100, 0, 'allAdjacentFoes', 'Deals damage to all adjacent foes. Power is equal to (user''s current HP * 150 / user''s maximum HP), rounded down, but not less than 1.', 'Less power as user''s HP decreases. Hits foe(s).'),
(127, 'waterfall', 'Waterfall', 'Water', 'Physical', 80, 15, 100, 0, 'normal', 'Deals damage to one adjacent target with a 20% chance to flinch it. Makes contact. (Field: Can be used to climb a waterfall.)', '20% chance to flinch the target.'),
(594, 'watershuriken', 'Water Shuriken', 'Water', 'Physical', 15, 20, 100, 1, 'normal', 'Deals damage to one adjacent target and hits two to five times. Has a 1/3 chance to hit two or three times, and a 1/6 chance to hit four or five times. If one of the hits breaks the target''s Substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit five times. Almost always goes first.', 'Hits 2-5 times in one turn. Priority +1.'),
(311, 'weatherball', 'Weather Ball', 'Normal', 'Special', 50, 10, 100, 0, 'normal', 'Deals damage to one adjacent target. Power doubles during weather effects and this move''s type changes to match; Ice-type during Hail, Water-type during Rain Dance, Rock-type during Sandstorm, and Fire-type during Sunny Day.', 'Power doubles and type varies in each weather.'),
(250, 'whirlpool', 'Whirlpool', 'Water', 'Special', 35, 15, 85, 0, 'normal', 'Deals damage to one adjacent target and prevents it from switching for four or five turns; seven turns if the user is holding Grip Claw. Power doubles if the target is using Dive. Causes damage to the target equal to 1/8 of its maximum HP (1/6 if the user is holding Binding Band), rounded down, at the end of each turn during effect. The target can still switch out if it is holding Shed Shell or uses Baton Pass, U-turn, or Volt Switch. The effect ends if either the user or the target leaves the field, or if the target uses Rapid Spin. This effect is not stackable or reset by using this or another partial-trapping move.', 'Traps and damages the target for 4-5 turns.'),
(18, 'whirlwind', 'Whirlwind', 'Normal', 'Status', 0, 20, 0, -6, 'normal', 'Causes one adjacent target to be forced to switch out and be replaced with a random unfainted ally. Fails if the target used Ingrain previously or has the Ability Suction Cups. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves. Ignores a target''s Substitute. Priority -6. (Wild battles: The battle ends as long as it is not a double battle and the user''s level is not less than the opponent''s level.)', 'Forces the target to switch to a random ally.'),
(469, 'wideguard', 'Wide Guard', 'Rock', 'Status', 0, 10, 0, 3, 'allySide', 'The user and its party members are protected from damaging attacks made by other Pokemon, including allies, during this turn that target all adjacent foes or all adjacent Pokemon. Fails if this move is already in effect for the user''s side. Priority +3.', 'Protects allies from multi-target hits this turn.'),
(528, 'wildcharge', 'Wild Charge', 'Electric', 'Physical', 90, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. If the target lost HP, the user takes recoil damage equal to 1/4 that HP, rounded half up, but not less than 1HP. Makes contact.', 'Has 1/4 recoil.'),
(261, 'willowisp', 'Will-O-Wisp', 'Fire', 'Status', 0, 15, 85, 0, 'normal', 'Burns one adjacent target. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Burns the target.'),
(17, 'wingattack', 'Wing Attack', 'Flying', 'Physical', 60, 35, 100, 0, 'any', 'Deals damage to one adjacent or non-adjacent target. Makes contact.', 'No additional effect.'),
(273, 'wish', 'Wish', 'Normal', 'Status', 0, 10, 0, 0, 'self', 'At the end of the next turn, the Pokemon at the user''s position has 1/2 of the user''s maximum HP restored to it, rounded half up. Fails if this move is already in effect for the user''s position.', 'Next turn, 50% of the user''s max HP is restored.'),
(110, 'withdraw', 'Withdraw', 'Water', 'Status', 0, 40, 0, 0, 'self', 'Raises the user''s Defense by 1 stage.', 'Boosts the user''s Defense by 1.'),
(472, 'wonderroom', 'Wonder Room', 'Psychic', 'Status', 0, 10, 0, 0, 'all', 'For 5 turns, all active Pokemon have their Defense and Special Defense stats swapped. Stat stage changes are unaffected. If this move is used during the effect, the effect ends.', 'For 5 turns, all Defense and Sp. Def stats switch.'),
(452, 'woodhammer', 'Wood Hammer', 'Grass', 'Physical', 120, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. If the target lost HP, the user takes recoil damage equal to 33% that HP, rounded half up, but not less than 1HP. Makes contact.', 'Has 33% recoil.'),
(526, 'workup', 'Work Up', 'Normal', 'Status', 0, 30, 0, 0, 'self', 'Raises the user''s Attack and Special Attack by 1 stage.', 'Boosts the user''s Attack and Sp. Atk by 1.'),
(388, 'worryseed', 'Worry Seed', 'Grass', 'Status', 0, 10, 100, 0, 'normal', 'Causes one adjacent target''s Ability to become Insomnia. Fails if the target''s Ability is Insomnia, Multitype, Stance Change or Truant. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'The target''s Ability becomes Insomnia.'),
(35, 'wrap', 'Wrap', 'Normal', 'Physical', 15, 20, 90, 0, 'normal', 'Deals damage to one adjacent target and prevents it from switching for four or five turns; seven turns if the user is holding Grip Claw. Causes damage to the target equal to 1/8 of its maximum HP (1/6 if the user is holding Binding Band), rounded down, at the end of each turn during effect. The target can still switch out if it is holding Shed Shell or uses Baton Pass, U-turn, or Volt Switch. The effect ends if either the user or the target leaves the field, or if the target uses Rapid Spin. This effect is not stackable or reset by using this or another partial-trapping move. Makes contact.', 'Traps and damages the target for 4-5 turns.'),
(378, 'wringout', 'Wring Out', 'Normal', 'Special', 0, 5, 100, 0, 'normal', 'Deals damage to one adjacent target. Power is equal to 120 * (target''s current HP / target''s maximum HP), rounded half down, but not less than 1. Makes contact.', 'More power the more HP the target has left.'),
(404, 'xscissor', 'X-Scissor', 'Bug', 'Physical', 80, 15, 100, 0, 'normal', 'Deals damage to one adjacent target. Makes contact.', 'No additional effect.'),
(281, 'yawn', 'Yawn', 'Normal', 'Status', 0, 10, 0, 0, 'normal', 'Causes one adjacent target to fall asleep at the end of the next turn. If the target is still on the field and does not have a major status problem at that time, it falls asleep, and this effect cannot be prevented by Safeguard or Substitute. Fails if the target cannot fall asleep or if it already has a major status problem. Pokemon protected by Magic Coat or the Ability Magic Bounce are unaffected and instead use this move themselves.', 'Puts the target to sleep after 1 turn.'),
(192, 'zapcannon', 'Zap Cannon', 'Electric', 'Special', 120, 5, 50, 0, 'normal', 'Deals damage to one adjacent target with a 100% chance to paralyze it.', '100% chance to paralyze the target.'),
(428, 'zenheadbutt', 'Zen Headbutt', 'Psychic', 'Physical', 80, 15, 90, 0, 'normal', 'Deals damage to one adjacent target with a 20% chance to flinch it. Makes contact.', '20% chance to flinch the target.');
INSERT INTO `items_dex` (`no`, `id`, `name`, `desc`) VALUES
(674, 'abomasite', 'Abomasite', 'Mega-evolves Abomasnow.'),
(677, 'absolite', 'Absolite', 'Mega-evolves Absol.'),
(545, 'absorbbulb', 'Absorb Bulb', 'Raises Sp. Atk by 1 if hit by a Water-type attack. Single use.'),
(135, 'adamantorb', 'Adamant Orb', 'If holder is a Dialga, its Steel- and Dragon-type attacks have 1.2x power.'),
(672, 'aerodactylite', 'Aerodactylite', 'Mega-evolves Aerodactyl.'),
(667, 'aggronite', 'Aggronite', 'Mega-evolves Aggron.'),
(162, 'aguavberry', 'Aguav Berry', 'Restores 1/8 max HP when at 1/2 max HP or less. May confuse. Single use.'),
(541, 'airballoon', 'Air Balloon', 'Holder is immune to Ground-type attacks. Pops when holder is hit.'),
(-6, 'alakazite', 'Alakazite', 'Mega-evolves Alakazam.'),
(-6, 'ampharosite', 'Ampharosite', 'Mega-evolves Ampharos.'),
