INSERT INTO `strategy_dex` (`id`, `name`, `species_id`, `ability_id`, `nature`, `item_id`, `happiness`, `move_1_id`, `move_2_id`, `move_3_id`, `move_4_id`, `iv_hp`, `iv_atk`, `iv_def`, `iv_sp_atk`, `iv_sp_def`, `iv_spd`, `ev_hp`, `ev_atk`, `ev_def`, `ev_sp_atk`, `ev_sp_def`, `ev_spd`, `description`) VALUES
(7, 'Test', 'bulbasaur', 'overgrow', 'Timid', 'absolite', 255, 'frustration', 'grasswhistle', 'grasswhistle', 'grassyterrain', 31, 31, 31, 31, 31, 31, 4, 0, 0, 252, 0, 252, 'adadsadasdsa<br>'),
(8, 'test2', 'bulbasaur', 'overgrow', 'Modest', 'absolite', 255, 'amnesia', 'attract', 'attract', 'attract', 31, 31, 31, 31, 31, 31, 67, 81, 151, 148, 79, 117, 'test<br>'),
(9, 'test2', 'bulbasaur', 'overgrow', 'Jolly', 'absolite', 100, 'gigadrain', 'grasspledge', 'grasswhistle', 'attract', 31, 31, 31, 31, 31, 31, 161, 128, 207, 151, 162, 146, ''),
(10, 'Defensive', 'venusaurmega', 'thickfat', 'Bold', 'venusaurite', 255, 'sludgebomb', 'synthesis', 'sleeppowder', 'gigadrain', 31, 31, 31, 31, 31, 31, 252, 0, 240, 0, 0, 16, 'Moves<br>\n========<br>\n<br>\nGiga Drain is Venusaur''s main STAB move and helps in keeping it healthy,\n as well as allowing it to outlast powerful attackers such as Landorus-T\n one-on-one. Sludge Bomb is a good secondary STAB move that is mainly \nused to hit Flying- and Dragon-types, and it also hits most Fairy-types \nsuper effectively. Sadly, Synthesis is Venusaur''s only reliable recovery\n move other than Rest&amp;mdash;its low PP and ineffectiveness in most \nweather conditions may present an issue, but it is necessary for healing\n alongside Giga Drain.<br>\n<br>\nSeveral moves are viable options in the last slot. Sleep Powder can \nincapacitate a counter, though unfortunately it will not work against \nFerrothorn, Mandibuzz, or Escavalier. Leech Seed offers yet another \nmethod of recovery in addition to a decent phazing tool, and it also \ngives Venusaur the ability to defeat Chansey and Blissey. Hidden Power \nFire hits Steel-types such as Scizor, Ferrothorn, and Mawile super \neffectively. Unlike Sludge Bomb, it''s also capable of damaging \nChesnaught. Knock Off is particularly useful against Latios and Gengar, \nbut it cripples almost anything else due to its added effect of removing\n items. Earthquake smashes the Steel-types that don''t mind Hidden Power \nFire, namely Heatran. Lastly, Roar is a much more reliable phazing tool \nthan Leech Seed against setup sweepers and Substitute users.<br>\n<br>\nSet Details<br>\n========<br>\n<br>\n16 Speed EVs are used in order to outrun Adamant Azumarill and Mawile, \nthough 20 Speed EVs should be used with Hidden Power Fire to compensate \nfor the imperfect Speed IV it forces Venusaur to use. However, these EVs\n should be moved into Venusaur''s defenses and a Relaxed nature should be\n used if Knock Off or Earthquake is chosen in the final slot. The rest \nof the EVs focus on making Venusaur as physically bulky as possible, but\n a specially defensive spread is also a viable option in order to let it\n deal with Pokemon such as Manaphy and Raikou more effectively. \nChlorophyll is more useful than Overgrow prior to Mega Evolving, as it \noccasionally allows Venusaur to pick up a temporary Speed boost against \nteams that use Mega Charizard Y.<br>\n<br>\nUsage Tips<br>\n========<br>\n<br>\nIt is imperative to get Venusaur in and let it Mega Evolve early, as it \nappreciates the added bulk and Thick Fat when switching in later. Also, \ntry to make sure Venusaur''s HP is high whenever it switches back out, \nsince it needs to be healthy in order to switch in and check powerful \nthreats such as Choice Specs Keldeo. Synthesis can be used to scout the \nmovesets of faster Pokemon, but be wary of those with access to setup \nmoves. Finally, keep in mind that although Venusaur will end up being \nwalled by something depending on what it runs in the last slot, your \nopponent won''t initially know what can actually wall Venusaur. For \nexample, if you''re using Earthquake, try not to reveal it until you''re \nsure you can hit your opponent''s Heatran.<br>\n<br>\nTeam Options<br>\n========<br>\n<br>\nVenusaur makes itself at home on teams utilizing any of several \ndifferent playstyles, such as balance, stall, and bulky offense. \nTherefore, it can be used with essentially any Pokemon that synergizes \nwell with it defensively. Heatran forms an outstanding defensive core \nwith Venusaur, as it is capable of taking Flying- and Psychic-type \nattacks with ease. Rotom-W works similarly, serving as a hard check to \nalmost any user of Flying-type attacks. Aegislash is also a great \nswitch-in to many Flying- and Psychic-types, such as Latios. Excadrill \nand Slowbro are good partners for Venusaur by virtue of their typing and\n abilities, as well as the former''s immediate offensive presence. \nSkarmory and Bisharp pair decently with Venusaur as well, as Venusaur \ncan cover their major weaknesses. Finally, Clefable and Quagsire are \nparticularly effective alongside Venusaur on stall teams for their \nability to deal with the setup sweepers that Venusaur struggles against.<br>'),
(11, 'Offensive', 'venusaurmega', 'thickfat', 'Modest', 'venusaurite', 255, 'sludgebomb', 'synthesis', 'gigadrain', 'hiddenpower', 31, 31, 31, 31, 31, 31, 232, 0, 0, 252, 4, 20, 'Moves<br>\n========<br>\n<br>\nWith maximum Special Attack investment, Giga Drain deals a solid amount \nof damage while simultaneously restoring a good chunk of Venusaur''s \nhealth. Sludge Bomb hits the Flying- and Dragon-types that often try to \nswitch in on Giga Drain for a surprisingly large amount of damage, \neasily 2HKOing Mega Pinsir and even 2HKOing Latios and Kyurem-B after \nStealth Rock. Hidden Power Fire provides coverage against Steel-types \nand Chesnaught and will 2HKO most of them, including Ferrothorn and \nBisharp. Synthesis provides valuable healing and is generally reliable \non an offensive set, as Venusaur is capable of threatening every \nauto-inducer of rain, sand, or hail with the appropriate move. However, \nSleep Powder is equally useful for its ability to disable a counter.<br>\n<br>\nThree other moves are usable on this set. Earthquake is an option solely\n for Heatran, which is cleanly 2HKOed even if Venusaur uses a Modest \nnature. Knock Off is a decent option in the last slot against Gengar, \nLatias, and Chansey, and it allows Venusaur to pose a massive annoyance \nto stall teams. Leaf Storm is usable over Giga Drain for its \nsignificantly greater power, but it should only be used alongside \nSynthesis.<br>\n<br>\nSet Details<br>\n========<br>\n<br>\nMaximum Special Attack investment coupled with a Modest nature allows \nVenusaur''s attacks to hit as hard as possible, while 20 Speed EVs allow \nVenusaur to outpace Adamant Azumarill and Mawile, factoring in the \nrequired IVs for Hidden Power Fire. The remaining EVs are placed in HP \nto increase Venusaur''s overall bulk, though 4 EVs are moved into Special\n Defense in order to minimize residual damage. An alternative EV spread \nof 160 HP / 252 SpA / 96 Spe is also an option if Venusaur needs to \noutspeed Jolly Azumarill and Mawile.<br>\n<br>\nIf Knock Off is chosen in the final slot, a Quiet nature should be used \nand the Speed and Special Defense EVs should be moved into Attack. This \ngrants Venusaur a 50% chance to OHKO 28 HP Gengar after Stealth Rock. \nChlorophyll is the superior ability prior to Mega Evolving, as it can \noccasionally give Venusaur the ability to outspeed and KO a weakened \nMega Charizard Y or take advantage of the sun it brings in general.<br>\n<br>\nUsage Tips<br>\n========<br>\n<br>\nAs with the previous set, getting Venusaur in early so it can Mega \nEvolve is extremely valuable when attempting to switch it in later \nthanks to the addition of Thick Fat and the increase in its defensive \nstats. Again, if you opt for Earthquake in the last slot, try to hide \nthe move until you''re sure you can hit your opponent''s Heatran with it. \nIn addition, capitalize on the power of Sludge Bomb in particular; \nVenusaur can actually take out its common checks such as Latios if it \nhits them on the switch, and most of these Pokemon cannot OHKO Venusaur \nin return.<br>\n<br>\nTeam Options<br>\n========<br>\n<br>\nThis variant of Venusaur is particularly useful on bulky offensive \nteams. Heatran, Rotom-W, and Aegislash all have excellent synergy with \nVenusaur and perform well under this playstyle, making them ideal \nteammates. Excadrill is another good example of this, capable of taking \nFlying- and Psychic-type attacks while Venusaur easily defeats the \nWater- and Fighting-types it struggles against. Lastly, Bisharp and \nTyranitar are great teammates for Venusaur, though Venusaur should not \nrun Synthesis if used alongside the latter.<br>'),
(12, 'Offensive Mega Charizard-Y', 'charizardmegay', 'drought', 'Timid', 'charizarditey', 255, 'dragonpulse', 'fireblast', 'focusblast', 'solarbeam', 31, 31, 31, 31, 31, 31, 0, 0, 4, 252, 252, 0, '<b></b>&lt;p&gt;What sets Mega Charizard Y apart from Mega Charizard X is the \nmassive Special Attack increase and access to Drought. With Drought \nbacking his Fire STAB attacks Mega Charizard Y really cannot be taken \nlightly, solely based on power it has to be a threatening wallbreaker. \nWith solid bulk, he is capable of taking a couple hits and and being \nable to stick around in battles while still posing a main threat to the \nother team. However, his base 100 Speed is pretty underwhelming, him \noutsped by many Pokemon naturally, which can be of an issue.&lt;/p&gt;<br>\n<br>\n&lt;p&gt;This set is meant to take advantage of the massive Special \nAttack that Mega Evolution grants. Fire Blast is your primary STAB and \nallows you to blow holes in the other team to Pokemon that don''t resist \nFire. Focus Blast will to easily 2HKO Specially defensive Tyranitar in \nthe Sand without the need for Stealth Rock being present. Solarbeam will\n hit bulky Water-types that will switch in to absorb a Fire Blast, such \nas Vaporeon or Politoed. Lastly, Dragon Pulse is need for Mega \nCharizard-Y to but able to hit Dragonite and Goodra, as you can''t beat \nGoodra and don''t enough damage to Dragonite to be significant. Roost is \nan option that allows for some recovery if you have taken some hits or \nswitched in while Stealth Rock was up on your side of the \nfield.&lt;/p&gt;<br>\n<br>\n&lt;p&gt;Good teammates include those who are able to Rapid Spin and \nreliably beat Tyranitar. Excadrill is able to clear Stealth Rock and can\n take out Tyranitar with Earthquake or Iron Head. Despite Mega Charizard\n Y''s great Special Attack, he can''t hope to muscle past Blissey and \nChansey, so any teammate that is able to combat those two one-on-one are\n greatly appreciated, allowing Mega Charizard Y to freely roam. Strong, \nphysically offensive Pokemon such as Breloom, Excadrill, and Lucario are\n all good options for this role. To help make Mega Charizard Y deal with\n his low speed,a Sticky Web user on the team is recommended. Another \noption for the Speed issue would be using Tailwind over Roost and giving\n your entire team a temporary boost. This comes at a significant cost to\n your longevity, however.&lt;/p&gt;<br>');
